INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2, 'Caravan rear-view mirror, split', 29, 69.9, 'Universal model with double mirror, the outer mirror is adjustable and increases the viewing area to the rear. Easy fitting, with neoprene straps, for both right and left-hand sides. Dimensions for the entire mirror construction: 185 x 127 mm. Sold individually.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-573_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3, 'Stick-on mirror', 14, 49.9, 'For simple repair of broken and cracked side vehicle mirrors. Suitable for both cars and trucks. DIY kit containing one sheet of plastic mirror glass and double-sided adhesive tape. Vehicle mirrors are delivered with a layer of protective plastic to prevent scratches. Easy cutting, no special tools required. Not approved by Svensk Bilprovning (Swedish Vehicle Inspection Agency).', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/33-710_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (4, 'Rear-view mirror, 180 x 55 mm', 16, 29.9, 'Rotatable mirror for attaching to the interior windscreen. Suitable as an extra mirror when e.g. practising to drive.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/33-112_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (5, 'Rear-view mirror, 110 x 45 mm', 24, 24.9, 'Rotatable mirror for attaching to the interior windscreen. Suitable as an extra mirror when e.g. practising to drive.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/33-112_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (6, 'Wide-angle mirror', 8, 36.9, 'For mounting to existing side mirrors. Provides a better view when e.g. overtaking and parking. Fittings included.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000034853/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (7, 'Car make-up mirror', 39, 22.9, 'Self-adhesive mirror for fitting to e.g. sun visors.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000034942/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (8, 'Rear-view mirror, 80 x 50 mm', 9, 42.9, 'Small, flexible extra mirror for a greater rear field of view. Supplied with two fasteners, suction cup and clip.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/33-115_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (9, 'Wide-angle mirror', 30, 22.9, 'To see the blind spot. Mounted to the outer/interior rear-view mirror. Self-adhesive.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/33-123_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (10, 'Fuel Can, 20 l', 31, 129.0, 'Plastic. Equipped with a carry handle and flexible extension pipe for simple, no-spill filling.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-253_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (11, 'Fuel Can, 10 l', 26, 54.9, 'Plastic. Equipped with a carry handle and flexible extension pipe for simple, no-spill filling.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-256_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (12, 'Jerry Can, 20 l', 31, 199.0, 'Classic army model in painted sheet steel. With rustproofed interior. Suitable for petrol, diesel, ethanol and oil. UN-certified.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-103_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (13, 'Fuel Can, 5 l', 28, 34.9, 'Plastic. Equipped with a carry handle and flexible extension pipe for simple, no-spill filling.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-255_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (14, 'Jerry can, 20 l', 36, 149.0, 'Classic army style jerrycan made of plastic. Can be used for petrol and diesel. Flexible spout included.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-267_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (15, 'Diesel tank, transportable, 200 l', 20, 5499.0, 'Strong diesel tank that safely and cleanly handles and stores diesel for agricultural machinery, forestry machinery and construction machinery. With a moulded splash plate and fork bushings for forklift handling, the container is both practical and simple to move. The tank can be used both indoors or outdoors and the pump connects to a 12 V vehicle battery with crocodile clips.Equipment:Self-priming wing pump and pump handle with automatic shut-off.Lockable lid (padlock not included).Hose with pressed swivel connectors and filter strainer inside the tank.Fuel gauge that shows the current level in the tankNOTE! For diesel only!', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/82-968_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (16, 'Petrol Can, ethanol, 5 l', 6, 59.9, 'Strong and practical plastic petrol can. Intended for or ethanol (E85). With carry handle and flexible extension pipe.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-265_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (17, 'Jerry Can, 10 l', 31, 139.0, 'Classic army model in painted sheet steel. With rustproofed interior. Suitable for petrol, diesel, ethanol and oil. UN-certified.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-102_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (18, 'Refill Nozzle', 40, 69.9, 'Sheet steel refill nozzle with flexible rubber spout. For jerry cans. With rubber gaskets to prevent leakage. Fits items 39-102, 39-103.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-104_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (19, 'Flat Fuel Can, 10 l', 26, 159.0, 'Flat petrol can in red-painted sheet metal. Stands stably thanks to the flat design and low centre of mass.  Plastic spout (30 cm) included. Air hole for faster emptying. Suitable for petrol, diesel, ethanol and oil. UN-certified.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-110_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (20, 'Jerry Can Pump', 16, 109.0, 'Pump for convenient, spill-free fuel refilling from heavy fuel cans. Hose length: 1000/460 mm. Fits Biltema''s jerry cans 39-102 and 39-103.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-105_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (21, 'Jerry can gasket', 32, 14.9, 'Gasket suitable for Jerry Can 39-102 and 39-103.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-164_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (22, 'Full Cover, 406 x 165 x 120 cm', 40, 349.0, 'Four-layered cover that is UV-resistant and breathable. Made of non-woven material and PE. Protects the car from sunlight, dirt, frost and snow. Remains soft and flexible even in the winter. With elasticised front and back edges and elastic strap with buckle.For long-term storage, keep in mind that exposure to direct sunlight, rain and wind can affect and change the material in the covering. Dirt and water may enter from below. Clean with a damp cloth.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-267_xl_1.jpg');
