INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (24, 'Sun and Snow Shield, 82 x 168 cm', 15, 29.9, 'A padded protection for the windscreen which effectively reflects and insulates against sun and heat in the summer and prevents ice accumulation in the winter. Stored rolled up. Place the protection on the front windscreen with the foil side outwards. Open the door and fix the protection between the door and door post.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-502_xl_1.jpg');
