INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (74, 'Engine heater cell', 16, 179.0, 'An efficient hose heater with 0.5 m cable. For hose connection. Hose clamps supplied. Manufactured in Sweden. Can only be combined with Biltema''s engine and cabin heating systems as follows: Connector Cable 40-202 or 40-203, Extension Cable 40-204 - 40-206 and Multi-Socket 40-207.The engine block heater affects the coolant inside the block, which is heated up and begins to circulate. For maximal temperature to be obtained, the heater only needs to be connected for 3-4 hours. Prolonged connection will increase electricity costs. Warning: the heating element must be covered in coolant.', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/40-209_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (75, 'Engine heater cable compatible with Calix, 2.5 m', 7, 129.0, 'Biltema''s connection cable is made in Sweden from oil-resistant RDO. The cable can withstand temperatures down to -40 °C.Cable for connection between a car device inlet and electrical outlet. Regularly check the earth connection all the way from the earthed outlet to the car body, cabin socket, and engine heater. Also check the connection cable regularly to ensure that it is not damaged or worn.NOTE!A damaged cable must be discarded immediately.Store the connection cable indoors when not in use.The connection cable must not be placed on the ground when not connected to the vehicle.Close the protective cover on the connector when not in use.Do not let the cable lie on the ground when connected.The connection cable must not be repaired or modified.The connection cable may only be connected to an earthed socket.The connection cable must not be used to charge electric-hybrid batteries – it is only designed for engine heating systems', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/40-213_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (76, 'Engine heater cable compatible with DEFA, 2,5 m', 13, 129.0, 'Biltema''s connection cable is made in Sweden from oil-resistant RDO. The cable can withstand temperatures down to -40 °C.Cable for connection between a car device inlet and electrical outlet. Regularly check the earth connection all the way from the earthed outlet to the car body, cabin socket, and engine heater. Also check the connection cable regularly to ensure that it is not damaged or worn.NOTE!A damaged cable must be discarded immediately.Store the connection cable indoors when not in use.The connection cable must not be placed on the ground when not connected to the vehicle.Close the protective cover on the connector when not in use.Do not let the cable lie on the ground when connected.The connection cable must not be repaired or modified.The connection cable may only be connected to an earthed socket.The connection cable must not be used to charge electric-hybrid batteries – it is only designed for engine heating systems', '2023-05-15 15:12:27', 1, 'https://productimages.biltema.com/v1/image/imagebyfilename/40-213_xl_1.jpg');
