INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (146, 'Booster cushion', 10, 159.0, 'Comfortable booster cushion for children who are between 125-150 cm tall and weigh 22-36 kg.Approved in accordance with ECE R129/3.With belt guide and cover that can be removed and washed.The booster cushion can be used in all vehicles with 3-point safety belts approved in accordance with ECE R16 or equivalent standards.The booster cushion is only intended for forward-facing use in the front or rear seats.Designed to provide maximum comfort and safety for the child.The booster cushion is very easy to use, which minimises the risk of incorrect positioning.Correctly used, the booster cushion significantly minimises the risk of injury in the event of an accident.The cover forms an integral part of the booster cushion, meaning the booster cushion must not be used without the cover.IMPORTANTIf the car has a connected airbag at the front passenger seat, the child must be at least 140 cm tall to be able to sit in the front seat. Place the booster cushion on the car seat and secure the belt as shown in the picture. NOTE! Ensure the child is sitting fully against the car backrest before tightening the safety belt. The safety belt must be placed over the child’s shoulder, NOT the neck. Equally important is for the safety belt to run under the armrest as shown in the picture. Never leave a child unattended on the booster cushion and do not modify the booster cushion in any way.WARNING!If the booster cushion is subjected to heavy stress, e.g. a hard impact or collision, the booster cushion must be replaced with a new one to guarantee safety.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-840_xl_1.jpg');
