INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (147, 'Booster seat', 28, 549.0, 'Comfortable booster seat for children who are between 100-150 cm tall and weigh 15-36 kg.Approved in accordance with ECE R129/3.With belt guide and cover that can be removed and washed.Adjustable headrest with Memory Foam.Can be used in all vehicles with 3-point safety belts approved in accordance with ECE R16 or equivalent standards.The booster seat is only intended for forward-facing use in the front or rear seats.Designed to provide maximum comfort and safety for the child.The booster seat is very easy to use, which minimises the risk of incorrect positioning.Correctly used, the booster cushion significantly minimises the risk of injury in the event of an accident.The cover forms an integral part of the booster seat, meaning the booster seat must not be used without the cover.IMPORTANTIf the car has a connected airbag at the front passenger seat, the child must be at least 140 cm tall to be able to sit in the front seat. Place the booster seat on the car seat and secure the belt as shown in the picture.NOTE!Ensure the child is sitting fully against the car backrest before tightening the safety belt. The safety belt must be placed over the child’s shoulder, NOT the neck. Equally important is for the safety belt to run under the armrest as shown in the picture. Never leave a child unattended in the booster seat and do not modify the booster seat in any way.WARNING!If the booster seat is subjected to heavy stress, e.g. a hard impact or collision, it must be replaced with a new one to guarantee safety.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-844_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (148, 'Booster seat with ISOFIX attachment', 37, 699.0, 'Comfortable booster seat for children who are between 100-150 cm tall and weigh 15-36 kg.Approved in accordance with ECE R129/3.With belt guide and cover that can be removed and washed.Adjustable headrest with Memory Foam.Can be used in all vehicles with ISOFIX attachment points or 3-point safety belts approved in accordance with ECE R16 or equivalent standards.The booster seat is only intended for forward-facing use in the front or rear seats.Designed to provide maximum comfort and safety for the child.The booster seat is very easy to use, which minimises the risk of incorrect positioning.Correctly used, the booster cushion significantly minimises the risk of injury in the event of an accident.The cover forms an integral part of the booster seat, meaning the booster seat must not be used without the cover.IMPORTANTIf the car has a connected airbag at the front passenger seat, the child must be at least 140 cm tall to be able to sit in the front seat. Place the booster seat on the car seat and secure the belt as shown in the picture.NOTE!Ensure the child is sitting fully against the car backrest before tightening the safety belt. The safety belt must be placed over the child’s shoulder, NOT the neck. Equally important is for the safety belt to run under the armrest as shown in the picture. Never leave a child unattended in the booster seat and do not modify the booster seat in any way.WARNING!If the booster seat is subjected to heavy stress, e.g. a hard impact or collision, it must be replaced with a new one to guarantee safety.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-845_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (149, 'Booster seat', 27, 339.5, 'The child car seat has been tested and approved in accordance with ECE R44/04, and is only intended for forward-facing use in the front and rear seats. Approved for children 15-36 kg (approx. 4–12 years). Anatomic design provides optimal comfort. When the child has outgrown the car seat (the child’s ears are level with the top edge of the backrest), the backrest can easily be removed and the product can then be used as a booster seat.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-927_xl_1.jpg');
