INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (167, 'Car vacuum cleaner', 16, 169.0, 'Powerful and easy-to-use vacuum cleaner with high suction power owing to the incorporation of cyclone technology. With HEPA filter and fine-mesh filter. For connection to a 12 V cigarette lighter socket. Detachable collector. Brush and extension nozzles included.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/84-040_xl_1.jpg');
