INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (172, 'Car seat cushion, black', 37, 129.0, 'Soft and warming car seat cushion made from synthetic wool. It is comfy to sit on and also protects the car upholstery. The underside of the cushion has material that prevents it from slipping and is equipped with elastic bands and hooks or easy fitting around the seat.NOTE!Do not use on light-coloured car upholstery – the back of the cushion may discolour.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-130_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (173, 'Travel pillow, flexible', 15, 74.9, 'Lightweight and pliable travel pillow that can be shaped any which way. Close the zip and use for neck/lumbar support or as a hand warmer. Open the zip and use for lumbar support, or as a head pillow or seat cushion. Can also be folded for use as a phone/tablet stand. Soft polyester outer fabric and microfibre fill for best comfort. Perfect for traveling.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-790_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (174, 'Car Air Grate', 28, 49.9, 'Attaches to car window frames and improves ventilation. For best results, use in pairs to create a draught through the car. Fits most makes of car.NOTE!Remember that even with the air grate installed, the temperature in the car may become very hot. Never leave an animal alone in the car for extended periods.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/49-538_xl_1.jpg');
