INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (177, 'Digital thermometer with alarm function', 1, 94.9, 'With lit display that shows the selected temperature.Compact and easy to keep at home or in cars, boats and caravans.Alert signal via light/sound once a minute at outdoors temperatures between +3 and -1 °C.The alert signal can be deactivated.Outdoor sensor with 3 m cable.Battery included.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-340_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (178, 'Reading lamp', 24, 42.9, 'Rotating LED lamp with clamp fitting. The lamp can detach from the clamp and be used as a torch. Rotates 360°. 3 x LR1154 batteries included. Battery life: approx. 4 hours. Dimensions: 15 x 3 x 5 cm. Colour temperature: white light, 5500 K. 250 lumen. Plastic.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/32-350_xl_1.jpg');
