INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (182, 'Drinks holder and storage', 39, 36.9, 'Has space for two mugs and has a storage compartment. Can be placed between the seats or between the front seat and centre console.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-213_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (183, 'Drinks holder and tray', 16, 54.9, 'Easy to install and can be folded away. Perfect for mugs/bottles, food or small items. Dimensions: 26 x 22 x 6 cm. Attaches around the headrest. In black polyethylene.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-210_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (184, 'Car cup holder', 34, 159.0, 'Cup holder that keeps coffee warm or cools down a water bottle or can of soda. Practical cup holder able to both warm up and cool down beverages. Connects to the vehicle''s cigarette lighter socket.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-890_xl_1.jpg');
