INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (187, 'Car charger with two USB ports, 12/24 V', 27, 59.9, 'Compact, effective charger with capacity for two devices. Powers and charges mobile phones and other devices via USB. Connects to DC 12/24 V cigarette lighter socket.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/85-7970_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (188, 'Universal Mobile Phone Mount', 11, 169.0, 'Attractive and versatile mobile phone holder for one hand operation. Attaches to car air vents. Rotatable 360˚. For mobile phones with widths 5.3 - 8.8 cm. Rubber-clad grips prevent the mobile phone from sliding.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/22-330_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (189, 'Universal Mobile Phone Mount', 20, 169.0, 'Practical holder for mobile phones that can be easily used with one hand. The holder screws into the grille of the car’s air vent, which makes it secure and stable. This means you avoid problems with suction cups coming loose or glue coming off. The holder has a ball mount to tilt and rotate the mount to the desired position. Rubber-coated grips ensure that the phone does not slip out of the mount.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/22-331_xl_1.jpg');
