INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (194, 'USB charger 3 in 1, 12/24 V', 40, 129.0, 'Three smart functions in one! Charge mobile phones and other devices via USB. Check the car battery''s voltage and view the temperature in the cabin. With a digital display. Connects to the cigarette lighter socket.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-338_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (195, 'USB Charger, 4 ports', 15, 129.0, 'Practical car charger that lets you charge your smartphones or tablets in the front seats and back seats at the same time! Four USB ports each providing 2.4 A. The charging hub has clips which make it easy to attach to the seat pockets. Connects to the vehicle''s cigarette lighter socket.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-344_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (196, 'Cable organiser, 4 pcs.', 28, 16.9, 'Practical cable organiser keeps your cable installation neat and tidy. Self-adhesive for easy mounting.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-236_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (197, 'Anti-slip pad', 12, 29.9, 'The raised edges make it perfect for holding a mobile phone when used as GPS. Ideal for cars, boats, caravans, etc. Made of rubber. Sticks to almost any surfaces without leaving marks. Washable, reusable, non-magnetic, glue-free and UV-resistant.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-601_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (198, 'Anti-slip mat', 26, 24.9, 'A slightly larger non-slip pad ideal for mobile phones, MP3 players and sunglasses. The non-slip pad is made of sticky rubber and keeps mobile phones and other objects in place on vehicle dashboards. Sticks to almost any surface. It is washable, reusable, non-magnetic, glue-free and UV-resistant.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-602_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (199, 'Wirelwaa Charger', 35, 319.0, 'Base unit for charging of Qi-compatible devices via induction technology and the Qi standard. Can be used for smartphones with built-in Qi technology, mounted charging patch or charging shell. The base unit is charged via the supplied USB cable and adapter for 12/24 V cigarette lighter sockets. Various brackets sold separately.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/22-390_xl_1.jpg');
