INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (201, 'USB charger, 12 V, with emergency functions', 16, 79.9, 'USB charger with cigarette lighter plug for connection to a car''s 12 V outlet. The charger has two USB ports (5 V/2.4 A + 5 V/1 A) and can charge two devices simultaneously. The charger is equipped with emergency functions: a stainless steel tip which can be used to break a window, as well as a seatbelt cutter. Dimensions: 72 x 39 x 20.6 mm.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-330_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (202, 'USB charger with storage', 4, 49.9, 'Smart car charger with 3 USB sockets and practical storage. Connects to 12/24 V DC via a cigarette lighter socket.Input voltage: 1224 V DC Output voltage: 5 V DC Charge current: 3 sockets 1 A/1 A/2.1 A Dimensions: 106 x 101 x 130 mm Base diameter: 71 mm. Material: ABS plastic', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-345_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (203, 'CD slot mount with Ball Mount', 36, 49.9, 'Practical holder with ball mount allowing for 360˚ rotation. Fits to the CD slot of car stereos. The plates which are inserted into the CD slot are silicone-coated to minimise vibrations and prevent scratches. Secured with a screw. For use with wireless chargers 22-380, 22-390 or other devices that can be used with ball mounts. Dimensions: 103 x 40 x 75 mm. Weight: 64 g.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/22-393_xl_1.jpg');
