INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (206, 'USB charger, Duo 12/24 V', 11, 99.9, 'Compact, effective charger with place for two devices. Powers and charges mobile phones and other devices via USB. Connects to 12/24 V DC via a cigarette lighter socket. Output voltage 5 V DC. Charge current 2.4 (total). 1 m lightning cable with MFI licence supplied.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/84-8155_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (207, 'Neck pillow, 3-in-1', 36, 64.9, 'Practical neck pillow that can be used in three ways: as a neck rest, head pillow, or tablet holder. Perfect for travelling. Comfortably conforms to your neck and head. The neck pillow has two rubber straps and has corner tabs to hold a tablet. Soft plush outer fabric, and filled with micro-beads. Hand wash. Dimensions U-shape: 32 x 28 cm, square: 25 x 25 cm.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-791_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (208, 'Neck pillow', 6, 79.9, 'Exclusive model with memory foam that shapes itself to your body. A loop holds the pillow together at the neck and holds it in place. Sew-in case so that you can easily fold the pillow and store it in the bag. The cover is removable and washed by hand in lukewarm water. Size approx: (L) 28 x (W) 28 x (H) 11 cm.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/29-919_xl_1.jpg');
