INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (210, 'Keyring', 7, 4.9, 'Fun keyrings in several colours and with various features like capsule opners, medicine can, carbiner, bottle holder, whistle. Of aluminum.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-394_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (211, 'LED Keyring', 21, 59.9, 'Practical LED keyring that can be easily attached to outer garments or to a dog leash for better visibility in the dark. Switch between continuous light and three different flashing patterns with the touch of a button. The light colour can also be changed.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/24-999_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (212, 'Backrest pocket with tablet pocket', 20, 89.9, 'Practical organiser for toys, beverages, and other items that are good to have close at hand on road trips. Transparent pocket with touchscreen function for using and storing tablet. The organiser also has a compartment with a cover, a large compartment tat closes with hook-and-loop fasteners, an open compartment, two mesh compartments, and one ring. Attaches to the front seat with hook-and-loop fasteners. Made of 600D polyester.The tablet pocket is 280 x 245 mm.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-650_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (213, 'Back support pocket', 10, 79.9, 'Polyester. For mounting to the back of car seats (hook-and-loop fastening). Also works as a kick protector. 4 compartments with covers, cup holder and 2 pen pockets. For e.g. pens, paper, books, soft toys, etc.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-628_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (214, 'Glasses holder', 35, 22.9, 'Practical and stylish holder for glasses/sunglasses. Attaches easily to a sun visor with the supplied clip. Glasses can be clipped on with a simple one-handed action. Can also clip onto bags, etc.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-618_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (215, 'Smart car storage pouch', 11, 22.9, 'Practical storage pouch for fitting between a front seat and the centre console. Ideal for phones, pens, small items, rubbish, etc. Can also catch dropped items. Suitable for most car models.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-648_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (216, 'Pen holder', 15, 14.9, 'Practical holder that fits most pens and cars. Attaches easily to car air vents.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-646_xl_.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (217, 'Pen holder', 19, 19.9, 'Practical holder for pens. Black plastic. Adhesive backing.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/30-226_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (218, 'Ashtray with lid', 21, 34.9, 'Handy ashtray with lid which fits into the cup holders in most makes of car. Minimises smoke and odours from cigarettes. Easy to clean. Made of UV-resistant polyethylene.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-652_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (219, 'Waste bin/Ashtray', 21, 69.9, 'Small waste bin that fits in to your car''s cup holder. Can be easily removed and emptied. Can also be used as an ashtray. Aluminium bin and plastic lid.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-639_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (220, 'Litter bags, 15-pack', 39, 36.9, 'Practical box with 15 rubbish bags that attach with clips to e.g. seat back pockets. The bags are hung up by hooks which part of the clips.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-626_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (221, 'Waste basket with lid', 11, 49.9, 'Practical waste basket with rubber lid for use in cars, boats, caravans, etc. Plastic.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-654_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (222, 'Waste bin', 40, 26.9, 'For use in cars, boats, caravans, etc. Can also be used for storage. Comes with fastener and screws. Plastic.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-220_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (223, 'Parking disc', 7, 24.9, 'For indicating arrival time at time-limited car parking. Adheres to the inside of the windscreen.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-461_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (224, 'Ticket holder', 18, 12.9, 'Holds parking tickets, access cards, messages, etc. Easily attaches to the inside of car windscreens with double-sided tape.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-460_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (225, 'Sun film, supermørk, 76 x 300 cm', 31, 129.0, 'Fitted to reduce insight and dampen sunlight. Gives a cooler look and better climate inside the car. The film reduces around 99% of the UV-radiation which protects the car interior from bleaching and discolouration. It also reflects away around 10% of the heat radiation. Supplied complete with fitting instructions, rubber scraper and knife.The film helps to increase safety as it keeps the glass together in the event of an accident. Smoke-coloured film gives a discrete tone. Darkness reduces insight into the car interior but maintains visibility outwards. Super-dark is useful if no visibility into the vehicle is wanted at all, for example in service vehicles where tools are kept,etc. It can, however, be more difficult to see out in hours of darkness.', '2023-05-15 15:12:27', 2, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-775_xl_1.jpg');
