INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (271, 'Rear view camera, digital 7', 7, 1799.0, 'Wireless digital transfer, which gives a more stable signal and longer range compared to analogue cameras.Perfect for the car, mobile home, caravan, boat or horsebox (one camera monitors inside the trailer and the other behind it).With a 7 high-definition monitor, guide lines for judging distance and a reversible image.Split screen function enabling you to see both cameras simultaneously.Wireless transfer with up to 100 m range.2 waterproof wide angle cameras with built-in transmitters fitted easily with the supplied bracket.Automatic light intensity adjustment with IR light.The monitor is fitted to the dashboard or sun visor/neck restraint.Easy installation.Power cable with adapter for cigarette lighter socket.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-169_xl_1.jpg');
