INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (274, 'Rear view camera with integrated DVR camera', 18, 1399.0, 'Wireless digital transfer, which provides a more stable signal and longer range compared to analogue cameras.* Perfect for use in cars, motorhomes, caravans or as home surveillance.* With a 4.3 high-definition monitor, guide lines for judging distance and a reversible image.* The monitor is equipped with a DVR camera for filming ahead.* Card slot for TF memory card, max. 32 GB.*Waterproof wide-angle camera with built-in transmitter which can be easily fitted behind vehicle licence plates with the supplied bracket.* Wireless transfer with a range up to 100 m.* Automatic light amplification with IR light.* The monitor can be mounted to the windscreen using the flexible suction cup.* Power cable with adapter for cigarette lighter socket.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-171_xl_1.jpg');
