INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (427, 'Fuel sensor', 7, 129.0, 'For installation in the fuel tank and connects to Fuel Gauge 32-222. The gauge is only intended for tanks containing petrol or diesel. It is not corrosion-resistant to water.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/32-225_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (428, 'Instrument holder', 40, 34.9, 'Instrument holder for gauges with a diameter of Ø 52 mm.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/32-272_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (429, 'Oil sensor adapter', 3, 189.0, 'Adapter for both oil pressure and oil temperature sensors Supplied with three different-sized nipples with 3/4–16, M20–1.5 and M18–1.5 threads, which allow for installation in most cars. Conical blind plugs included for connection holes that are not used. The thread in the connection holes is 1/8 NPT (standard for sensors).Instructions:Unscrew the original ''spin-on'' oil filter.Then screw in the adapter in place of the oil filter.NOTE: The rubber gasket/O-ring must be next to the engine.Finally, screw the oil filter on top of the adapter.NOTE: The oil filter''s rubber gasket must NOT have an external diameter greater than Ø 78 mm and must NOT have an internal diameter less than Ø 56 mm.Install the selected sensor.The connection holes on the adapter that are not used must be ''sealed'' with the supplied blind plugs.DO NOT start the engine before the sensor or blind plugs are screwed into all four of the adapters connection holes.Test start the engine! Check for any oil leakage.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/32-2005_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (430, 'Tachometer, analogue, free-standing', 18, 389.0, 'Tachometer with shift light. Adjustable RPM setting at which the red warning lamp illuminates and indicates when to gear up. Supplied with a yellow cover to place over the warning lamp when it is dark outside. Seven selectable background colours: green, yellow, white, purple, turquoise, dark blue and red. Memory function for latest selected background colour. For 1-10 cylinder engines. For free-standing mounting.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/32-259_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (431, 'Boost gauge, analogue', 26, 145.0, 'Round analogue boost gauge with silvery frame, black digits and red display. A button on the front of the gauge allows the colour of the backlit display to be changed: green, yellow, white, purple, turquoise, dark blue, and red. Memory function for latest selected background colour. For recessed installation or for mounting to dashboards.  Supplied with T-pipe, PVC hose, fittings, and installation instructions.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/32-250_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (432, 'Oil pressure gauge, analogue, colour', 29, 189.0, 'Round analogue oil pressure gauge with silvery frame, black digits and red display. A button on the front of the gauge allows the colour of the backlit display to be changed: green, yellow, white, purple, turquoise, dark blue, and red. Memory function for latest selected background colour. For recessed installation or for mounting to dashboards.  Supplied with sensor, fittings, and installation instructions.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/32-254_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (433, 'Single relay, closed-circuit, 30 A', 13, 42.9, 'Relay compatible with most cars. Use to connect headlamps, horn, fan motor, pump motor or other devices requiring power. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.The difference between the relays is the internal connection to the pins. On this relay, the rear transverse pin is marked 86. Check the pins on the existing relay.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000049767/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (434, 'Single relay with fuse, closed-circuit, 30 A', 10, 42.9, 'Relay compatible with most cars. Use to connect headlamps, horn, fan motor, pump motor or other devices requiring power. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.Connection:Pin 30is connected to the plus supply from the battery to the consumer.Pin 87is output and connected to consumers.Pin 85is control +Pin 86is control -', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-305_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (435, 'Indicator relay 12 V', 32, 49.9, 'To signal a fault warning, the light flashes faster than normal. DIN standard. Suitable for e.g.: Alfa-Romeo, Audi, BMW, Ford, Opel, Saab, Volvo and VW.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000017800/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (436, 'Single relay, alternating, 40 A', 30, 42.9, 'Relay compatible with most cars. Use to connect headlamps, horn, fan motor, pump motor or other devices requiring power. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.Connection:Pin 30: Connected to batteryPins 85 and 86: Connect one of them to ground and the other to control plus. The pins are polarity independent because they control the relay coil.Pin 87: Connected to power consumer.Pin 87a: Connected to power consumer.Pin 30 is connected to plus (provided that the relay should provide a plus voltage). It must be connected to the supply mains voltage as the pin is permanently connected to the relay contact. Should the relay give a minus voltage, pin 30 is connected to minus.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000049773/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (437, 'Single relay, alternating, 20/30 A', 39, 46.9, 'Relay compatible with most cars. Use to connect headlamps, horn, fan motor, pump motor or other devices requiring power. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000049768/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (438, 'Double relay, closed-circuit, 40 A', 6, 74.9, 'Relay compatible with most cars. Use to connect headlamps, horn, fan motor, pump motor or other devices requiring power. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000017796/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (705, 'Double tapering tool', 27, 1199.0, 'For single and double tapering of brakepipes. For thin-walled steel, aluminium and copper pipes. Complete with pipe jaws and attachments for the following dimensions: 3/16, 1/4, 5/16, 3/8. Intended for fitting in bench-top vice. Supplied in injection-moulded plastic box.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1260_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (439, 'Single relay, alternating, 50/80 A', 7, 49.9, 'Relay compatible with most cars. Use to connect headlamps, horn, fan motor, pump motor or other devices requiring power. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.ConnectionPin 30= Battery voltage +12 V.Pin 87= Max 80 A consumer.Pin 87a= Max 50 A consumer.Pin 85= Minus (chassis).Pin 86= Breaking +12 V.When the relay is connected, it is +12 V out on pin 87a, when +12 V is connected on pin 86, the coil pulls and switches over to pin 87.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-306_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (440, 'Relay plinth, extendible', 34, 34.9, 'Plinth for powered or switching relays with up to five pin connectors. Several plinths can be interconnected. With eye bolt for easy attachment.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-314_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (441, 'Single relay with double outputs, closed-circuit, 30 A', 34, 46.9, 'Relay compatible with most cars. Use to connect headlamps, horn, fan motor, pump motor or other devices requiring power. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000049769/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (442, 'Relay socket', 35, 22.9, 'Relay socket for powered/switching relays with five-pin contacts.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-315_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (443, 'Double relay with fuse, closed-circuit, 30 A', 8, 74.9, 'Relay suitable for connecting headlamps and auxiliary lights. With holder for separate installation.NOTE: Not intended for LED auxiliary lights/pulsed signals, such as flashing with short/fast intervals that may cause the relay to short-circuit and overheat.ConnectionS = earth.B = Battery/main currentL1 = Light 1 (125 W total)L2 = Light 2 (125 W total)S1 = Control current 1S2 = Control current 2The S1 and S2 can be connected to either existing spot lamps or to the switch on the vehicle steering wheel. A fuse is not needed here because the control current only controls whether the relay should turn on the light.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-307_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (444, 'Indicator Relay', 19, 19.9, 'Indicator Relay for Volvo. Suitable for Volvo Amazon 121, 122, 123GT from chassis number 140000- and Duett 210 from chassis number 8275-, 142, 144, 145, 164 without warning indicator lights.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/43-134_xl_1.jpg');
