INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (476, 'Solar panel, 100 W', 17, 799.0, 'Polycrystalline solar cells in aluminium frame. A climate-smart alternative for boats, caravans, cottages and mobile homes. Perfect for charging batteries. Must always be used with a regulator. With 90 cm cable, 2,5 mm². NOTE! Must not be stepped on.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5082_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (477, 'Portable solar panel, 100 W', 26, 1399.0, 'Monocrystalline solar cell with built-in PWM regulator. Complete system for portable use. Perfect for camper van, caravan, boat or car where you have greater power needs. USB output for charging e.g. a mobile phone. Easy and quick to install and get started. Folds up and is carried like a bag. Five metre cable with battery clamps included.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5080_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (478, 'MPPT Controller, 20 A', 4, 849.0, 'A highly reliable solar panel controller with the latest technology. Up to 35% more efficient than a standard PWM controller. Large, clear LCD display and MPPT technology that maximises charging. Works on sealed, open, and lithium batteries. Temperature sensor for efficient charging included.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5077_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (479, 'Solar Panel Controller PWM, 20 A', 4, 299.0, 'Controller with PWM technology that can handle higher current, 20 A. 3-stage controller that keeps your batteries charged. The USB port can be used to charge mobile phones, tablets and other devices. Fully programmable load port that can be activated after sunset, for example, for night lighting. Display for monitoring voltage, battery temperature and error codes.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5076_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (480, 'Solar panel, 50 W', 23, 399.0, 'Polycrystalline solar cells in aluminium frame. A climate-smart alternative for boats, caravans, cottages and mobile homes. Perfect for charging batteries. Must always be used with a regulator. With 90 cm cable, 2,5 mm². NOTE! Must not be stepped on.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5081_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (481, 'Solar cell ventilator with battery', 19, 499.0, 'Perfect for boats, caravans, horse transports, etc. With built-in rechargeable battery. Stainless steel cover with low profile. Fitted with a switch to toggle between intake suction and evacuation of air. Automatically starts in the last selected mode after a discharge.', '2023-05-15 15:12:27', 3, 'https://www.caspianpolicy.org/no-image.png');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (482, 'Portable solar panel, 30 W', 38, 529.0, 'Monocrystalline solar cell with built-in PWM regulator. Complete system with all necessary accessories for easy use. Works just as well for fixed installation as for portable use. With all the accessories you need to charge your battery. NOTE! Must be connected to a 12 V battery! Must not be stepped on.AccessoriesCable 1: Length: 2.4 m. For connection to solar panel, DC output. Waterproof.Cable 2: Length: 2.4 m. For connection to 12 V battery (with clamps).2 cigarette lighter contacts (male & female).', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5085_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (483, 'Solar Panel Controller, MPPT, 10 A', 1, 499.0, 'An MPPT regulator is up to 20 % more efficient than standard regulators. The regulator is equipped with temperature compensation, and short-circuit, overcharge, and overload protection.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5099_xl_1.jpg');
