INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (485, 'MC4 connectors', 10, 64.9, '1 male, 1 female. 56 cm cable (splice on, or connect to regulator).', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5092_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (486, 'Solar Panel, bendable, 50 W', 23, 929.0, 'The climate-smart alternative for boats, caravans, cottages and mobile homes. Perfect for charging batteries. Must always be used with a regulator. With 90 cm cable. NOTE! Cannot be stepped on.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5097_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (487, 'Solar panel mount, universal, 2-pack', 5, 179.0, 'Fits 25 mm tubes. Easy to angle towards the sun.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/25-5095_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (488, 'Solar Panel', 9, 699.0, 'Portable charger in protective case for charging 12/24 V batteries.* Switchable between 12 and 24 V. Ideal for use in cars, caravans, and boats.* The fold-out legs make it easy to angle the panel towards the sun.* Adapter cable with battery clamps, cigarette lighter socket and cigarette lighter plug included.* A charge regulator is recommended for long-term use31-635.* The panel is protected against splashing water but is not waterproof.* With LED to indicate charging level.* Output: 13 W.* Weight: 4.2 kg.Dimensions: 525 x 340 x 40 mm.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/31-632_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (489, 'Jump Starter, 12 V, 600 A', 22, 499.0, 'Jump starter with strong cables and battery terminal clamps. With cigarette lighter socket, battery indicator, and a built-in, maintenance-free AGM battery with overload protection. Power adapter for 230 V supplied. Designed for use in vehicles and boats. Can be used as a 12 V power source and for charging electronic equipment via a USB socket (5 V). Lowest operating temperature: -30 °C.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-9060_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (490, 'Jump starter 12 V with power bank, 1200 A', 19, 799.0, 'Compact and very powerful jump starter for 12 V electrical systems with built-in lithium battery. The booster functions as a starter battery when connected to a car battery via two jumper cables. The jump starter provides high current for a short period to start the engine. The booster is easy to carry and can be stored in the car. Can also be used as a powerful power pack to charge e.g. smartphones.LCD showing battery capacity and process status.15 V adapter with cigarette lighter socket for powering devices.Two USB A 3.0 ports with Quick Charge support.Built-in torch.Smart starter cables that detect when a secure power source is connected and protect against short-circuiting.Charges via the supplied USB C cable connected to a power adapter (not included).', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-914_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (491, 'Jump starter 12 V with power bank, 800 A', 5, 549.0, 'Compact jump starter for 12 V electrical systems with built-in lithium battery. The booster functions as a starter battery when connected to a car battery via two jumper cables. The jump starter provides high current for a short period to start the engine. The booster is easy to carry and can be stored in the car. Can also be used as a powerful power pack to charge e.g. smartphones.Indicator lamps showing battery capacity and process status.Two USB A 3.0 ports with Quick Charge support.Built-in torch.Smart starter cables that detect when a secure power source is connected and protect against short-circuiting.Charges via the supplied USB C cable connected to a power adapter (not included).', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-912_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (492, 'Jump starter 12 V with cordless power bank, 800 A', 28, 649.0, 'Compact jump starter for 12 V electrical systems with built-in lithium battery. The booster functions as a starter battery when connected to a car battery via two jumper cables. The jump starter provides high current for a short period to start the engine. The booster is easy to carry and can be stored in the car. Can also be used as a powerful power pack with wireless charging for e.g. smartphones and has USB A ports for charging USB devices.LCD showing battery capacity and process status.Wireless charging with Qi technology, 10 W.Two USB A 3.0 ports with Quick Charge support.Built-in torch.Smart starter cables that detect when a secure power source is connected and protect against short-circuiting.Charges via the supplied USB C cable connected to a power adapter (not included).', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-913_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (493, 'Jump-start, 12 V, 450 A', 7, 1249.0, 'Jump-start using technology that absorbs energy from a discharged battery to charge the jump-starter''s condenser and then start the vehicle''s engine. The jump-starter is consequently maintenance-free and can be kept uncharged in the car for years, and still provide start assistance in emergency situations as long as the car battery is not fully depleted. The jump-starter can also be charged via a 12 V socket or USB if you need to start a vehicle with a depleted or damaged battery.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-756_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (494, 'Jumper cables, 35 mm²', 38, 219.0, 'Jumper cables made of CCA wire (copper alloy aluminium cable).. With soft insulation and a fully-insulated handle. Easy to handle even in severe cold. Supplied in convenient packaging.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/24-578_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (495, 'Jumper cables, 25 mm²', 24, 105.0, 'Jumper cables made of CCA wire (copper alloy aluminium cable).With soft insulation and a fully-insulated handle. Easy to handle even in severe cold. Supplied in convenient packaging.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/24-577_xl_1.jpg');
