INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (498, 'Jump leads with electronic guard', 5, 219.0, 'Starting cables made of CCA wire. The black negative cable is equipped with a device which reduces the risk of damage to the car''s electronics and electrical system. With soft insulation and a fully-insulated handle. Easy to handle even in severe cold. Supplied in convenient packaging.', '2023-05-15 15:12:27', 3, 'https://productimages.biltema.com/v1/image/imagebyfilename/24-579_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (499, 'LED Work Light, GEN II, 12 W', 11, 149.0, 'Second-generation work lights with reflector-controlled lighting (diodes directed against the reflector) that make it easier to control the light beam for more directional lighting. The energy consumption is lower compared to most LED lamps where the LEDs are directed towards the front. Compact aluminium lamp housing with polycarbonate lens. OSRAM LED cells with white light. CE and E-certified.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-787_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (500, 'Work light, 24 W', 8, 189.0, 'A small, multifunctional work light offering maximum performance. The compact design allows it to be mounted in smaller spaces around the vehicle, which makes it easy to conceal. The reflectors produce balanced light distribution, which makes the light useful in various applications, e.g. on a quad bike, truck stairs or as a reverse light. Automatic temperature control prevents the light from overheating and extends its service life. Each component in the light is carefully selected to withstand the Nordic climate. The lens is made of polycarbonate and the aluminium housing is resistant to salt and other stresses. The work light comes with an integrated male Deutsch connector (DT connector) and a loose connection cable with a female DT connector for easy installation. Approved in accordance with ECE R10 and E-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-714_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (501, 'LED Work Light, GEN II, 24 W', 13, 179.0, 'Second-generation work lights with reflector-controlled lighting (diodes directed against the reflector) that make it easier to control the light beam for more directional lighting. The energy consumption is lower compared to most LED lamps where the LEDs are directed towards the front. Compact aluminium lamp housing with polycarbonate lens. OSRAM LED cells with white light. CE and E-certified.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-788_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (502, 'LED Work Light, 30 W', 14, 219.0, 'A sleek, multifunctional work light with maximum performance that creates a neat overall impression. The compact design allows it to be mounted in smaller spaces around the vehicle, which makes it easy to conceal. The lamp glass has no edges (no-edge lens), which prevents dirt, ice, and snow from accumulating on the glass. The reflectors produce balanced light distribution, which makes the light useful in various applications, e.g. on a quad bike, truck stairs or as a reversing light. Automatic temperature control prevents the light from overheating and extends its service life. Each component in the light is carefully selected to withstand the Nordic climate. The lens is made of polycarbonate and the aluminium housing is resistant to salt and other stresses. The work light comes with a male Deutsch connector (DT connector) mounted on the light and a loose connection cable with a female DT connector for easy installation. Bracket and mounting screw included. The work light is approved in accordance with ECE R10 EMC and CE-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-712_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (503, 'LED Work Light, 40 W', 18, 299.0, 'A sleek, multifunctional work light with maximum performance that creates a neat overall impression. The compact design allows it to be mounted in smaller spaces around the vehicle, which makes it easy to conceal. The lamp glass has no edges (no-edge lens), which prevents dirt, ice, and snow from accumulating on the glass. The reflectors produce balanced light distribution, which makes the light useful in various applications, e.g. on a quad bike, truck stairs or as a reverse light. Automatic temperature control prevents the light from overheating and extends its service life. Each component in the light is carefully selected to withstand the Nordic climate. The lens is made of polycarbonate and the aluminium housing is resistant to salt and other stresses. The work light comes with a male Deutsch connector (DT connector) mounted on the light and a loose connection cable with a female DT connector for easy installation. Bracket and mounting screw included.  The work light is approved in accordance with ECE R10 EMC and E-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-700_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (504, 'LED Work Light, 27 W, Flood', 8, 149.0, 'Perfect for heavy vehicles, four-wheelers, trucks and other vehicles or heavy machinery that requires good and bright work lighting. Stainless steel bracket supplied. Power is easily connected to the outgoing cable (20 cm). CE marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-742_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (505, 'Interior lighting LED', 35, 159.0, 'Thin, versatile torch for use in e.g. vans and work vehicles. High-effect LEDs and On/Off switch. Cable and mounting screws included.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-241_xl_1.jpg');
