INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (508, 'LED Work Light, 27 W', 31, 149.0, 'Perfect for work machines, four-wheelers, trucks and other vehicles or heavy machinery that requires good and bright work lighting. Stainless steel bracket supplied. The light has a service life of more than 30000 / 50000 hours. Electrical power is easily connected to the outgoing cable (20 cm).', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-745_xl_1.jpg');
