INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (510, 'Work light with wide beam angle', 6, 399.0, 'LED work light designed for work machinery, ATVs, forklifts, etc. Black aluminium housing and polycarbonate glass. Supplied with stainless steel fittings. Connect the supplied cable (19 cm) to power. Connect the cable connector to the light.. CE and E-certified.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-759_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (511, 'Cordless taillights with magnetic mount', 9, 699.0, 'Practical lamp set with cordless LED rear lights for trailers. Magnetic bracket to easily attach the lights to magnetic surfaces on e.g. boat trailers or other unregistered trailers. Perfect for use as temporary rear lights. The rear lights are adapted for CANBUS systems and have rear, brake and licence plate lights, as well as indicators. Supplied with 7-pin trailer connector with transmitter, charging cable and cigarette lighter plug with USB socket for charging the lights. For vehicles with a 12/24 V electrical system. E-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-471_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (512, 'Magnetic rear lamps for trailers', 27, 219.0, 'Useful lamp set with LED rear lights for trailers. Perfect as temporary rear lights. With rear, brake and licence plate lights, as well as indicators. The magnets make attachment/detachment simple. Supplied with magnetic attachment, 2.5 m cable between the lights, 7 m connection cable and 7-pole trailer socket. E-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-257_xl_1.jpg');
