INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (514, 'Rear lights with magnetic bracket', 10, 369.0, 'Useful lamp set with LED rear lights for trailers. Magnetic bracket to easily attach the lights to magnetic surfaces on e.g. boat trailers or other unregistered trailers. Perfect for use as temporary rear lights. The rear lights are adapted for CANBUS systems and have rear, brake and licence plate lights, as well as indicators. Supplied with magnetic attachment, 2.5 m cable between the lights and 7-pin trailer connector. E-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-470_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (515, 'Trailer Light Bar', 26, 319.0, 'Light bar for use on trailers and towed vehicles. The light bar has E-marked LEDs for indicators, reverse and brake lights, as well as reflectors. Supplied with a 7 m cable and 7-pole trailer connector, along with 2 tensioning straps for mounting.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-283_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (516, 'Rear lamp, LED, 252 x 133 mm, with reflector, right', 12, 329.0, 'Combination lamp with functions for rear, reverse, fog,and brake lights as well as indicators and an integrated triangular reflector. LED rear lamp for mounting on the right side at the back of the trailer. Supplied with connection cable and mounting screws. The lamp is waterproof and E-marked.NOTE: Not compatible with vehicles with CANBUS.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-245_xl_1.jpg');
