INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (518, 'Rear lamp, LED, 110x110 mm', 33, 115.0, 'Square LED rear lamp with functions for rear and brake lights and turn indicators. The rear lamp can be mounted to both the right and left side at the back of a trailer. Supplied with connection cable and mounting screws. The lamp is waterproof and E-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-242_xl_1.jpg');
