INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (525, 'Side marker lamp, orange', 2, 34.9, 'Rectangular lamp suitable for use as position or rear light on cars, trailers and caravans. Bulb not included. Suitable bulb: W5W T10. E-marked.', '2023-05-15 15:12:27', 4, 'https://productimages.biltema.com/v1/image/imagebyfilename/42-178_xl_1.jpg');
