INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (675, 'Nut remover set, 10 parts', 40, 469.0, 'For removing damaged nuts. Open design, which means even nuts on pin bolts can be removed. Only fits right-hand threaded nuts.Contains 10 hex sockets.Dimensions: 8, 10, 11, 12, 13, 14, 15, 16, 17 and 19 mm.Supplied in an injection-moulded plastic case.NOTE! Only for manual use (NOT for use with nut drivers)', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1346_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (676, 'Pin bolt extractors, 4 parts', 27, 229.0, 'For removing damaged, rusted, and broken pin bolts.Extremal 21 mm hex grip.Dimensions (Ø x length): 6 x 60 mm, 8 x 60 mm, 10 x 70 mm, 12 x 70 mm.CrV steel.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1316_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (677, 'Front Chassis Tool for inner steering joints', 9, 429.0, 'Special tool for gentle and easy mounting/removing steering links. Can be used for diameters between 35 and 45 mm without needing to change sockets.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1506_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (678, 'Removal Tool', 5, 229.0, 'Universal model. Made of CrMo and SK5 steel. The arms are rotatable for internal/external grip, and movable for 2- or 3-arm function. The arms can also be adjusted in fixed angles to make the work easier. Claws with large contact surfaces so as to not damage the workpiece. Span: 0-100 mm', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/20-3402_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (679, 'Impact driver', 36, 89.9, 'For use with 1/2 sockets. Reversible for use with both left and right-hand threaded screws.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1579_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (680, 'Brake Spring Tool', 23, 79.9, 'Facilitates fitting/removal of brake springs and wires.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/72-028_xl_1.jpg');
