INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (682, 'Camber gauge', 6, 369.0, 'For easy adjustment of negative/positive camber 0–6°. With magnetic fastener for attaching to brake discs when working on front chassis. Supplied in an injection-moulded plastic case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1302_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (683, 'Brake calliper file', 22, 145.0, 'Cemented carbide file with plastic shank. With teeth on both sides.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1296_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (684, 'Brake caliper tool, 17 parts', 25, 369.0, 'Socket set for brake calipers on Porsche, Audi and Volkswagen, Pentagon bits and bit sockets for Bendix and Girling braking systems on Citroën, Peugeot, Renault, Vauxhall, Opel and Smart, as well as universal hex bits that can be used for fitting and removing brake systems on other car models.Contains:Made of CRV steel3/8” DRx50 mm L H93/8”DRx65 mm L H73/8”DRx92 mm L H73/8”DRx100 mm L H111/2”DRx55 mmL Pentagram 10 mmMade of S2 steel¼”DRxH93/8”DRxH73/8”DRxH8Made of CRMO steelAS-2210PTx11,5 mm10PTx15 mm10PTx20 mm7PTPentagram 10 mmPentagram 12,5 mmPentagram 14 mmPentagram 19 mm', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/71-090_xl_1.jpg');
