INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (688, 'Brake piston tool, pneumatic', 34, 899.0, 'Compressed air-driven universal tool for pressing home the brake piston in the brake calliper. The tool allows pistons to be easily reinserted without risking any damage to the calliper or rubber joint boot, which may occur if normal tools are used.NOTE!Only for use with copper pipes.The set contains:1 pneumatic compression tool.18 compression plates in assorted sizes:#0 = General Motors#2 = Citroen XM, Xantia u.a.#3 = Alfa Romeo, Audi, Austin, BMW, Ford, Honda, Jaguar, Mitsubishi, MB, Nissan, Rover, Toyota, VW#4 = Alfa Romeo 164 2.0, Ford, Mazda, Saab 9000, Subaru#5 = Adapter with 3/8 inner 4-pt.#6 = Nissan Primera, VW Golf IV#7 = Audi 80, 90, V8 + 100, Ford Sierra ABS + Scorpio AB 85, Honda Prelude, Nissan Silvia 1.8 Turbo, Rover 8000, Saab 9000, Subaru L+Z, VW Golf + Passat#8 = General Motors#p = General Motors#Z = Renault#G = Opel#E = Nissan, Maxima#10 = Citroen#11 = Hyundai#12 = Ford Mondeo#13 = Saab, Honda#14 = Citroen C5#15 = Renault Master#M= Opel Vectra-08', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1262_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (689, 'Brake piston tool Kit, 5 parts', 23, 229.0, 'Tool for pressing/screwing the brake piston back onto the calliper with self-adjusting handbrake. Necessary when replacing brake pads.NOTE! Only for use on left-hand pistons. Press tool, pressure plate and 3 adapter discs included. For Citroen, Renault, Audi and others. Supplied in a practical partitioned plastic case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1424_xl_1.jpg');
