INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (707, 'Brake pipe flaring kit', 14, 999.0, 'For quick and easy brake pipe flaring. The brake pipe and be cut and then easily flared without having to remove the brake pipe. Hydraulic screwdriver with aluminium clamp tool. Complete with pipe jaws and flaring punches for the following pipe dimensions: Pipe jaws: 3/16, 1/4, 4.75 mm. Flaring punches: 4.75 DIN, 1/4 DIN, 3/16 OP1, 1/4 OP1, 1/4 OP2.NOTE! Only for use with copper pipes.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1261_xl_1.jpg');
