INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (709, 'Screw thread repair kit (mm), 21 parts with 110 adapters', 40, 599.0, 'Complete kit for repairing damaged screw threads. The damaged thread is replaced with a new thread adapter. The kit consists of drill bit, screw tap and fitting tool for M5 x 0.8, M6 x 1.0, M8 x 1.25, M10 x 1.5 and M12 x 1.75, as well as 25 x screw adapters in stainless steel for each of M5-M10 and 10 x for M12. Supplied in a sturdy metal case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1372_xl_1.jpg');
