INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (713, 'Screw thread repair kit, brake calliper', 6, 449.0, 'When working on brake callipers it is common that the sliding bolt threads break. With this kit you can replace old, broken threads with adapters in stainless steel. The kit is suitable for VAG, Ford and Opel. Not suitable for brake callipers made of aluminium.Includes the following:Drill bitsScrew tap10 threaded inserts in stainless steel (M9 x 1.25) with copper washersAllen key (7 mm)Template', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1523_xl_1.jpg');
