INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (716, 'Thread Adapters', 36, 19.9, 'Stainless steel thread adapters. For replacing damaged threads. Fits Thread Repair Kit19-1372.Thread	Qty	Art.no. M5 x 0.8	2519-1377M6 x 1.0	2519-1378M8 x 1.25	2519-1379M10 x 1.5	2519-1380M12 x 1.75	1019-1381', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1377_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (717, 'Bar bending tool set', 4, 1499.0, '12-tonne hydraulic bar bender for thick bar dimensions.Suitable for e.g. bending roll bars in folk racing cars.Comes with 6 different bar bending tools for bars in the following dimensions: 1/2, 3/4, 1, 1 1/4, 1 1/2, 2.Copes with thicknesses of 7-8 mm.If the bar is thin or made of aluminium, it should be filled with sand, otherwise the bar bender will end up flattening the bar.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-376_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (718, 'Rörbockningsverktyg, 15 mm', 6, 189.0, 'A pipe bender is an indispensable tool for achieving the correct bends on pipes during installations. This manual pipe bender is easy to use and facilitates all types of pipe routing.For copper, brass and aluminium piping. The angles 30°, 60°, 90°, 120°, 150° and 180° are pre-marked on the tool.For 15 mm pipes.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/86-056_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (719, 'Rörbockningsverktyg, 12 mm', 15, 169.0, 'A pipe bender is an indispensable tool for achieving the correct bends on pipes during installations. This manual pipe bender is easy to use and facilitates all types of pipe routing.For copper, brass and aluminium piping. The angles 30°, 60°, 90°, 120°, 150° and 180° are pre-marked on the tool.For 12 mm pipes.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/86-055_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (720, 'Pipe-bending tool, Ø 6, 8, 10 mm', 23, 179.0, 'For copper, brass and aluminium piping.Graduation: 0-180°.For 3 different pipe dimensions: Ø 6, 8, 10 mm.Radius:Ø 6 mm = r22mmØ 8 mm = r20mmØ 10 mm = r18mmTool markingsThe O mark is used to measure the angle when bending.R & L are reference marks for marking where to start bending to ensure the correct radius around the corner.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/12-227_xl_1.jpg');
