INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (723, 'Pipe cutter, 3 – 30 mm', 23, 79.9, 'For copper, brass and aluminium piping.Cuts Ø 3–30 mm (1/8–1 1/8), also close to the pipe flange.Supplied with spare cutting wheel in the handle, and fold-out deburring tool.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1221_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (724, 'Fork Wedge Set, 5 parts', 1, 229.0, 'Universal removal tool for loosening ball joints, spindle joints, etc.The set contains: 3 interchangeable forks with 17, 24, and 28 mm openings, shaft with locknut (length 200 mm), and an adapter for pneumatic chisel hammers (length 180 mm).Supplied in a compression-moulded plastic box.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1317_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (725, 'Spindle joint tool', 37, 579.0, 'Mounting tool for spindle joints on Volvo cars, needed to avoid damaging the ball joint.Contents: Press tool, 2 alignment bolts, 3 adapters: M12 x 1,5 – M14 x 1,5, M12 x 1,5 – M12 x 1,75, M12 x 1,5x – M14 x 2.Replaces OEM number 9995796.Recommended accessories: Sledgehammer with M12 x 1.5 mm adapter screw thread.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1001_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (726, 'Clutch alignment tool', 6, 115.0, 'For aligning clutches in most European and Japanese passenger cars and vans. With holder, conical guide socket and 8 alignment sockets. Can be used when the centre hole of the flywheel has a diameter of 11, 15, 16.5, 17, 19, 20, 20.5 or 25 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1435_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (727, 'Centring tool', 30, 1099.0, 'Universal centring tool for clutch plate both with and without guide/pilot bearings.Centres the disc with the pressure plate and thus facilitates assembly with the flywheel.  Can be used with most discs and pressure plates and replaces the guide pins/centring devices that can most often only be used for one type of clutch mechanism.Can also be used where pilot/guide bearings in the crankshaft are missing. Interchangeable sockets for installation of discs with centre holes from 10 mm to 30 mm diameter.Using this tool the work of centring the disc to the pressure plate can be done on the bench and can thereafter be mounted as a single unit onto the flywheel.Contains pilot bearing/guide bearing adapters with centre holes Ø10 mm to 30 mm, adapter for pressure plate, holder and cone adapter.For most cars, light trucks, etc.Illustrated instructions in English are included.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1578_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (728, 'Spring compressor, McPherson', 15, 2299.0, 'Spring compressor with replaceable arms.For removal/fitting suspension springs on all types of McPherson struts.Fits springs with diameters of Ø 80–115 mm, Ø 110–150 mm, Ø 140–195 mm.21 mm hexagonal fitting.Supplied with 3 pairs of arms.Arms are covered with plastic protection.NOTE! Approved for use with nut driver.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1355_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (729, 'Spring compressor, 2-pack', 11, 169.0, 'With 4 forged grips.Internal 1/2 mount and external 21mm hex mount for sockets or spanners.Not suitable for nut drivers.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1003_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (730, 'Shock-absorber spring compressor', 26, 799.0, 'Complete set for fitting/removing rear axle coiled springs, especially in confined spaces.Spring plate dimensions: 60 – 120 mm, 120 – 170 mm.With torque rod, hex key (8 x 280 mm), combination spanner(19 mm) and spindle (100 – 250 mm).CrV steel.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1586_xl_1.jpg');
