INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (735, 'Front wheel bearing tool set', 39, 899.0, 'For fitting/removing hubs and wheel bearings in front-wheel drive cars without having to remove knuckles and struts. Can be used directly on the car. Since knuckles and struts do not need to be removed, front suspension alignment does not need to be carried out after work is completed. Can also be used to remove rear wheel bearings. Supplied in a compression-moulded plastic case with practical carrying handle.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1319_xl_1.jpg');
