INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (767, 'Tyre mounting paste, 5 kg', 3, 129.0, 'Tyre mounting paste with corrosion protection for quickly and safely fitting tyres on rims. Makes fitting and removing tyres easier since the tyre does not get stuck on the rim. The paste is easy to apply to the tyre using a brush. It distributes evenly and dries quickly. Using mounting paste reduces the risk of damage to the tyres and rims when fitting/removing tyres. In addition, it reduces wear and tear on the tyre fitting machine and equipment. The product must be stored and used at room temperature.ApplicationApply thinly to the tyre inner edge using a brush or sponge. For truck and EM tyres, also apply to the rim base and the inclined axle ring. This allows the tyre to easily slide on the rim without damage. The use of tyre mounting paste ensures a technically perfect fit of the tyre to the rim, making subsequent balancing easier.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 6, 'https://www.caspianpolicy.org/no-image.png');
