INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (831, 'Bevelling Tool', 9, 699.0, 'Bends edges 45 degrees in existing holes in different types of sheet metal with a thickness of up to 3 mm. Bevelling makes the metal more rigid and gives it a professional look. Bevel length is approx. 8 – 10 mm. The tool must be used with a hydraulic press, or with high quality screws, nuts and counter-holds (not included).', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/71-813_xl_1.jpg');
