INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (834, 'Magnetic tool, 1 kg', 16, 69.9, 'Picking tool in pen model with magnet on telescopic arm. For retrieving bolts, nuts and other items from hard-to-reach places.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1564_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (835, 'Magnetverktyg, 3,6 kg', 40, 74.9, 'För upplockning av skruvar, muttrar etc. på svåråtkomliga utrymmen. Kraftig magnet på teleskopskaft av rostfritt stål. Pennmodell med PVC-överdraget handtag. Omagnetiskt hölje runt magneten underlättar upplockningen.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1349_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (836, 'Magnetic set, 3 parts', 30, 99.9, 'Tool set that makes it easy to keep order in parts and screws.Magnetic bowl To collect nuts. With rubber-cladd base to prevent scratches. Diameter: 108 mm. Depth: 22 mm.Telescopic magnetic tool. To pick up parts that have been dropped. Length: 159–844 mm. Magnet capacity: 2.2 kg.Telescopic mirror. For examining parts in small spaces. Length: 172-489 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1559_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (837, 'Pick-up magnet, 5 kg', 31, 74.9, 'Strong magnet with 5 kg magnetising force. Perfect for picking up nails or pulling tools and other objects from hard-to-reach places. Telescopic shaft 60 – 99 cm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/71-1002_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (838, 'Work torch with magnet', 14, 69.9, 'Handy mechanic''s torch with dual light sources and which fits perfectly into your breast pocket. Side light with bright and wide beam output: CoB LED 1.5W/100 lm. Front light with directional beam output: Power LED 1W/40 lm. Powerful magnet attaches easily to the vehicle''s bonnet, etc. Easy-grip rubber.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/24-967_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (839, 'Magnetic tool holder', 37, 199.0, 'With holder for nut driver and 4 sockets, as well as a hook for hanging a compressed air hose or electrical cable. Equipped with special magnets able to hold weights up to 15 kg.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1293_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (840, 'Magnetisk skål med LED-belysning, ∅148 mm', 37, 59.9, 'Slipp bli av med skruvar och muttrar när du arbetar med bilen. This magnetic bowl also has an LED light (batteries included). Av rostfritt stål', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/71-1062_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (841, 'Locking Tool, VAG', 17, 1699.0, 'For locking camshafts/crankshafts when replacing cam belts on the following VAG models.Audi:A2 (01-06)A3 (01-07)A4 (99-07)A6 (98-07)Seat:Arosa (99-05)Ibiza/Cordoba (02-07)Altea (04-07)Leon (00-07)Toledo (04-07)Alhambra (99-07)Skoda:Fabia (00-07)Roomster (07)Octavia (00-07)Superb (02-07)VW:Lupo (99-05)Polo (99-07)Fox (05-07)Golf/Bora (98-07)Jetta (05-07)Beetle (00-07)Passat (98-07)Touran (03-07)Sharan (99-07)Caddy (03-07)Transporter (03-07)', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1463_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (842, 'Fuel pressure gauge', 12, 1999.0, 'For checking fuel pressure in petrol engines with fuel injection.NOTE! NOT suitable for diesel engines. Supplied with an assortment of nipples and hoses. Suitable for most European, Japanese and American makes. Supplied in a compression-moulded plastic case with practical carrying handle.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1322_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (843, 'Fuel pressure gauge', 8, 105.0, 'Checks the suction and pressure capacity of fuel pumps and the vacuum in cylinders, suction pipes and vacuum systems.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1366_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (844, 'Cylinder gauge', 17, 429.0, 'For measuring diameters and ovality in e.g. cylinders. Measurement range 50–100 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1510_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (845, 'Cylinder leak tester', 2, 599.0, 'Locates any cylinder leakage by testing for the presence of exhaust gases in the cooling system. Complete kit with hand pump, adapter, and fluid indicator. Supplied in an injection-moulded plastic case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1299_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (846, 'Radiator pressure tester kit', 20, 1299.0, 'For checking leakage in cooling systems. Contains a manual pump with gauge, a hose, and several adapters for radiator openings in most European and Japanese vehicles.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1297_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (847, 'Coolant filler', 31, 579.0, 'For easy refilling of coolant without the risk of air pockets in the cooling system, and for locating any leaks. Complete with gauge, hoses, and universal rubber cone adapter. Pneumatic.Can be used together with Radiator Pressure Tester Kit 19-1297 and its various radiator cap adapters.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1364_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (848, 'Socket Sensor Set, 7 parts', 38, 419.0, 'For fitting/removal of lambda sensors, oil pressure sensors, etc. CrV steel sockets. 3/8 and 1/2 square drives.The set contains sockets for the following:pressure/vacuum switch, 29 mmvacuum switch, 7/8vacuum switch, 7/8oil pressure switch, 27 mmoil pressure switch, 1 1/16long socket for lambda sensors, 7/8short socket for lambda sensors, 7/8', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1265_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (849, 'Socket for lambda probes', 5, 69.9, 'For fitting/removal of lambda probes and vacuum valves. With internal 3/8 square-drive fitting for socket drivers and and an external 1 drive for fixed spanners.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/10-644_xl_1.jpg');
