INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (852, 'Drive pulley removal set', 17, 499.0, 'Tools for removing drive pulleys and vibration dampers. The integrated bearing makes the job simpler and minimises risks. Slotted puller plate, 12 bolts in four different sizes, and 9 threaded adapters to fit most engines. Supplied in a compression-moulded plastic case with practical carrying handle.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1318_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (853, 'Alternator Socket Set', 9, 499.0, 'Socket set for removing alternators and free-wheel drive pulleys made by Bosch, Marelli, and Valeo. For most types of vehicles. Supplied in a compression-moulded plastic box.This set contains the following parts:M10 splines x 1/2 D for Bosch alternatorsT50 x 1/2 DHex bits: 8/10 mmSpline bits: M8/M10Torx bits: T40/T502 x 1/2 D M10 spline bits: 110 mm/64 mm1/2 D adapter for 10 mm hex2 drive pulley couplings and 2 adaptersHex adapters 21 x 28 mm2 adapters 30mm/33 teeth; H17, H221 adapter Ø35 mm x 36 mm; 4 pins x H17', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/71-058_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (854, 'Drive pulley tool set, 5 parts', 8, 499.0, 'Ideal for loosening/tightening drive pulleys, tensioning pulleys, cam gears, etc. 5 long sockets with bent shafts for good accessibility. Plastic-covered and easy-grip handles.Sizes: 13, 15, 16, 17, 19 mm. Supplied in an injection-moulded plastic case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1495_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (855, 'Alternator Socket Set', 9, 269.0, 'Socket set for removing alternators and free-wheel drive pulleys made by Bosch, Marelli, and Valeo. For most types of vehicles. Supplied in a compression-moulded plastic box.The set contains the following: M10 spline bits x 1/2 D for Bosch alternators T50 x 1/2 D Hex bits: 8/10 mm Spline bits: M8/M10 Torx bits: T40/T50 2 x 1/2 D M10 spline bits 110 mm/64 mm 1/2 D adapter for 10 mm hex 2 drive pulley connectors and 2 adapters Hex adapter 21 x 28 mm', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1385_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (856, 'Piston ring compressor', 31, 105.0, 'Protects piston rings and makes fitting pistons easier. Heavy-duty model with self-locking feature. For pistons Ø 57-125 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1330_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (857, 'Valve lapping paste, fine/coarse, 2 x 35 g', 38, 74.9, 'Oil-blended silicon carbide paste.Contains fine and coarse abrasive.Laps quickly and produces an even, pressure-proof valve fit.', '2023-05-15 15:12:27', 6, 'https://www.caspianpolicy.org/no-image.png');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (858, 'Valve lapping rods', 25, 69.9, 'For lapping valve seats.For use together with valve lapping paste.With wooden shafts and rubber suction cups.Lengths: 245 and 255 mm.Suction cup Ø: 19/22 and 22/32 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1393_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (859, 'Diesel fuel filter tool', 34, 89.9, 'Special tool for changing fuel filters in Volvo diesel engines. OEM reference 9997084.Engine codes: D5244T3, D5244T4, D5244T5, D5244T6, D5244T7, D5244T14, D5244T15, D5244T16, D5244T17, D5244T18, D5244T19, D5244T2, D5244T23, D4204D, D4204T5, D5204T2, D5204T3, D5204T7, D5244T, D5244T10, D5244T11, D5244T12Vehicle models: S80 (2006-), V70 XC (2001-) / XC70 -2007), S60, C30, C70 (2006-), S40 (2004-), V50, V70 (2008-), XC70 (2008-), XC90, V70 (2000-2008)', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1648_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (860, 'Installation tool for fuel filter cap, VAG', 38, 199.0, 'Press tool for installing fuel filter caps in Audi, VW, Skoda and Seat diesel engines. The tool can be used both for UFI and MANN fuel filter caps, which normally require two different tools. The tool is a must during installation to ensure no leakage occurs, which is common when using screws to attach the cap. The tool can normally be used without detaching the hoses on the top.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1635_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (861, 'Spark plug socket set', 33, 105.0, 'Articulated ratchet handle (265 mm) with 3/8 square drive.Adjustable between right/left motion.2 spark plug sockets: 5/8 (16 mm) and 13/16 (20.5 mm), with rubber insert and extender: 200 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/10-980_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (862, 'Feeler gauge mm/inches', 39, 46.9, 'Feel gauge with measurements in both inches and mm.Contents13 lengths 0.05-1 mm / 0.002-0,04:0.05 mm / 0.0020.10 mm / 0.0040.15 mm / 0.0060.20 mm / 0.0080.25 mm / 0.010.30 mm / 0.0120.40 mm / 0.0160.50 mm / 0.020.60 mm / 0.0240.70 mm / 0.0280.80 mm / 0.0320.90 mm / 0.0351.00 mm / 0.04', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/16-851_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (863, 'Spark plug thread repair kit', 20, 289.0, 'Steel inserts for replacing damaged spark plug threads.Spark plug thread M14 x 1.25.With screw tap and 5 inserts with different lengths.Insert lengths: 11.2, 17.5 and 19 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1341_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (864, 'Milling tool, atomizer, 8 parts', 37, 599.0, 'For cleaning/milling the atomizer''s seat at the top and cleaning of glow-plugs. The milling tool is used to clean the injector seat before fitting the atomizer to prevent leakage, which could otherwise easily occur due to soot accumulation and rust. Suitable for use with all modern Common Rail-type diesel engines.NOTE! Do not go too deep when working on the top.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1507_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (865, 'Spark plug socket 3/8, long, 14 mm', 30, 79.9, 'Long twelve-point socket with thin walls and magnet. For spark plugs that are located deep in the cylinder head, which is common in modern four-valve engines.Properties:Magnet:Holds the spark plug both when removing and fittingThin-walled:Provides good margin to the walls of narrow spark plug holesCross-knurled:Grooved grip surface on the socket end that makes it possible to thread the spark plug with precision and force into sensitive aluminium cylinder headsChromed:Durable surface with high corrosion resistanceNOTE! Spark plug threads are sensitive to skew threading or excessive tightening torque.Reduce the risk of damage with a suitable torque spanner e.g. Biltema 10-264.Follow the vehicle manufacturer’s recommended tightening torque.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/20-046_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (866, 'Spark plug socket 3/8, long, 16 mm', 17, 79.9, 'Long twelve-point socket with thin walls and magnet. For spark plugs that are located deep in the cylinder head, which is common in modern four-valve engines.Properties:Magnet:Holds the spark plug both when removing and fittingThin-walled:Provides good margin to the walls of narrow spark plug holesCross-knurled:Grooved grip surface on the socket end that makes it possible to thread the spark plug with precision and force into sensitive aluminium cylinder headsChromed:Durable surface with high corrosion resistanceNOTE! Spark plug threads are sensitive to skew threading or excessive tightening torque.Reduce the risk of damage with a suitable torque spanner e.g. Biltema 10-264.Follow the vehicle manufacturer’s recommended tightening torque.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/20-048_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (867, 'Spark plug socket 1/2, 16 mm', 8, 59.9, 'Hex socket with spring-loaded locking balls. For spark plugs that are not too deep in the cylinder head e.g. on two-valve engines.Properties:Locking balls:Holds the spark plug both when removing and fittingSpanner grip:Hex spanner grip for loosening stuck spark plugs with spanner (NOTE: do not tighten with spanner. High risk of excessive torque that damages the threads. Use a torque spanner to tighten the correct torque)Glossy chrome plating:Wear-resistant surface with high corrosion resistance that is easy to wipe clean of oil and dirt from the engineNOTE! Spark plug threads are sensitive to skew threading or excessive tightening torque.Reduce the risk of damage with a suitable torque spanner e.g. Biltema 10-264.Follow the vehicle manufacturer’s recommended tightening torque.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/10-966_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (868, 'Spark plug socket 3/8, extra-long, 16 mm', 18, 129.0, 'Extra-long twelve-point socket with thin walls and magnet. For spark plugs that are located very deep in the cylinder head, which is sometimes the case in modern four-valve engines.Properties:Extra-long:Good range without extensionMagnet:Holds the spark plug both when removing and fittingThin-walled:Provides good margin to the walls of narrow spark plug holesCross-knurled:Grooved grip surface on the socket end that makes it possible to thread the spark plug with precision and force into sensitive aluminium cylinder headsChromed:Durable surface with high corrosion resistanceNOTE! Spark plug threads are sensitive to skew threading or excessive tightening torque.Reduce the risk of damage with a suitable torque spanner e.g. Biltema 10-264.Follow the vehicle manufacturer’s recommended tightening torque.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/20-040_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (869, 'Spark plug socket 1/2, 21 mm', 23, 59.9, 'Hex socket with spring-loaded locking balls. For spark plugs that are not too deep in the cylinder head e.g. on two-valve engines.Properties:Locking balls:Holds the spark plug both when removing and fittingSpanner grip:Hex spanner grip for loosening stuck spark plugs with spanner (NOTE: do not tighten with spanner. High risk of excessive torque that damages the threads. Use a torque spanner to tighten the correct torque)Glossy chrome plating:Wear-resistant surface with high corrosion resistance that is easy to wipe clean of oil and dirt from the engineNOTE! Spark plug threads are sensitive to skew threading or excessive tightening torque.Reduce the risk of damage with a suitable torque spanner e.g. Biltema 10-264.Follow the vehicle manufacturer’s recommended tightening torque.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/10-967_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (870, 'Spark plug socket 3/8, thin, 14 mm', 8, 59.9, 'Hex socket with thin walls and spring-loaded locking balls. For spark plugs that are not too deep in the cylinder head e.g. on two-valve engines.Properties:Locking balls:Holds the spark plug both when removing and fittingThin-walled:Provides good margin to the cylinder headSpanner grip:Hex spanner grip for loosening stuck spark plugs with spanner (NOTE: do not tighten with spanner. High risk of excessive torque that damages the threads. Use a torque spanner to tighten the correct torque)Glossy chrome plating:Wear-resistant surface with high corrosion resistance that is easy to wipe clean of oil and dirt from the engineNOTE! Spark plug threads are sensitive to cross threading or excessive tightening torque.Reduce the risk of damage with a suitable torque spanner e.g. Biltema 10-264.Follow the vehicle manufacturer’s recommended tightening torque.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/10-964_xl_1.jpg');
