INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1023, 'Inspection camera, recordable', 11, 949.0, 'Waterproof and high-quality digital borescope in a portable, robust and ergonomic format that records HD video and takes photos. Suitable uses include troubleshooting and repairing diesel and petrol vehicles, inspection of hard-to-reach and dark spaces, plumbing, construction and renovation, science and adventure in nature.The inspection camera is equipped with a rechargeable lithium-ion battery, colour display with real-time view and 2x zoom, and a camera probe on a 1 m flexi-cable with six LEDs with adjustable brightness in a ring around the lens. The camera probe is threaded and has interchangeable tools to pick up objects or look out of the lens at a 90º angle. Comes in a heavy duty instrument bag with foam inserts and metal snap locks.Accessories:1 x 16GB micro SD Card1 x micro USB charging cable3 x interchangeable probe heads: Magnet, hook and camera mirror', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-348_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1024, 'Inspection Camera, USB', 2, 279.0, 'Waterproof, digital borescope that records HD video and takes photos for troubleshooting and repairing diesel and petrol vehicles, inspection of hard-to-reach and dark spaces, plumbing, construction and renovation, science and adventure in nature.The camera probe is equipped with a 5 m flexi-cable with six LEDs with adjustable brightness in a ring around the lens, threaded camera head and interchangeable tools to pick up objects or look out of the lens at a 90º angle.PC:Connects to a computer and is controlled with the included software.Mac:Open Photo Booth and select USB Camera from menuAndroid:Use the USB CAMERA app from Play Store. Requires OTG-compatible phone and USB adapter.Accessories:3 x interchangeable probe heads: Magnet, hook and camera mirror1 x CD with camera program for computers', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-343_xl_1.jpg');
