INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1082, 'Engine trolley stand', 13, 649.0, 'Adjustable and easy-to-move engine trolley stand for most car engines.With 2 swivel and 2 fixed wheels, 4 adjustable fixation arms and 3 brakes for high stability when working on the engine.Fixing plate with 8 fixed locking positions which are easy to rotate by mean of an extended twist grip, rotatable through 360°.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-782_xl_1.jpg');
