INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1093, 'Hand trolley, foldable, 200 kg', 40, 379.0, 'Practical hand truck with folding load ledge, telescopic handle, pneumatic rubber wheels on plastic rims, and handle with knuckle protection that protects the hand from being pinched in door frames and against edges.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-384_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1094, 'Hand trolley, 200 kg', 32, 399.0, 'Classic hand truck/hand cart. Heavy-duty model with fixed load ledge, folding load toe and pneumatic rubber wheels on steel rims.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/26-7452_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1095, 'Moving trolley, 200 kg', 24, 129.0, 'Practical device for moving heavy objects, e.g. furniture, moving boxes, machines and construction materials. The moving dolly is made of MDF and has a textured anti-slip mat in black rubber on the top side. With four castors in hard plastic.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/47-0269_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1096, 'Stairclimber, three-wheeled, 150 kg', 27, 599.0, 'Heavy-duty hand truck with solid climbing wheels mounted in a star wheel design and handles with knuckle protection that protect the hand from being pinched in door frames and against edges. The stairclimber is suitable for moving goods on stairs with standard step height and over ledges and curbs.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-382_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1097, 'Platform trolley, foldable, 150 kg', 32, 249.0, 'Practical cart with two fixed wheels, two ball-bearing castors and a folding handle. Ideal for goods transport and warehouse environments.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/26-7453_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1098, 'Hand truck PT 1150, 2500 kg', 7, 3999.0, 'Hydraulic pallet truck with silent wheels and fully welded steel construction. Single wheels on the forks provide high manoeuvrability on level and hard surfaces.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/18-606_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1099, 'Combi trolley, 200 kg', 21, 249.0, 'Practical combined hand truck and cart, equipped with four solid rubber wheels on a strong steel frame. Using one hand, the combi-cart can be folded into a hand truck and vice versa.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/26-7450_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1100, 'Moving dolly with handle, 200 kg', 39, 249.0, 'Practical moving dolly with handle. Perfect for moving heavy items such as moving boxes or furniture. Adjustable steel handle (59-93 cm), which can be folded under the platform during storage.Made of an 18 mm thick MDF board (58 x 29 cm) with anti-slip mat of EVA plastic that keeps the load secure during transport. 4 wheels made of PP plastic and steel with swivel function for good manoeuvrability. Can be used for loads up to max. 200 kg. Height: 11 cm incl. wheels.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/47-0345_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1101, 'Pallet stop', 5, 69.9, 'Practical pallet stop for hand trucks and pallet trucks. Locks the wheel during transport or when not in use. Made of highly impact-resistant plastic.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/41-240_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1102, 'Luggage/parcel trolley, 90 kg', 16, 269.0, 'Foldable hand truck with ball-bearing rubber wheels.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/26-7451_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1103, 'Workshop press, 10000 kg', 35, 1899.0, 'Hydraulic workshop press with removable press piston and ideal for small workshops. Adjustable anvil height to accommodate larger workpieces.The workshop press is delivered complete with pressure gauge and 2 x V blocks.NOTE!Hydraulic oil not included.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-997_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1104, 'Press plate, universal', 19, 1099.0, 'Accessory for hydraulic presses. Makes it easier to set up wheel spindles and wheel hubs for pressing wheel bearings or trunnion arms for pressing bushings, for example. Three-point contact provides a safe support when mounting and dismantling.Contents: Baseplate with screw-threaded holes and swivelling section for flexibility; support bolts, washers and nuts.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-900_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1105, 'Vacuum tester and brake bleeding kit', 40, 499.0, 'Manually-operated vacuum pump for checking faults in engines, fuel systems, etc. Tests and checks vacuum engines/gauges, control valves, hoses and EGR valves, as well as other components and systems which require correct sealing and vacuum. Brake bleeding accessories also included. Supplied in an injection-moulded plastic case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1382_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1106, 'Indicator gauge', 33, 269.0, 'Analogue indicator gauge with gauge stand and magnetic foot. For use when measuring warping on brake discs, flatness of cylinder head, and fine adjustment when repairing engines and gearboxes. Supplied in a partitioned plastic case.Stand arm:Fine-tuning screw for precise adjustment and easy zeroing against surfaces.Indicator gauge:Swivel knob for zeroing the magnetic foot.Scale:V-shaped base that also allows attachment to cylindrical surfaces.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1443_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1107, 'Diesel tester common rail', 30, 699.0, 'Diesel tester for measurement and control of the return flow of injector valves of common rail type, with the aid of an external flow meter. Can monitor 6 injector valves simultaneously. Quickly and accurately measures the amount of fuel returned by each valve to the return container. The set contains four different models of injector adapters (6 per model), which fit injector valves from the brands BOSCH, SIEMENS, DENSO and DELPH.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1379_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1108, 'Leak tester', 20, 699.0, 'Tool kit to detect leakage on the pressure side of turbo systems. The test kit can also be used to test other systems.Complete kit with adapters, plugs and pressure gauge. Supplied in an injection-moulded plastic case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/72-000_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1109, 'Brake fluid tester', 19, 169.0, 'For quickly measuring the moisture content of brake fluid. Capable of measuring DOT 3, 4, 5.1.  With LEDs to easily read the measurements.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-242_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1110, 'Battery Hydrometer', 5, 24.9, 'Measures the specific gravity of the battery electrolyte.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-204_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1111, 'Battery Tester, Li-ion, Pro', 34, 449.0, 'Easy-to-read and accurate battery tester for lithium batteries and lead-acid batteries.Lithium batteries: CCA/BCI/CA/MCA/ EN/SEA—20-1000, DIN/IEC—20-700, GB—2-120 AhLead-acid batteries: CCA/BCI/CA/MCA/ EN/SEA—100-2000, DIN/IEC—100-1400, GB—30-220 AhTests battery status, start performance, and charging.Detects faults immediately.Connection protection that protects the operator, battery, and vehicle.Displays information in English and the Nordic languages.With CD and USB cable for connecting to computers and printers.Backlit LCD', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1383_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1112, 'Battery Tester', 1, 269.0, 'Digital instrument that effectively and quickly tests the condition and charge of all types of lead-acid batteries. With clear backlit display. Powered via the battery to which it is connected.Testing capacityCCA 100–1700 AEN 100~1700 AIEC 100~1000 ADIN 100~1000 AJIS# (100~1700 CCA)', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1365_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1113, 'Battery and Generator Tester', 38, 74.9, 'Test instruments with LEDs showing the battery and alternator condition. With magnetic fastener and cables with crocodile clips and test probe. Only for 12 V electrical systems.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-143_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1114, 'Cylinder leak tester', 5, 599.0, 'Locates any cylinder leakage by testing for the presence of exhaust gases in the cooling system. Complete kit with hand pump, adapter, and fluid indicator. Supplied in an injection-moulded plastic case.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1299_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1115, 'Cylinder leakage tester', 39, 799.0, 'Measures in percent and makes it easy to locate the leak. For petrol engines with 12, 14 or 18 mm spark plug threads. Pneumatic.Contents:Female quick-connectorMetric adapter M14 x 1.25 (with O-ring)Metric adapter M12 x 1.25 (with O-ring)Extension hosePressure gauge mounting unitPressure gauge for leaksPressure gaugeMale quick-connectorRegulatorAdapter hose.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1307_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1116, 'Timing light', 21, 249.0, 'Handy stroboscope lamp with pistol grip and detachable inductive pick-up that is easily clamped over the ignition cable. For adjustment and control of all 12-volt ignition systems. The xenon lamp produces highly concentrated light that makes the ignition mark and crankshaft gradation clearly visible.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1355_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1117, 'Cable Finder', 15, 135.0, 'Identifies and traces cables without damaging insulation. Easily tracks cables in cars to locate any circuits and cable damage. For max. 42 V DC. Comes with transmitter and receiver.Functions:Locates short circuitsLocates open circuitsLow battery level indicatorAdjustable volumePowered by 2 x 9 V batteries (not included)', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-236_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1118, 'Rotation counter', 16, 339.0, 'Microprocessor-controlled rotation counter that uses laser technology to provide fast, accurate and non-contact rotation measurement and total number of revolutions of different types of rotating objects. The laser technology is easy to use and allows for a wide measurement range with high resolution. The rotation counter can be attached to the rotating object using the self-adhesive reflective tape. The LCD display shows the highest, lowest, and most recent measurement value.Accessories:1 x storage case with belt holder1 x 9 V battery600 mm reflective tape', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-294_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1119, 'Spark Tester', 32, 49.9, 'Checks ignition sparks without having to remove the spark plug. For insertion between the spark plug and ignition cable.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-142_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1120, 'Test Light 3 – 48 V', 30, 39.9, 'Test light in pen format for use in vehicles. With two LEDs for voltage and polarity. Polarity: (-) (+) LED. With needle tip for measuring through cable sheaths.Areas of use:Cables, connectors, switches and relays.Alternators and charging systems.Rear window defrosters.Electric windows, electric seat warmers and central locking.Car stereos, electric antennas.Front and rear lights, brake lights, fog lights.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-669_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1121, 'Spark tester', 22, 69.9, 'Instrument for checking ignition spark of spark plugs, ignition leads and ignition coils without the need for dismantling or making holes in the ignition lead. With the engine running, the tool''s grooved end is positioned over the ignition cable. A flashing light indicates an ignition spark.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1372_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1122, 'IR thermometer, mini', 7, 129.0, 'Handy pocket-sized infrared thermometer that measures surface temperature using IR without contact.The IR thermometer has an optional hold function for the current value, max./min. temperature, continuous measurement and temperature scale in Celsius or Fahrenheit. Automatic battery saving function turns off the device after 15 minutes.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-245_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1123, 'Electrical circuit tester', 32, 69.9, 'Handy test instrument for measuring current and identifying defective electrical circuits in vehicles. A clear LCD display shows the current strength (A) of the circuit being measured. Connects to the fuse box flat pin socket (midi).', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-291_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1124, 'Reflective tape, rotation counter', 3, 24.9, 'Reflective tape for Rotation Counter 15-243.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-294_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1125, 'Diagnostic tool for VAG', 33, 799.0, 'An advanced error code reader for VW, Audi, Skoda and Seat as well as Bentley, Lamborghini and Bugatti, including models newer than 2016. The diagnostic tool is easy to handle and displays the error codes in clear text on a backlit colour screen. The interface has clear icons with an intuitive layout.Reads and resets all error codes in models from the year 2000 compatible with OBDII.The error code reader supports the following protocols: KWP1281, KWP 2000, TP-CANBUS, NEW UDS, CAN, J1850 PWM, J1850 VPW, ISO9141.Engine values are read and presented in real time during driving.Turns off the vehicle’s service lamp once the fault code is deleted.Reads Live Data, TPS, ABS, Airbag, EPB, etc.Menus in English, Swedish, Norwegian, Finnish or Danish.Supplied in a practical storage caseSpecial functions for VAG:SRI – Service interval resetTBA – Throttle learningEPB – Brake and pad replacementSAS – Steering angle sensor learningTPMS – Delete codes for tyre pressure monitoring systemBMS – Battery registration for new batteryDPF – Regeneration of diesel particulate filterEGR – Delete Exhaust Gas Recirculation adaptationsABS – ABS system bleedingInjector adaptationand more', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1375_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1126, 'Error code reader for VAG', 8, 379.0, 'Error code reader with backlit LCD screen and extended diagnostic function for Audi, VW, Skoda and Seat, year models up to 2016, as well as standard OBD-II diagnostics for other car makes.NOTE!This error code reader only reads and resets error codes stored in the engine control unit. For practically all cars with OBD-II or EOBD + CAN, i.e. all American cars from 1996 and European/Asian cars from 2002. It is recommended to check which protocol is supported by the car to achieve the best possible functionality. (Does not apply to VAG vehicles)NOTE!For vehicles produced prior to 2002, the error code reader may only read certain error codes or none at all. (Does not apply to VAG vehicles)NOTE!Does not reset the check engine light, does not read ABS or Airbag. (Does not apply to VAG vehicles)Language: English and Nordic languagesTurns off warning lights, deletes error codes and resets monitorsFreeze Frame DataI/M ReadinessReads VIN codesStandard: OBD-II/EOBDProtocol: KWP1281, KWP 2000, TP-CANBUS, NEW UDS, CAN, J1850 PWM, J1850 VPW, ISO9141Special functions for VAG:Handles error codes from over 130 modules in addition to VAG engines: ABS, airbag, transmission, radio, AC, instrument, immobiliser, etc.SRI –Turns off the service lightEPB – Brake and pad replacementTPMS – Tyre pressure monitoringTPS – Throttle position sensorSAS – Steering angle sensor', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1305_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1127, 'Error code reader OBD-II / EOBD+CAN', 8, 239.0, 'Error code reader with backlit LCD screen, live data, system status and database with definitions for both generic and manufacturer-specific error codes.NOTE!This error code reader only reads and resets error codes stored in the engine control unit. For practically all cars with OBD-II or EOBD + CAN, i.e. all American cars from 1996 and European/Asian cars from 2002. It is recommended to check which protocol is supported by the car to achieve the best possible functionality.NOTE!For vehicles produced prior to 2002, the error code reader may only read certain error codes or none at all.NOTE!Does not reset the check engine light, does not read ABS or Airbag.Language: English and FinishTurns off warning lights, deletes error codes and resets monitorsLive DataFreeze Frame DataI/M ReadinessReads VIN codesStandard: OBD-II/EOBD+CANProtocol: VPW, PWM, KWP, CAN, ISO 9141 for all cars, SUVs and light commercial vehiclesProtocols, in detail:SAE J1850 PWM (41.6 kbaud)SAE J1850 VPW (10.4 kbaud)ISO 9141-2 (5 baud init, 10.4 kbaud)ISO 14230-4 KWP (5 baud init, 10.4 kbaud)ISO 14230-4 KWP (fast init, 10.4 kbaud)ISO 15765-4 CAN (11 bit ID, 500 kbaud)ISO 15765-4 CAN (29 bit ID, 500 kbaud)ISO 15765-4 CAN (11 bit ID, 250 kbaud)ISO 15765-4 CAN (29 bit ID, 250 kbaud)For the following car brands (and others):Acura, Bentley, Buick, BMW, Cadillac, Chevrolet, Chevy, Chrysler, Citroen, Daewoo, Dodge, Fiat, Ford, GM, GMC, Honda, Hummer, Hyundai, Infinity, Isuzu, Jaguar, Jeep, Kia, Land Rover, Lexus , Lincoln, Mazda, Mercury, Mercedes Benz, Mini, Nissan, Oldsmobile, Opel, Peugeot, Plymouth, Pontiac, Porsche, Renault, Rover, Saab, Saturn, Subaru, Volvo, VW, Audi, Skoda, Seat, and more.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1300_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1128, 'Diagnostic tool for Mercedes', 32, 1099.0, 'An advanced fault code reader for Mercedes Benz (2000– 2021). The diagnostic tool is easy to handle and shows the fault codes in clear text on a backlit colour screen. The interface has clear icons with an intuitive layout.Reads and deletes all fault codes for the following models:Mercedes Benz Series Chassis: A Class, AMG Class, B Class, C Class, CL Class, CLA Class, CLC Class, CLK Class, CLS Class, E Class, G Class, GL Class, GLA Class, GLC Class, CLE Class, GLK Class, GLS Class, M Class, Maybach, ML Class, R Class, S Class, SL Class, SLK Class, SLR Class, SLS ClassSprinter Series Chassis: 901, 902, 903, 904, 905, 906, 907, 909, 910, 690Smart Series Chassis: Smart fortwo (A/C450, A/C451, W454), Smart roadster (R/C452), Smart 453The fault code reader supports the KWP, CAN, UDS, VPW, PWM, ISO, KWP 2000, and CAN protocols.Engine values are read and presented in real time during driving.Turns off the vehicle’s service lamp once the fault code is deleted.Reads Live Data, TPS, ABS, Airbag, EPB, etc.Menus in English, Swedish, Norwegian, Finnish or Danish.Supplied in a practical storage caseSpecial features for Mercedes:ETC – Throttle learningService resetEPB – Brake and pad replacementSteering angle sensor learningDelete codes for tyre pressure monitoring system (with or without display)Battery registration when replacing the batteryDeletes gearbox adaptationsGearbox learning processDPF – Regeneration of diesel particulate filterDPF – Replacement of diesel particulate filterDeletes adBlue adaptation valuesABS – ABS system bleedingFuel pump reset', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1377_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1129, 'Diagnostic tool for BMW', 14, 849.0, 'An advanced error code reader for BMW, Mini and Rolls Royce, including models newer than 2016. The diagnostic tool is easy to handle and displays the error codes in clear text on a backlit colour screen. The interface has clear icons with an intuitive layout.Reads and resets all error codes in models from the year 2000 compatible with OBDII.The error code reader supports the following protocols: KWP1281, KWP 2000, TP-CANBUS, NEW UDS, CAN, J1850 PWM, J1850 VPW, ISO9141.Engine values are read and presented in real time during driving.Turns off the vehicle’s service lamp once the fault code is deleted.Reads Live Data, TPS, ABS, Airbag, EPB, etc.Menus in English, Swedish, Norwegian, Finnish or Danish.Supplied in a practical storage caseSpecial functions for BMW:CBS – Service interval resetETC – Throttle learningEPB – Brake and pad replacementSAS – Steering angle sensor learningTPMS – Delete codes for tyre pressure monitoring systemBMS – Battery registration for new batteryDPF – Regeneration of diesel particulate filterEGR – Delete Exhaust Gas Recirculation adaptationsABS – ABS system bleedingInjector adaptationand more', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1374_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1357, 'Touch-up paint, 400 ml', 38, 69.9, 'Touch-up paint matching the original paintwork for most car models.Spray bottle.Nozzle with a good spray pattern.For best final results we recommend using Primer/filler. The plastic parts are primed using plastic primer.Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. The paint is dust-dry after 10 minutes and hard-dry after 24 hours.NOTE! Only Primer/Filler, Plastic Primer, Aluminium Primer  and Clear Coat may be used together with the touch-up paint.DangerExtremely flammable aerosol.Pressurised container: May burst if heated.Causes serious eye irritation.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 8, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7352_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1358, 'Touch-up paint, 400 ml', 35, 69.9, 'Touch-up paint matching the original paintwork for most car models.Spray bottle.Nozzle with a good spray pattern.For best final results we recommend using Primer/filler. The plastic parts are primed using plastic primer.Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. The paint is dust-dry after 10 minutes and hard-dry after 24 hours.NOTE! Only Primer/Filler, Plastic Primer, Aluminium Primer  and Clear Coat may be used together with the touch-up paint.DangerExtremely flammable aerosol.Pressurised container: May burst if heated.Causes serious eye irritation.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 8, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7364_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1130, 'Diagnostic tool for Volvo', 33, 799.0, 'An advanced error code reader for Volvo, including models newer than 2016. The diagnostic tool is easy to handle and displays the error codes in clear text on a backlit colour screen. The interface has clear icons with an intuitive layout.Reads and deletes all error codes for the following models: 850 (1992-1997), 960 (1991-1997), C30 (2007-2013), C70 Conv(1998-2005), C70 Coupe(1998-2002), C70(2006-2013), S40 (1996-2012), S60 (2001-2019), S60L (2019-), S70 (1997-2000), S80(1999-2016), S90 (1997-1998), S90 (2017-2019), S90L (2018-2019), V40 (1996-2004), V40 (2013-2018), V50 (2004-2012), V60 (2011-2019), V60 (2019-), V70 XC (1997-2000), V70 XC/XC70 (1997-2007), V70 XC/XC70 (2001-2007), V70 (1997-2016), V90 Cross Country (2017-2019), V90 (1997-1998), V90 (2017-2019), XC40 (2018-2019), XC60 (2009-2019), XC70 (2008-2016), XC90 (2003-2019).The fault code reader supports the KWP,CAN,UDS, VPW, PWM, ISO, KWP 2000, and CAN protocols.Engine values are read and presented in real time during driving.Turns off the vehicle’s service lamp once the fault code is deleted.Reads Live Data, TPS, ABS, Airbag, EPB, etc.Menus in English, Swedish, Norwegian, Finnish or Danish.Supplied in a practical storage caseSpecial features for Volvo:SRI – Service interval resetETM – Throttle learningEPB – Brake and pad replacementSAS – Steering angle sensor learningTPMS – Delete codes for tyre pressure monitoring systemBMS – Battery registration for new batteryEGR – Delete Exhaust Gas Recirculation adaptationsABS – ABS system bleedingInjector adaptationand more', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1376_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1131, 'Error code reader, colour display', 1, 339.0, 'Error code reader with colour screen, function key for checking error codes, live data and system status, as well as database that presents error code definitions directly in the display.NOTE!This error code reader only reads and resets error codes stored in the engine control unit. For practically all cars with OBD-II or EOBD + CAN, i.e. all American cars from 1996 and European/Asian cars from 2002. It is recommended to check which protocol is supported by the car to achieve the best possible functionality.NOTE!For vehicles produced prior to 2002, the error code reader may only read certain error codes or none at all.NOTE!Does not reset the check engine light, does not read ABS or Airbag.Language: English and FinnishReads generic error codes: P0, P2, P3 and U0Reads manufacturer-specific error codes: P1, P3 and U1Turns off warning lights, deletes error codes and resets monitorsLive DataFreeze Frame DataI/M ReadinessReads VIN codesCD containing an error code libraryStandard: OBD-II/EOBD+CANProtocol: VPW, PWM, KWP, CAN, ISO 9141 for all cars, SUVs and light commercial vehicles', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1310_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1132, 'DTC reader VOLVO', 19, 699.0, 'Reads errors in all Volvo systems such as engines, stereos, diesel heaters, etc. Can also read generic error codes for OBD2 and EOBD. Errors codes are presented in plain language and the menus are available in English and the Nordic languages.Can be used in the following VOLVO models: C30 (2006-2008), S40 (2004-2008), V50 (2004-2008), S60 (2001-2008), C70 (2005-2008), V70 (2001-2008), S80 (2001-2006), XC70 (2001-2008), XC90 (2003-2008) models more recent than 1999 which are OBDII compatible.Turns off the vehicle''s service lamp once the error code is deleted.Menus can be presented in English, Swedish, Norwegian, Finnish or Danish.Can reset the service indicator lamp in Volvo vehicles.Display function for the individual VIN number.For 2009-2014 models, only engine codes are read.Error code reader, menus (PDF)Find the right error code reader (PDF)', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1369_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1133, 'Anti-Freeze Tester', 11, 32.9, 'Easy-to-read model with clear indicators for boiling point and frost protection. Measures frost protection and boiling point of ethylene glycol.Freezing point range: -43 °C – -12 °C.Boiling point range: 124 °C – 131 °C.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1409_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1134, 'Compression tester petrol', 12, 399.0, 'Suitable for most petrol engines Manometer with quick connector and release valve. Measurement range: 0-21 kg/cm². Flexible high pressure hose, length 400 mm. Straight and angled pressure pipe with rubber cone. 5 adapters with connection threads M10 x 1.0, M12 x 1.25, M14 x 1.25,  M16 x 1.5 and M18 x 1.5. Supplied in an injection-moulded plastic box.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1393_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1135, 'Compression tester', 4, 169.0, 'The display needle stops at the attained value for precise readings and is zeroed by means of a check valve. Straight measuring cone in rubber and a flexible hose for mounting in spark plug holes. Connection thread: 14 and 18 mm. Measuring range: 0-20 kg/cm². Supplied in a practical oil-resistant plastic box.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1314_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1136, 'Compression tester, diesel', 5, 2199.0, 'With 37 parts and a large selection of adapters. Fits most makes of vehicle. With a rubber-clad high quality hydraulic manometer in a modern design, measurement range 70 bar / 1000 psi. Full range of glow plug and injector adapters. Additionally adapters that are clamped on to provide further applications for trucks, vans, buses, marine and agricultural machinery. NOTE! The test must be carried out when the starter motor is being turned.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1344_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1137, 'Digital multimeter, car', 12, 459.0, 'Special multimeter with backlit display and fold-out bench support. Measures voltage, current, frequency, duty cycle, capacitance, resistance, and temperature, and with diode and connectivity testing.Car-specific tests include rotational speed for two- and four-stroke engines up to 8 cylinders, pulse-width modulation (PWM) on e.g. injectors and idle engines, and cam dwell angle for electronic ignition systems and contact breakers.The multimeter has selectable functions for automatic measurement range detection, current value hold function, saved value (relative value) comparison, as well as battery status indicator and battery saving function that turns off the device after 30 minutes.CAT III 600 V:For measurement in distribution networks and normal industrial environments provided that the voltage rating is high enough for the measuring taskAccessories:1 x fabric bag1 x temperature probe1 x inductive clamp for rotational speed measurement1 set of test cables', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-292_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1138, 'Oil pressure meter set', 27, 799.0, 'For quick and precise measurement of engine oil pressure and automatic transmission pressure. For all types of vehicles, cars and light trucks – petrol or diesel.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1380_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1139, 'Voltage tester 12–690 V AC/DC', 1, 199.0, 'Tests AC/DC voltage 12-690 V and presents the result with LEDs.The voltage tester has the following voltage test functions:Single-pole phase testContinuity test and phase sequence indicationVoltage tester function checkAutomatic polarity check.The test instrument has optical indication and acoustic buzzer and built-in LED lamp that illuminates the measuring point. The handles are made of plastic. Supplied with batteries.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-289_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1140, 'Voltage Tester, 6 – 24 V', 22, 42.9, 'Instrument for testing car light bulbs, batteries, cables, etc. Comes with protective sleeve/needle tip, crocodile clip and cable. Do not load the voltage tester for longer than 30 seconds.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-129_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1141, 'Cordless Voltage Tester, 3 – 28 V', 4, 39.9, 'For safe detection of voltage in vehicles, such as control units, sensors and transformers, etc. No earth cable required. Powerful light and audible signal. Supplied with a V-shaped adapter for safe penetration of cables. Batteries included', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-128_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1142, 'Mechanic''s stethoscope', 22, 135.0, 'Quickly and easily localises noises in mechanical products, e.g. motors and bearings. With plastic earpieces, aluminium resonator and rubber funnel.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/20-338_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1143, 'Electronic stethoscope', 3, 159.0, 'Battery-powered, electronic stethoscope for easily locating noises in engines (bearing and machine noises). Can also be used for troubleshooting and monitoring of e.g. valves, injectors, electrical relays, drives, axles, pumps, lubrication systems, etc. Amplifier with adjustable volume. Total length (amplifier and probe): 380 mm. Battery 9 V (not included).', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-247_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1144, 'Painting stand', 10, 289.0, 'Painting stand with padded contact surfaces and adjustable height.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-3743_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1145, 'Car seat cover', 8, 119.0, 'Protects car upholstery when you sit on the seat with dirty clothes. Fits both high and low backrests with neck rests.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000017046/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1146, 'Överkörningsskydd', 28, 329.0, 'Two cable ducts, 3 cm each.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/87-8404_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1147, 'Depot tarpaulin', 37, 1199.0, 'Meets SBF''s requirements for tarpaulins underneath racing vehicles. Sewn-in chain to lend stability and damming up any spillage. Flame-proofed and resistant to chemicals such as, for example, ethanol, methanol, petrol, diesel and oils etc Glossy, easy-to-clean surface.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-0000_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1148, 'Car seat cover, nylon', 12, 59.9, 'Protects car upholstery when you sit on the seat with dirty clothes. Fits both high and low backrests with neck rests.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/39-7451_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1149, 'Work mat, fold-up, 120 x 40 x 3 cm', 33, 269.0, 'Practical mat in 6 sections made of EVA material for kneeling, sitting, or lying down while working. Perfect for the garage, camping, hunting, exercising, building, etc. With handle and hook-and-loop straps that hold the mat together.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-0041_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1150, 'Work mat, foldable', 23, 269.0, 'Multifunctional mat in EVA material for use in kneeling, sitting or lying positions. Perfect for the garage, camping, hunting, exercising, building, etc. With hook-and-loop fastening.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-0011_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1151, 'Car wing cover', 11, 79.9, 'Protects paintwork on the front wings when working on the engine. Attaches with magnetic strips. Dimensions: 1 x 0.6 m, with wheel cut-out.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/20-351_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1152, 'Wheeled tyre stand', 37, 129.0, 'Free-standing, wheeled dolly for easy moving. For 4 tyres with a max. tyre width of 225 mm. Gentle storage that prevents deformation since the tyres rest on their rims. Also vents away moisture when the tyres are kept separated. Saves space in the garage. Made of aluminium and plastic.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/41-289_xl_1.jpg');
