INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1154, 'Wheel hangers, pair', 17, 59.9, 'Wheel hanger for wall-mounting. Threaded and galvanised steel rod on mounting plate for wall mounting using screws. Select screws according to wall material. Max. load per hanger: 20 kg Length: 230 mm.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/33-477_xl_1.jpg');
