INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1196, 'Garage stool with wheels', 7, 299.0, 'Work seated and save your knees and back by using Biltema''s adjustable-height garage stool. Functions as a practical tool shelf where you can always have your tools within easy reach when you are working.5 revolving and easy-rolling wheels for good manoeuvrability.Revolving seat (360°) with soft padding for maximum comfort.Variably adjustable sitting height, 440-555 mm.Base plate Ø 380 mm in heavy-duty metal plate.', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-883_xl_1.jpg');
