INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1198, 'Tool trolley', 5, 3499.0, 'With 11 self-closing and ball-bearing drawers and a practical work surface with assortment compartments on top. Lockable with central lock. Made of powder-coated sheet metal with plastic-protected parts.TIP! Assortment Box 71-7605 can be fitted on top.External dimensions incl. wheels: 1091 x 470 x 1027 mm1 drawer: 937 x 410 130 mm, max. 35 kg/pcs1 drawer: 570 x 410 54 mm, max. 20 kg/pcs3 drawers: 570 x 410 x 112 mm, max. 20 kg/pcs1 drawer: 570 x 410 170 mm, max. 25 kg/pcs1 drawer: 313 x 410 54 mm, max. 15 kg/pcs3 drawers: 313 x 410 x 112 mm, max. 20 kg/pcs1 drawer: 313 x 410 170 mm, max. 25 kg/pcs2 swivel and 2 fixed wheels: 5” x 2”', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/71-7604_xl_1.jpg');
