INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1200, 'Tool trolley', 4, 2599.0, 'Make working in your workshop easier with this practical and robust work trolley which has 9 self-closing and ball-bearing drawers, a collapsible side table, and a practical work surface with assortment compartments on top. Lockable with central lock. Made of powder-coated sheet metal with plastic-protected parts.TIP! Assortment Box 71-7603 can be fitted on top.Total dimensions incl. wheels: 724 x 470 x 1027 mm2 drawers: 570 x 410 x 54 mm, max. 20 kg/pcs4 drawers: 570 x 410 x 112 mm, max. 20 kg/pcs1 drawer: 570 x 410 170 mm, max. 25 kg/pcs2 swivel and 2 fixed wheels: 5” x 2”', '2023-05-15 15:12:27', 6, 'https://productimages.biltema.com/v1/image/imagebyfilename/71-7602_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1359, 'Touch-up paint, 400 ml', 23, 69.9, 'Touch-up paint matching the original paintwork for most car models.Spray bottle.Nozzle with a good spray pattern.For best final results we recommend using Primer/filler. The plastic parts are primed using plastic primer.Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. The paint is dust-dry after 10 minutes and hard-dry after 24 hours.NOTE! Only Primer/Filler, Plastic Primer, Aluminium Primer  and Clear Coat may be used together with the touch-up paint.DangerExtremely flammable aerosol.Pressurised container: May burst if heated.Causes serious eye irritation.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 8, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7426_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2319, 'Halogen bulb Premium', 32, 89.9, 'Biltema''s best halogen bulb. Provides greater light distribution as well as whiter light than standard bulbs. Very effective bulbs which produce a comfortable light that doesn''t tire the eyes. The increased light distribution allows for an extended field of view and quicker reactions, which are conducive to increased safety. The bulbs conform to ECE R37 and are therefore approved for road traffic. Sold in pairs.H3', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-63_xl_1.jpg');
