INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1300, 'Touch-up paint, matte black, 400 ml', 36, 69.9, 'Touch-up paint matching the original paintwork for most car models.Spray bottle: Nozzle with a good spray pattern.For best final results we recommend using Primer/filler. The plastic parts are primed using plastic primer.Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. The paint is dust-dry after 10 minutes and hard-dry after 24 hours.NOTE! Only Primer/Filler, Plastic Primer, Aluminium Primer  and Clear Coat from Biltema may be used together with the touch-up paint.WarningEUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 8, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7483_xl_1.jpg');
