INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1306, 'Chrome silver, 400 ml', 8, 54.9, 'Quick-drying paint that gives a chrome-like appearance. Can be used on wood and metal, painted or unpainted surfaces and functions as its own primer. Cannot be painted over. The paint is only intended for decorative purposes: not to be touched. Should not be used on wheel rims.DangerEUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 8, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000046959/4');
