INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2290, 'Halogen bulb Offroad, Mega blue H4, 12 V, 100/90 W, 2-pack.', 21, 149.0, 'Halogen bulb with blue glass that produces an extremely white light. High colour temperature. Perfect for both your everyday car and for car tuning. Shines up to 30% more light on the road than standard halogen bulbs. Offers higher output (watt) and produces an excellent headlight beam. Take note that a higher output can damage the bulb holder and reflector. Not approved for road traffic and must only be used for off-road driving. Sold in pairs.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-5593_xl_1.jpg');
