INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1391, 'Touch-up stick, white 001-3, 9 ml', 36, 74.9, 'Easy-to-use paint with a fine brush, which enables precise application. The paint, together with primer and clear coat, produces a strong protective coat and glossy surface. Used, for example, when repairing chips and minor scratches on paintwork, as a hobby paint on surfaces such as metal, panels, and plastic, or for model building. Can be painted over at any time with the same paint or with an appropriate clear coat.PropertiesEasy to useQuick dryingScratch resistantWeather resistantRecommendation for repairing metal and plasticStep 1 – Primer touch-up stickStep 2 – Colour shade touch-up stickStep 3 – 2 coats of clear coat (optional, but recommended to increase the gloss and weather resistance)Instructions:Remove rust and clean the surface to be painted.Shake the bottle well and check the colour shade.Apply the paint with the brush.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H225 Highly flammable liquid and vapour.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 8, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-915_xl_1.jpg');
