INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1414, 'Paint pen, 12 ml', 36, 64.9, 'Easy-to-use paint pen with felt-tip and brush for mending chips and scratches. Provides strong protection and a glossy surface together with primer and clear coat. Available in an assortment of colours to match most vehicles. Search for the colour you need in our colour guide.InstructionsRemove dirt and rust. Treat unpainted surfaces with Primer36-7430. Shake the bottle well. Apply a thin layer using the felt-tip or brush, depending on the size of the damaged area. Allow to dry, then treat with Clear Coat36-7431or Clear Coat Metallic36-7432. When the clear coat has dried, buff with abrasive.Find the paint pen you needDangerHighly flammable liquid and vapour.Causes skin irritation.Causes serious eye irritation.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 8, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7468_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1415, 'Textile cleaning, 400 ml', 35, 54.9, 'A powerful and advanced foam cleaning agent with a brush that effectively removes stains and dirt from car upholstery, textile carpeting and other textile upholstery in cars. Cleans easily, efficiently and gently.InstructionsVacuum the surface to be cleaned to remove loose dirt.Shake the bottle, spray foam on the textile surface to be cleaned.Moisten the brush and brush in the agent well. Work with a small part at a time.Wipe off the remaining agent with a damp cloth.Allow to dry in a well-ventilated environment, especially car seats.Also suitable for home use.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH317 May cause an allergic skin reaction.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9300_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1416, 'Super Cleaner, 500 ml', 2, 39.9, 'Cleaning agent that effectively removes dirt and grease from car windows, dashboards and other surfaces in hard plastic materials thanks to the active cleaning formula. Can be used on both the inside and outside of the car. Leaves a pleasant flowery scent.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-838_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1417, 'Interior brushes, 2 pcs.', 13, 59.9, 'A cleaning brush with a soft brush designed for brushing and cleaning as well as for interior cleaning. The brush can also be used externally for washing hard-to-reach spaces.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-747_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1418, 'Interior cleaning, 300 ml', 32, 46.9, 'Clean the dashboard and plastic interior surfaces of water-soluble stains. The active formula creates a fresh feeling and leaves a matt new car finish. The agent protects the surface against drying out, cracking and bleaching. Leaves a fresh scent.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0157_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1419, 'Textile cleaner, 500 ml', 6, 39.9, 'Textile cleaner that removes difficult dirt from the seats and other textiles in the car. The agent has a quick-acting formula that penetrates and lifts the dirt. Creates a fresh and clean feeling and helps to remove odours from food, tobacco, pets, etc.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-837_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1420, 'Textile cleaning, 500 ml', 22, 64.9, 'Say goodbye to seat stains and dirty textile mats with this low-foam cleaner for car upholstery and car mats. The textile spray cleaner is highly effective, dissolves stubborn dirt without leaving stains, and has a fresh and citrusy scent. For best results, use with a wet-dry vacuum cleaner or textile cleaning machine.WarningEUH208 Contains .?. May produce an allergic reaction.H319 Causes serious eye irritation.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-769_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1421, 'Leather care kit, 4 parts', 10, 159.0, 'Gives leather an impressive lustre and a faint new leather smell. Softens and protects the leather from drying out and cracking. Contains everything needed to clean, moisturise and protect leather.  Protects for a whole year after treatment.Includes the following: 500 ml cleaner, 500 ml impregnation oil, microfibre cloth and microfibre sponge.WarningH317 May cause an allergic skin reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-05_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1422, 'Interior cleaning', 29, 23.45, 'Clean the dashboard and plastic interior surfaces of water-soluble stains. The active formula creates a fresh feeling and leaves a matt new car finish. The agent is water-based and protects the surface against drying out, cracking and bleaching. Leaves no smell.Contains <name of sensitising substance>. May produce an allergic reaction.Show safety phrases', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9307_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1423, 'Car interior cleaner BIO, 500 ml', 27, 39.9, 'Contains only biodegradable substances, which are kinder to the environment. For cleaning all materials that tolerate water. Quickly and effectively removes stains on upholstery, mats, the interior roof, the sides of the doors and other plastic, metal and leather interiors.Show safety phrases', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1738_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1424, 'Vinyl cleaning sponge', 19, 42.9, 'Quickly and easily freshens up plastic, rubber, and artificial leather interior details. Provides a glossy, dirt-repellent, anti-static surface and protects against drying out and cracks. Can be reused.NOTE! Store in packaging when not in use.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-899_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1425, 'Air purifier, 100 ml', 39, 74.9, 'Air purifier that eliminates and prevents bad odours and freshens car interiors through the air-con system. The product optimally reconditions the air-con system and prevents bacterial and fungal growth in car air systems. It freshens the air and has a lasting effect. The propellant gas is non-flammable.view less..WarningPressurised container: May burst if heated.Show safety phrases', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9310_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1426, 'Interior brush', 21, 26.9, 'The brush effectively removes dog and cat hair from fabrics such as upholstery, cushions and carpets. With easy-grip handle and PVC bristles. Can be washed easily under running water.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-29_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1427, 'Foam bottle, 150 ml', 12, 32.9, 'The dispenser produces a thick dry foam, which prevents spreading and makes it easier to apply. And ultimately costs you less money. The foam dispenser is perfect for interior cleaning and leather cleaning, preferably in combination with an interior brush or leather brush.', '2023-05-15 15:12:27', 9, 'https://www.caspianpolicy.org/no-image.png');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1428, 'Cleaning wipes, interior, 70-pack', 3, 39.9, 'For cleaning car interiors, such as the dashboard, etc. Effectively removes dirt and stains. Contains 70 wipes measuring 15 x 20 cm in a practical plastic tub.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-892_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1429, 'Leather Cleaning Wipes', 36, 49.9, 'Practical wet wipes for cleaning and protecting leather. Useful for wiping off spots and stains on leather furniture, car interiors, leather jackets, etc. With a simple wipe you can clean, protect and preserve leather surfaces in your car or boat. Do not use on suede, floor surfaces, pedals, handles, steering wheels, bench seats, bicycle seats, bicycle tyres, brake drums and other surfaces that must not be slippery. Do not use on transparent surfaces, plastic or plexiglas.WarningMay cause an allergic skin reaction.Show safety phrases', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-899_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1430, 'Ceramic quick sealant, 500 ml', 10, 59.9, 'Ceramic protective coating that is easily sprayed onto wet or dry car paintwork. The quick seal brings out the depth of the paint colour and adds a high gloss. The water-repellent and protective coating repels water and dirt particles. Ideal for the care of unprotected cars as well as for reinforcing previous protection.The product can be used on painted surfaces and on parts made of plastic and chrome. Do not use on glass. The product has a neutral pH.InstructionsBefore use: Wash the car with car shampoo.Application on wet paintwork:Spray the product evenly – approx. 4-6 sprays per 1 m². For best results, rinse off with high pressure. Use a chamois or absorbent microfibre to remove any remaining water droplets.Application on dry paintwork: Spray the product evenly – approx. 3-5 sprays per 1 m². Polish the paintwork with a microfibre cloth.NOTE:Do not use in sunlight or on hot paintwork. If the product dries on the paintwork, apply again and polish with a microfibre cloth.WarningEUH208 Contains Reaction mass of 5-chloro-2-methyl-2H-isothiazol-3-one and 2-methyl-2H-isothiazol-3-one (3:1). May produce an allergic reaction.H319 Causes serious eye irritation.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-1004_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1431, 'Speed shine detailer, 1 litre', 20, 69.9, 'Easy-to-use shine detailer that creates an unbeatable shine and good run-off without wax or polishing. Use directly after washing or between washes to quickly wipe away dust and give the car’s exterior an impressive lustre. Can also be used as a wet wax.EUH208 Contains .?. May produce an allergic reaction.H317 May cause an allergic skin reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-75_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1432, 'Speed Shine, 500 ml', 24, 39.9, 'Easy-to-use liquid shiner that gives unbeatable shine without wax or polishing in just a few minutes. Use directly after washing or between washes to quickly rinse away dust and give the car''s exterior an impressive lustre.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-836_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1433, 'Speed shine, 2 litre', 29, 129.0, 'Easy-to-use liquid shiner that gives unbeatable shine without wax or polishing in just a few minutes. Use directly after washing or between washes to quickly rinse away dust and give the car''s exterior an impressive lustre. Application by means of a water hose which is connected directly to the included ejector.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1920_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1434, 'Super Gloss, 500 ml', 30, 79.9, 'Super Gloss shiner provides a glossy lustre to car paintwork, rub strips and chrome trim. The innovative composition provides a long-lasting shine while also making it difficult for dirt and dust to stick to surfaces.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-72_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1435, 'Ceramic spray wax, 500 ml', 12, 59.9, 'Ceramic paint coating that can be easily applied to paintwork on cars, motorcycles, etc. Protects the paintwork and provides a good shine and faster runoff. Do not dilute, apply to wet paintwork.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-2005_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1436, 'Quick Sealant, 500 ml', 27, 79.9, 'Quick sealant in spray bottle for quick and easy application. The sealant produces a high-gloss and water-repellent effect on paintwork, trim, and chromed details. It creates a long-lasting shine while also making it difficult for dirt and dust to stick to the surface.InstructionsMake sure the surface is completely clean and dry before using the product.Shake well before use.Spray a small amount on the surface. Distribute over a small area at a time using microfibre cloth –do not allow to dry.Wipe down with a clean microfibre cloth.NOTE!Avoid contact with glass.Store in a dry and cool area.EUH208 Contains reaction mass of 5-chloro-2-methyl-2H-isothiazol-3-one and 2-methyl-2H-isothiazol-3-one (3:1). May produce an allergic reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-044_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1437, 'Ceramic paint protection', 25, 229.0, 'Provides the car with lasting protection against air pollution, dirt, road salt, particles and UV rays. The car therefore does not need to be washed as often. It also reduces the risk of scratching and colour fading. Produces an excellent shine with extra water beading. Suitable for all paintwork on metal and plastic, e.g. bodywork, rims, plastic parts and headlamps.DangerCauses severe skin burns and eye damage.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-796_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1438, 'Quick wax, 500 ml', 19, 99.9, 'Wax-based product that is easy to use on all smooth and shiny surfaces (paintwork, glass and plastic). Leaves a brilliant shine, enhances colour and makes the surface smooth. The product protects and produces a water-repellent surface. Does not leave streaks on plastic and rubber.EUH066 Repeated exposure may cause skin dryness or cracking.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-805_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1439, 'Ceramic wax, 300 ml', 38, 99.9, 'A ceramic wax with unique ceramic formula and carnauba wax additive that provides long-lasting paintwork protection (up to 12 months). The wax also provides very high resistance to UV rays, creates a water-repellent coating, and enhances the paintwork’s shine.WarningH226 Flammable liquid and vapour.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-2007_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1440, 'Hard wax, 250 g', 6, 79.9, 'This is a carnauba hard wax that gives paintwork a high-gloss finish. The product fills superficial wash scratches. Thanks to the content of natural carnauba wax, the product creates a high-gloss water-repellent surface and long-lasting protection against dirt.InstructionsWash and dry the car.Shake before use.Do not apply if paintwork is hot to the touch. Apply the wax using a clean, soft, dry cloth or soft sponge. Apply a thin coat to the paintworkin circular motions.Allow to dry for approx. 5 minutes.Polish the paintwork using a clean, dry microfibre cloth until shiny. If it is difficult to polish off the product, apply a new coat and polish immediately.NOTE: Do not use in sunlight or on hot paintwork. Do not use on matte paintwork.EUH208 Contains reaction mass of 5-chloro-2-methyl-2H-isothiazol-3-one and 2-methyl-2H-isothiazol-3-one (3:1). May produce an allergic reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-1012_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1441, 'Hard wax, 500 ml', 35, 59.9, 'Together with silicone, the wax provides lasting protection and is water-repellent. Protects against ageing/bleaching caused by UV radiation, and the effects of soot, exhaust gases, dirt, road salt, etc.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-617_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1442, 'Polish BIO, 500 ml', 9, 79.9, 'Contains only biodegradable substances, which are kinder to the environment. Natural wax with carnauba (palm wax) and beeswax extract. Produces a glossy finish and protects against UV radiation, dirt, fumes, road salt, etc.WarningH317 May cause an allergic skin reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1739_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1443, 'Hybrid wax', 21, 69.9, 'Easy-to-apply and long-lasting car wax for all paintwork and ceramic coatings. Produces increased pearl effect and a long-lasting shine. High resistance to cleaners. Contains carnauba waxes and other natural waxes mixed with additives and a hybrid polymer.Show safety phrases', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-806_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1444, 'Cleaning wipes, all-round, 70-pack', 40, 39.9, 'For cleaning most hard surfaces. Effectively removes dirt and stains. Contains 70 wipes measuring 15 x 20 cm in a practical plastic tub.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-890_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1445, 'Wet wipes, heavy duty, 40-pack', 40, 59.9, 'Heavy-duty, gentle, and frost-resistant wipes that are effective against oil, grease, paint, silicone, PU foam, soot, ink, etc. Perfect for keeping close at hand in cars, boats, and workshops or for taking along on trips. For easily cleaning e.g. hands, utensils and work surfaces.The structure and absorbency of the wipes improves their ability to dissolve and remove dirt from hands and surfaces, and they are also enriched with a moisturising agent.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-975_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1446, 'Wet wipes, heavy duty, 36-pack', 31, 59.9, 'Heavy-duty, gentle, and frost-resistant wipes that are effective against oil, grease, paint, silicone, PU foam, soot, ink, etc. They have a rough side for scrubbing and a soft absorption surface. Perfect for keeping close at hand in cars, boats, and workshops or for taking along on trips. For easily cleaning e.g. hands, utensils and work surfaces.WarningH317 May cause an allergic skin reaction.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-975_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1447, 'Cleaning wipes, rubber and vinyl, 70-pack', 39, 39.9, 'For cleaning rubber and vinyl surfaces. Effectively removes dirt. Contains 70 wipes measuring 15 x 20 cm in a practical plastic tub.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-893_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1448, 'Air Blower, 600 W', 12, 219.0, 'Air blower that effectively dries recently washed cars, motorbikes, boats, etc. Easily blows away water from trim, side mirrors and every nook and cranny on motorcycles. Can also be used as a basic vacuum cleaner. Supplied with blower pipe and collector.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/17-829_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1449, 'Pressure Spray, 8 litre', 31, 139.0, 'For simple, precise and economical application of pesticides, degreasing agents, etc.130 cm PVC hose and long, adjustable brass spray nozzle.Lockable flow control in on/off position for uninterrupted spraying.Operating pressure: 2-3 bar.Vent valve and gaskets made of Viton rubber.Supplied with a carrying strap.NOTE!The container should be emptied/rinsed out after use. Weed vinegar and similar agents can affect the Viton gasket and its service life.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/45-577_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1450, 'Backpack Sprayer, 15 litre', 21, 219.0, 'For easy, precise and sparing application of insecticides, degreasers, etc.150 cm PVC hose, long fibreglass spray nozzle (95 cm with handle).Long pump handle on the left side.Lockable flow regulator for continuous spraying.Viton rubber gaskets.Nylon back straps, reversible for right-hand and left-hand use.Spare nozzles and accessories included.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/14-1977_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1451, 'Foam sprayer, 2 L', 22, 149.0, 'This manual foam sprayer is a practical tool that creates a thick and long-lasting foam without using a high-pressure washer. The foam sprayer with foam nozzle is intended for alkaline cleaning agents, e.g. when washing cars, motorcycles and bicycles.The strong foaming effect from the foam sprayer results in better cleaning since the cleaner is allowed to work longer and less cleaner is used. A tip is to fill the container halfway and then pump up the pressure – this will ensure an optimal foam/time ratio.The container has an opening diameter of 50 mm, which makes it easy to top up. The foam sprayer has a stable base that allows it to stand firmly and a durable design using EPDM gaskets. It is also equipped with a pressure-relief valve that prevents overpressure.Note!Not suitable for cold degreasing.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/10-650_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1452, 'Foam nozzle', 19, 149.0, 'For use with a high pressure washer to create a thick, covering foam. The foam nozzle has a quick-connector for Spray Gun 17-841. With adjustable flow and spray angle. Fill the container with one of Biltema’s foam shampoos (refer to shampoo bottle for mixing ratio).', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/17-840_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1453, 'Foam nozzle', 6, 419.0, 'The nozzle fits on a 1/2-hosepipe and is used with foam wash to produce a foam that covers and settles on the surface and also penetrates hard-to-reach areas.The amount of foam can be adjusted with the black ring in the yellow cover.The front section can be pulled out, turned over and put back so that the spray becomes horizontal or vertical.', '2023-05-15 15:12:27', 9, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-4519_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2326, 'Halogen bulb Rally', 8, 22.9, 'Headlight bulb that offers higher effect (watt) and provides an excellent headlight beam. Note than a higher effect can damage the bulb holder and reflector. Not approved for road traffic and shall only be used for off-road driving. Sold individually.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-87_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1454, 'Tyre fix, 500 ml', 15, 54.9, 'A spare tyre in a can. Repairs and pumps a punctured tyre without the wheel needing to be removed. Can also mend punctures on cars, caravans, trailers, etc. without the need for additional tools. Can be used on both tube and tubeless tyres.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H319 Causes serious eye irritation.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-082_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1455, 'Starting fluid, 400 ml', 39, 34.9, 'Biltema''s Starting Fluid facilitates cold start of combustion engines. Prolongs the life of batteries and starters.WARNING! Must not be used on diesel engines with glow plugs.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH302 Harmful if swallowed.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-526_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1456, 'Mounting adhesive, 130 g', 15, 46.9, 'For quick and easy mounting of exhaust systems. The adhesive hardens when heated, which results in 100 % sealed joints.DangerH314 Causes severe skin burns and eye damage.H318 Causes serious eye damage.H335 May cause respiratory irritation.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1772_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1457, 'Nutlock, 50 ml', 20, 84.9, 'Universal product suitable for most situations where you want to prevent screw connections from vibrating loose. A couple of drops is enough to lock a screw or nut. The locking is anaerobic, i.e. it hardens only after it is applied, since there is no air in the screw connection.Produces a secure joint that can be easily taken apart with ordinary hand tools. Can be used on all types of metal (e.g. brass, stainless steel, titanium, aluminium). For thread sizes up to M36.WarningH317 May cause an allergic skin reaction.H319 Causes serious eye irritation.H400 Very toxic to aquatic life.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-30_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1458, 'Tyre fitting paste, 2 kg', 10, 79.9, 'Tyre mounting paste with corrosion protection. Facilitates rim mounting of tyres. The paste is applied to the tyre with a brush.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-000_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1459, 'Flange sealant, 50 g', 17, 64.9, 'Effective sealing between metal surfaces with a quick and secure hardening process. Creates a reliable seal that will not crack or shrink. Withstands temperatures between -62 °C and +330 °C. Very effective against petrol, diesel, glycol, brake fluid, and numerous mineral oils, synthetic oils, etc.Apply to a completely clean surface. The surface must be dry and free of dirt, oil or water.Unscrew the lid and use the lid to pierce the top of the tube.Apply to a clean surface.The product begins to dry within 1 hour, and is fully hardened after 24 hours.Unhardened sealant can be removed with a solvent, such as turpentine.Store the tube in cool, dry area. Should be used within 12 months after opening.WarningH317 May cause an allergic skin reaction.H319 Causes serious eye irritation.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1773_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1460, 'Connector spray, 200 ml', 2, 39.9, 'Forms a lubricating film which protects against corrosion and wear on all electrical connectors in the automotive sector. With a nozzle that can also work upside down for ease of use in tight spaces.DangerEUH018 In use, may form flammable/explosive vapour-air mixture.EUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heated', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4542_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1461, 'Repair paste, 200 g', 24, 29.9, 'For repairing minor damage to silencers and exhaust pipes.DangerH314 Causes severe skin burns and eye damage.H318 Causes serious eye damage.H335 May cause respiratory irritation.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1723_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1462, 'Belt spray, 400 ml', 35, 49.9, 'Reduces wear and tear, slippage and squeaking. Suitable for belts made of leather, textile and rubber.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4546_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1463, 'Rust remover, 250 ml', 22, 49.9, 'Cleaning agent for corroded electrical connectors. Restores a low voltage drop over connectors.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-557_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1464, 'Tyre fix, non-flammable, 500 ml', 15, 109.0, 'A non-flammable gas pumps up and seals a punctured tyre in a few seconds - a safe, fast and simple solution when it is not possible to change a tyre. Low GWP. Recommended for use on all types of vehicle tyres. For tyres 185R 14 and greater. After use the tyre must be immediately examined by a professional tyre shop.WarningEUH208 Contains .?. May produce an allergic reaction.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-8200_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1465, 'Thread sealant, 50 ml', 21, 89.9, 'For sealing fine threads.Seals against e.g. gas, water, liquefied petroleum gas, and petrol.Can also be used on valves and gauges without obstructing flow to/from these.Very high resistance to vibrations and impacts.Produces tight connections that are easy to dismantle even after many years of use.Withstands temperatures up to 150 °C.Suitable for use in connections up to 20 mm (3/4).WarningH315 Causes skin irritation.H317 May cause an allergic skin reaction.H319 Causes serious eye irritation.H335 May cause respiratory irritation.H400 Very toxic to aquatic life.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-31_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1466, 'Car door rubber protection, 100 ml', 10, 29.9, 'Prevents the car door rubber from freezing fast, and protects them from drying out. Simply apply to the rubber seals around the doors, boot, etc. Leaves a layer of protective silicone film. Repeat if necessary. Can also be used on seals for fridges, freezers and washing machines. Shake before use.EUH208 Contains reaction mass of 5-chloro-2-methyl-2H-isothiazol-3-one and 2-methyl-2H-isothiazol-3-one (3:1). May produce an allergic reaction.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-4509_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1467, 'Silencer bandage , 5 x 91 cm', 24, 34.9, 'For mending holes and cracks in conventional and catalytic converter exhaust systems. Can be secured in place with steel wire or masking tape and hardens by means of heat.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000018427/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1468, 'Freeze spray, 270 g', 34, 149.0, 'Freeze Spray is a troubleshooting aid for electrical faults, short circuits, power failures or temperature fluctuations. Freezes quickly down to -55 °C. Can be used for transistors, silicon diodes, resistors, etc., and for metals during induction shrink fitting (bearing installation). Incombustible. To comply with requirements stipulated in F-Gas Regulations, this product contains refrigerants with a low GWP (Global Warming Potential).WarningH229 Pressurised container: May burst if heated', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-611_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1469, 'Leak detector, gas, 250 ml', 21, 49.9, 'Water-based gas leak detector. Quickly and surely reveals and locates gas leaks and pressure losses in pipes, pressurised systems, etc. by generating clearly visible bubbles at the gas leak. Can also be used to check pressure losses in e.g. brake systems (pneumatic brakes) and air conditioning systems. Does not cause stains or corrosion. Compatible with all types of plastic, steel, aluminium, copper, etc.WarningH229 Pressurised container: May burst if heatedH317 May cause an allergic skin reaction.H319 Causes serious eye irritation.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4537_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1470, 'Metal protective oil, 400 ml', 39, 32.9, 'Protects metal products from corrosion. Suitable for use prior to long-term preservation or storage, and for protecting and lubricating machines, weapons, small mechanical parts, and spare parts.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4564_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1471, 'Gas/Oil sealing, 50 ml', 1, 69.9, 'Thread sealant for metal connections. Works equally well on HVAC connections as it does for gas and oil installations. Seals without clogging valves or pressure gauges. In practical tube for easy application. Temperature range -50 °C to +150 °C. Suitable for use in connections up to 75 mm. Does not crack or contract. Very high resistance to vibrations and impacts. Hardens in less than 15 minutes.InstructionsEnsure that all parts are clean, dry and free of oil and grease. A better result is achieved with degreased parts.Fill the connection with sealant by hand, directly from the tube.Assemble the parts.Wipe up any excess sealant that may have seeped out. The thread sealant hardens in the absence of oxygen.Allow the thread sealant to solidify for about 15-30 minutes, depending on the amount used.WarningEUH208 Contains 1-acetyl-2-phenylhydrazine. May produce an allergic reaction.H315 Causes skin irritation.H317 May cause an allergic skin reaction.H319 Causes serious eye irritation.H335 May cause respiratory irritation.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-41_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1472, 'PTFE Lock Lubricant, 50 ml', 26, 19.9, 'PTFE-based lock lubricant for old and new locks. For preventive use. The addition of PTFE ensures the lock will not freeze. Even old, rusted and seized locks will be like new after treating them with this lock lubricant. Moisture displacing.WarningH226 Flammable liquid and vapour.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-425_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1473, 'Vaseline spray, 200 ml', 15, 54.9, 'For heavy-duty connectors in the automotive sector. Forms a thick, lubricating and water-repellent protective film. For electrical connectors, battery terminals, main switches, push-pull connectors and outdoor switches in unprotected environments. Not electrically conductive.DangerEUH018 In use, may form flammable/explosive vapour-air mixture.EUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4547_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1474, 'Car door rubber protection, 80 ml', 10, 9.9, 'Prevents the car door rubber from freezing fast, and protects them from drying out. Simply apply to the rubber seals around the doors, boot, etc. Leaves a layer of protective silicone film. Repeat if necessary. Can also be used on seals for fridges, freezers and washing machines. Shake before use.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1904_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1475, 'Lock Spray', 21, 14.9, 'Thaws ice in frozen locks. 15 ml.DangerExtremely flammable aerosol.Pressurised container: May burst if heated.Causes serious eye irritation.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1750_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1476, 'Vaseline Spray', 16, 54.9, 'For heavy-duty connectors in the automotive sector. Forms a thick, lubricating and water-repellent protective film. For electrical connectors, battery terminals, main switches, push-pull connectors and outdoor switches in unprotected environments. Not electrically conductive. 200 ml.DangerRepeated exposure may cause skin dryness or cracking.Extremely flammable aerosol.Pressurised container: May burst if heated.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4531_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1477, 'Brake cleaner, 400 ml', 5, 24.9, 'Quick-drying, ultra-effective product for cleaning brake drums, pads, discs, couplings, cylinders, lines and strips. Removes grease, oil, lubricant, tar, etc. Does not damage plastic or paint. Mitigates brake noise.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4566_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1478, 'Heat-resistant paint', 9, 54.9, 'Heat-resistant spray paint for painting surfaces that become hot, inside and outside, e.g. flue pipes, outdoor grills, iron stoves, etc. Withstands temperatures up to +600 °C. Primer must NOT be used as it cannot withstand high temperatures. Surfaces exposed to naked flames must be allowed to dry for at least 24 hours before use (iron stoves, outdoor grills, etc.). The paint will NOT harden until it is heated.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-107_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2294, 'Halogen bulb Offroad, Mega blue, H1, 12 V, 100 W, 2-pack.', 34, 129.0, 'Halogen bulb with blue glass that produces an extremely white light. High colour temperature. Perfect for both your everyday car and for car tuning. Shines up to 30% more light on the road than standard halogen bulbs. Offers higher output (watt) and produces an excellent headlight beam. Take note that a higher output can damage the bulb holder and reflector. Not approved for road traffic and must only be used for off-road driving. Sold in pairs.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-5653_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1479, 'Heat-resistant paint, black, 400 ml', 21, 54.9, 'Heat-resistant spray paint for painting surfaces that become hot, inside and outside, e.g. flue pipes, outdoor grills, iron stoves, etc. Withstands temperatures up to +600 °C. Primer must NOT be used as it cannot withstand high temperatures. Surfaces exposed to naked flames must be allowed to dry for at least 24 hours before use (iron stoves, outdoor grills, etc.). The paint will NOT harden until it is heated.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-107_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1480, 'Clear coat for Biltema Touch-up Paint, 400 ml', 4, 64.9, 'Transparent coat for painting over Biltema Touch-up Paint. Gives painted surfaces a high finish and superior durability. The clear coat dries quickly and makes the surface resistant to wear.NOTE: For best results, metallic paint should always be painted over with clear coat.The clear coat is only intended for use with Biltema Touch-up Paint.DangerEUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-104_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1481, 'Zinc/cold galvanising agent, 400 ml', 40, 54.9, 'Zinc spray suitable for rust-proofing on surfaces of iron/steel which are not normally painted over, for example, exhaust pipes, weld joints, surfaces on the insides of engine bays and bodywork. Zinc content 90% in a dry film. The cold galvanising agent has good coverage and dries quickly, the surface is workable after 30 minutes. The surface can withstand temperatures of up to approx. +200 °C.DangerEUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-106_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1482, 'Rim paint, 400 ml', 36, 49.9, 'Special paint for painting wheel rims. A constituent special paint makes the paint impact- and wear-resistant, and also protects against salt and gravel. The paint produces a semi-glossy surface and has good coverage. Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. For best painting results, first use primer, 34-101 or 34-102.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-117_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1483, 'Rim paint, black, 400 ml', 11, 49.9, 'Special paint for painting wheel rims. A constituent special paint makes the paint impact- and wear-resistant, and also protects against salt and gravel. The paint produces a semi-glossy surface and has good coverage. Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. For best painting results, first use primer, 34-101 or 34-102.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heated.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-122_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1484, 'Brake cleaning, refill 5 litre', 30, 269.0, 'Quick.drying and effective product for cleaning of all brake and clutch parts. Removes grease, oil, dirt, brake fluid and hardened residue. Does not harm plastic or painted surfaces. Mitigates brake noise. Applied with a spray bottle for refill.DangerH222 Extremely flammable aerosol.H304 May be fatal if swallowed and enters airways.H315 Causes skin irritation.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4554_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1485, 'Engine paint, glossy black, 400 ml', 3, 54.9, 'Paint for engine blocks, cylinder heads, etc. Quick-drying paint that hardens into an enamel-like surface. Withstands temperatures up to 150 °C.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-112_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1486, 'Brake cleaning, refill 5 litre', 34, 269.0, 'Quick.drying and effective product for cleaning of all brake and clutch parts. Removes grease, oil, dirt, brake fluid and hardened residue. Does not harm plastic or painted surfaces. Mitigates brake noise. Applied with a spray bottle for refill.NOTE! Do not use on energised or sensitive electronic equipment. Ensure good ventilation. Test on sensitive material prior to use.Instructions: Apply with a spray bottle for refill. Use the extension pipe for precise application. Spray liberally and allow it to run off and dry at room temperature, or wipe it off with a clean cloth. Repeat as necessary.Storage: Must be stored in an area out of direct sunlight and protected from frost.DangerH225 Highly flammable liquid and vapour.H304 May be fatal if swallowed and enters airways.H315 Causes skin irritation.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://www.caspianpolicy.org/no-image.png');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1487, 'Engine paint, matte black, 400 ml', 5, 54.9, 'Paint for engine blocks, cylinder heads, etc. Quick-drying paint that hardens into an enamel-like surface. Withstands temperatures up to 150 °C.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-115_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1488, 'Hand cleaner, 4 litre', 20, 189.0, 'Coarse cleaning agent that effectively dissolves oil, grease and other stubborn dirt. Contains corn-based biodegradable abrasive. The grains carefully scrub away the most stubborn dirt from hands. For use on dry hands.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9801_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2295, 'Halogen bulb H15, 12 V, 55 W, 1 pcs', 16, 199.0, 'Halogen bulb for fog, full or dipped beam vehicle lights at an affordable price. Conforms to ECE R37 and therefore approved for road traffic. Sold individually.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-4821_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1489, 'AC Cleaner, 150 ml', 14, 39.9, 'For effective cleaning of the car''s AC system. Removes bacteria and mould that can cause bad smells.Easy to use.Cleans the entire AC system in 10 minutes.Removes bacteria and mould.Not harmful to seat coverings.Helps prevent allergic reactions.NOTE! Use biocides safely. Always read the label and product information before use.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-865_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1490, 'Plastic paint, 400 ml', 38, 54.9, 'Quick drying plastic paint with good coverage. Developed for painting external plastic parts on cars, motorcycles, caravans, motorhomes, etc. Perfect for e.g. bumpers, spoilers, side skirts.DangerEUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-125_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1491, 'Hand cleaner, 1 litre', 4, 69.9, 'Coarse cleaning agent that effectively dissolves oil, grease and other stubborn dirt. Contains corn-based biodegradable abrasive. The grains carefully scrub away the most stubborn dirt from hands. For use on dry hands.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-1770_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1492, 'Hand cleaner, 1 litre', 30, 69.9, 'A concentrated, extra-strong hand cleaner that effectively removes ingrained dirt, grease, grime, oil, etc. The cleaning paste contains natural plant-based abrasives and activated charcoal. The hand cleaner leaves skin soft, clean, and fragrant.Instructions: Apply the product to dry hands, rub them gently together, and gradually add water until all the dirt is dissolved. Rinse hands thoroughly and then dry.Warnings: Do not use the product on sensitive areas such as the face, armpits, or intimate areas.Does not contain:Parabens and silicones', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9804_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1493, 'Brake calliper paint, red, 400 ml', 20, 84.9, 'Quick-drying 1-component acrylic paint with good adhesion for painting brake calipers. Produces a glossy, heat-resistant surface that protects against corrosion and chemicals and easy to keep clean.Remove loose rust and dirt with a wire brush.Spray on the paintHeat-resistant up to 200 °C.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7495_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1494, 'Rubber Paint, matte black, 400 ml', 21, 129.0, 'An easy way to repaint or protect the things you own. The paint applies easily and adheres to most materials. Produces an elastic, rubber-like surface that protects against e.g. sunlight, corrosion and moisture. Can be used on e.g. cars, boats and motorcycles. Suitable for e.g. rims. Easy to remove after use.Produces a very elastic film.Can be painted over with itself.Waterproof.Attaches to e.g. metal, carbon fiber, wood, plastic, stone and glass.Protects against sunlight, corrosion and moisture.Leaves no residue or marks.Suitable for e.g. rims.Instructions for use:Clean the surface to be painted, the surface must be dry and free of grease and dust. Shake the can well before use. Spray distance: 20–25 cm. Spray in several thin layers. Allow each coat tack to dry 15-20 minutes before the next spray. Let the surface dry for about 4 hours. Turn the can upside down and spray the valve clean after use. Apply at least 4-5 layers to be able to remove the color easily.NOTE! Test spray first on a hidden surface to check the result.DangerEUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-62_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1495, 'Vinyl paint, black, 400 ml', 16, 54.9, 'Spray paint for plastic surfaces on vehicles, e.g. for ceilings, walls, mirrors, dashboards, door sides and car upholstery. Also works well on computers, surfboards, skateboards and snowboards.The paint is highly adhesive, pliable and does not crack.For best adhesion, Vinyl Primer is recommended.Cover areas that will not be painted. Polystyrene surfaces must be covered before painting.Good adhesion, even on leather and plastics.Flows easily and spreads well.Quick drying, scratch-resistant and weatherproof.Tolerates water and mild detergents.Do not spray onto cured materials, such as epoxy paint, as the paint coat may rise.DangerEUH205 Contains epoxy constituents. May produce an allergic reaction.EUH208 Contains  Fatty acids, C18, unsatd., dimers, reaction products with N,N-dimethyl-1,3-propanediamine and 1,3- propanediamine. May produce an allergic reaction.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-124_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1496, 'Metallic rim paint, 500 ml', 25, 59.9, 'Excellent aerosol that makes worn rims shine like new. Quickly dries to provide a durable and high-gloss silvery finish that offers lasting protection from brake dust, chemicals, heat and wear. Not compatible with Biltema''s other rim paints or primers 36-7418 and 36-7419. Can be painted over with acrylic paint.Instructions for use: Clean the rims carefully and possibly pre-treat with acrylic primer, 36-26, for even better durability, but it is not necessary. Shake the jar for 3 minutes. Before painting, always test spray on a plate to check that the color tone is the desired one. Spray from a distance of 25 cm. Clean the spray nozzle after use.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH208 Contains .?. May produce an allergic reaction.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-24_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1497, 'Spray bottle for refill, 650 ml', 10, 269.0, 'Save money and the environment with this compressed air driven spray bottle that can be filled with, for example, grease, brake cleaner, rust remover or other substances that are sold in refill packages. The compressed air is easily filled using a compressor or bicycle pump.With one long and one short nozzle for wide or narrow spray. Works upside-down.Volume: 650 ml (Recommended ratio air to liquid: 50/50.)In aluminium.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/20-579_xl_1.jpg');
