INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2296, 'Halogen bulb H1 Mega Blue, 2-pack', 19, 99.9, 'Halogen bulb with blue glass that produces an extremely white light. High colour temperature. Perfect for both your everyday car and for car tuning. Shines up to 30% more light on the road than standard halogen bulbs. Conforms to ECE R37 and therefore approved for road traffic. Sold in pairs.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-5663_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1508, 'Rear light coating, black, 150 ml', 12, 34.9, 'Black transparent gloss paint that produces a gradient effect on front, rear and side lights, glass, etc. The paint creates a durable shine and is impact resistant.Be careful when using older rear lights as the plastic may crack.Instructions:Use the can at 20-25 °C, shake it for a few minutes. Spray at a distance of 18-25 cm. Shake the can during use. In cold temperatures, warm the can to 20-25 °C in a hot water bath. For best results, apply at an ambient temperature over 15 °C. Spray in thin coats, so that the paint does not run. Turn the can upside down and spray the nozzle clean after use. Remove the paint with Paint stripper for Biltema’s rear light coating. First test the paint in a concealed area.NOTE! Not approved for road trafficDangerEUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-111_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1509, 'Vinyl paint, white, 400 ml', 25, 54.9, 'Spray paint for plastic surfaces on vehicles, e.g. for ceilings, walls, mirrors, dashboards, door sides and car upholstery. Also works well on computers, surfboards, skateboards and snowboards.The paint is highly adhesive, pliable and does not crack.For best adhesion, Vinyl Primer is recommended.Cover areas that will not be painted. Polystyrene surfaces must be covered before painting.Good adhesion, even on leather and plastics.Flows easily and spreads well.Quick drying, scratch-resistant and weatherproof.Tolerates water and mild detergents.Do not spray onto cured materials, such as epoxy paint, as the paint coat may rise.DangerEUH205 Contains epoxy constituents. May produce an allergic reaction.EUH208 Contains Fatty acids, C18, unsatd., dimers, reaction products with N,N-dimethyl-1,3-propanediamine and 1,3- propanediamine. May produce an allergic reaction.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-127_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1510, 'Rim paint, white, 400 ml', 2, 49.9, 'Special paint for painting wheel rims. A constituent special paint makes the paint impact- and wear-resistant, and also protects against salt and gravel. The paint produces a semi-glossy surface and has good coverage. Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. For best painting results, first use primer, 34-101 or 34-102.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-117_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1511, 'Vinyl primer, spray, 400 ml', 11, 59.9, 'Transparent primer that provides good adhesion before painting with Biltema vinyl paint. Cover areas that will not be painted, especially polystyrene surfaces. Do not spray on cured materials, e.g. epoxy paint.DangerEUH205 Contains epoxy constituents. May produce an allergic reaction.EUH208 Contains Fatty acids, C18, unsatd., dimers, reaction products with N,N-dimethyl-1,3-propanediamine and 1,3- propanediamine. May produce an allergic reaction.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://www.caspianpolicy.org/no-image.png');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1512, 'Engine flush, 250 ml', 37, 49.9, 'Internal engine cleaner that removes combustion residues, soot, deposits, water and antifreeze. The engine is cleaned internally, and exhaust emissions and fuel and oil consumption are reduced.ENGINES PRODUCEWater, acids, coke, resin, salts, gases, soot, and unburned fuel are produced during one combustion. Some of these substances end up in the engine oil, which reduces the service life of the oil and causes deposits to form over time in the engine.WEAR OCCURSDeposits and impurities cause parts to wear out, hydraulic lifts to tick, piston rings to coke up, and fuel and oil consumption to increase over time.ACIDIC ENVIRONMENTWhen changing oil, new engine oil becomes contaminated by existing oil residues. This results in a shorter oil service life than if the engine was clean inside.CLEANER ENGINEEngine flush effectively cleans the internal parts of the engine from deposits that are loosened during the oil change. This gives the new engine oil a longer service life and a significantly better working environment.ADVANTAGESEffectively cleans the inside of the engine from deposits, soot, coolant, and condensation water. Reduces exhaust emissions, fuel and oil consumption by restoring the engine condition and allowing engine oil to work optimally.AREAS OF USEFor petrol, diesel and ethanol engines, as well as compressors.Also works great for motorcycles with or without wet clutch.INSTRUCTIONSAdd to a warm engineRun the engine about 20 minutes.Drain the oil.Change the filter and refill with new engine oil.DOSAGEOne 250 ml can to 4-6 litres engine oil.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-002_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1513, 'Brake calliper paint, silver, 250 ml', 17, 109.0, 'Quick-drying 1-component alkyd paint for brake callipers. For brush application (brush NOT included). Produces a glossy, heat-resistant surface that protects against corrosion and chemicals and easy to keep clean.Remove loose rust and dirt with a wire brush.Stir the paint before and during painting.Heat-resistant up to 200 °C.DangerH226 Flammable liquid and vapour.H315 Causes skin irritation.H317 May cause an allergic skin reaction.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-338_xl_1.jpg');
