INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1518, 'Rubber Paint, gun metal, matt, 400 ml', 24, 129.0, 'An easy way to repaint or protect the things you own. The paint applies easily and adheres to most materials. Produces an elastic, rubber-like surface that protects against e.g. sunlight, corrosion and moisture. Can be used on e.g. cars, boats and motorcycles. Suitable for e.g. rims. Easy to remove after use.Produces a very elastic film.Can be painted over with itself.Waterproof.Attaches to e.g. metal, carbon fiber, wood, plastic, stone and glass.Protects against sunlight, corrosion and moisture.Leaves no residue or marks.Suitable for e.g. rims.Instructions for use:Clean the surface to be painted, the surface must be dry and free of grease and dust. Shake the can well before use. Spray distance: 20–25 cm. Spray in several thin layers. Allow each coat tack to dry 15-20 minutes before the next spray. Let the surface dry for about 4 hours. Turn the can upside down and spray the valve clean after use. Apply at least 4-5 layers to be able to remove the color easily.NOTE! Test spray first on a hidden surface to check the result.DangerEUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-62_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1519, 'Rubber Paint, matte white, 400 ml', 2, 135.0, 'An easy way to repaint or protect the things you own. The paint applies easily and adheres to most materials. Produces an elastic, rubber-like surface that protects against e.g. sunlight, corrosion and moisture. Can be used on e.g. cars, boats and motorcycles. Suitable for e.g. rims. Easy to remove after use.Produces a very elastic film.Can be painted over with itself.Waterproof.Attaches to e.g. metal, carbon fiber, wood, plastic, stone and glass.Protects against sunlight, corrosion and moisture.Leaves no residue or marks.Suitable for e.g. rims.Instructions for use:Clean the surface to be painted, the surface must be dry and free of grease and dust. Shake the can well before use. Spray distance: 20–25 cm. Spray in several thin layers. Allow each coat tack to dry 15-20 minutes before the next spray. Let the surface dry for about 4 hours. Turn the can upside down and spray the valve clean after use. Apply at least 4-5 layers to be able to remove the color easily.NOTE! Test spray first on a hidden surface to check the result.DangerEUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-62_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1520, 'Gasket remover, 400 ml', 25, 89.9, 'Effectively removes residues from rubber gaskets, hardened sealant or glue. Protects the surface since less scraping is required. Can be used as a solvent on e.g. metal, plastic and wood surfaces. Must not be used on sensitive plastics, PVC, synthetic materials or linoleum.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH318 Causes serious eye damage.H335 May cause respiratory irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-44_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1521, 'Rubber paint, 1 litre', 1, 279.0, 'For tuning vehicles and rims, and for long-term or temporary coating of metal, wood, glass, plastic, paper and textile. Produces an elastic, grip-friendly surface that protects against e.g. sunlight, corrosion and moisture. Easy to apply and remove.NOTE! Must be diluted with Thinner 36-6005.DangerEUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H225 Highly flammable liquid and vapour.H315 Causes skin irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-6000_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1522, 'Paint stripper for Biltema’s rear light coating, 150 ml', 27, 34.9, 'Paint stripper that effectively removes Biltema’s transparent coating/paint and developed for front, rear and side lights, glass, etc.DangerH222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-110_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1523, 'Vinyl Spray Paint, 400 ml', 2, 59.9, 'Change the colour of your car''s plastic surfaces. For car ceilings, walls, mirrors, dashboards, door panels and upholstery. Also works well on computers, surfboards, skateboards and snowboards.The paint is highly adhesive, pliable and does not crack. For best adhesion, Vinyl Primer is recommended. Cover areas that will not be painted. Polystyrene surfaces must be covered before painting.Good adhesion, even on leather and plastics.FluidLong-lastingGood coverageQuick-dryingScratch-resistantWeather-resistantTolerates water, certain alcohols, and mild detergentsDo not spray onto hardened materials, such as epoxy paint, as the paint coat may riseDangerIn use may form flammable/explosive vapour-air mixture.Repeated exposure may cause skin dryness or cracking.Extremely flammable aerosol.Pressurised container: May burst if heated.Causes serious eye irritation.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-15_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1524, 'Tar spray, 400 ml', 38, 54.9, 'Effectively protects threads against corrosion and rust. Prevents bolts and nuts from becoming stuck and metals from melding together, which facilitates dismantling. Can be used to protect threads in various vehicles, machinery, hoists, conveyor belts and metal constructions.DangerEUH066 Repeated exposure may cause skin dryness or cracking.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH317 May cause an allergic skin reaction.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4518_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1525, 'Wheel rim paint, 400 ml', 11, 49.9, 'Special paint for painting wheel rims. A constituent special paint makes the paint impact and wear-resistant, and also protects against salt and gravel. Good coverage. Semi-gloss. Before painting, always test-spray on a metal sheet to ensure the colour tone matches the desired result. For best painting results, first use primer. 400 ml.AluminiumDangerIn use may form flammable/explosive vapour-air mixture.Extremely flammable aerosol.Pressurised container: May burst if heated.Causes serious eye irritation.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7402_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1526, 'Automatic Transmission Flush', 14, 29.9, 'For effective internal cleaning of automatic transmissions before oil change. Dissolves coatings and deposits that build up between oil changes. Reduces wear and fixes gear shifting problems caused by dirt and deposits.DangerRepeated exposure may cause skin dryness or cracking.May be fatal if swallowed and enters airways.May cause an allergic skin reaction.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-011_xl_1.jpg');
