INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1528, 'Rear light cluster paint, 150 ml', 35, 34.9, 'Tinted transparent paint adapted for front, side and rear light clusters, glass, etc. The paint has a sustainable shine and is scratch free and impact resistant. Packaging: 150 ml spray container.DangerIn use may form flammable/explosive vapour-air mixture.Repeated exposure may cause skin dryness or cracking.Extremely flammable aerosol.Pressurised container: May burst if heated.Causes serious eye irritation.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-869_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1529, 'Rubber Paint, 400 ml', 32, 129.0, 'An easy way to repaint or protect the things you own. The paint applies easily and adheres to most materials. Produces an elastic, rubber-like surface that protects against e.g. sunlight, corrosion and moisture. Can be used on e.g. cars, boats and motorcycles. Suitable for e.g. rims. Easy to remove after use.DangerEUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH315 Causes skin irritation.H336 May cause drowsiness or dizziness.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-68_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1530, 'Silver chrome, 400 ml', 6, 54.9, 'Quick-drying paint that gives a chrome-like appearance. For use on wood and metal, painted or unpainted surfaces. Functions as its own primer. Cannot be overpainted. The paint is intended only for decorative purposes: not to be touched. Should not be used on wheel rims. 400 ml.DangerExtremely flammable aerosol.Pressurised container: May burst if heated.Causes skin irritation.Causes serious eye irritation.May cause drowsiness or dizziness.May cause damage to organs through prolonged or repeated exposure <or state all organs affected, if knownShow safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-7414_xl_1.jpg');
