INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1532, 'Tyre Grip', 32, 24.9, 'Tyre Grip (Snow grip) temporarily provides better grip on slippery surfaces such as ice and snow. Can be used on car tyres, motorcycle tyres, bicycle tyres and shoes with rubber soles. Tyre Grip is easily sprayed onto the tyre and can last for up to 20 km, depending on the conditions. The bottle is sufficient for approx. 20 normal-sized tyres. 400 ml.DangerExtremely flammable aerosol.Pressurised container: May burst if heated.Causes skin irritation.Causes serious eye irritation.May cause drowsiness or dizziness.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-5929_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1533, 'Hardener, 100 g', 11, 39.9, 'Polyester and gelcoat hardener.DangerH242 Heating may cause a fire.H302 Harmful if swallowed.H314 Causes severe skin burns and eye damage.H318 Causes serious eye damage.H332 Harmful if inhaled.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/30-199_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1534, 'Spray filler, 400 ml', 5, 54.9, 'Acrylic-based spray filler for paint damage and scratches on cars, caravans, plastic boats, in the home, etc. The filler quickly fills minor scuffs, scratches and damage to paintwork. The product has good filling and drying properties, good adhesion, flows easily and leaves an even and pore-free surface. Can be painted over with any of Biltema’s paints. Can be used on ABS, PVC, other plastics previously treated with primer, metal surfaces, bumpers, car interiors made of plastic or metal.NOTE! Only for use on solvent-resistant plastic. Test suitability on plastic material before application.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.H222 Extremely flammable aerosol.H229 Pressurised container: May burst if heatedH319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-126_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1535, 'Fiberglass filler, short strand, 0.54 l', 27, 89.9, 'Two-component fibreglass-reinforced polyester filler with a high content of short-strand fiberglass (3 mm). For repairing holes/dents in vehicle bodywork, fibreglass hulls, plastic mudguards, etc. Produces a strong mend that will not crack. It is intended for most surfaces including iron, aluminium, zinc and fibreglass. The filler can be applied in a thick coat and can be sanded. Contains filler and hardener, 20 g.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0188_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1536, 'Standard filler, 0.8 l', 31, 99.9, '2-component polyester filler with short drying time, good sanding properties, and good filling properties. Creates a dense, non-porous surface. Used for large repairs, such as sheet metal and paint damage to cars, caravans, etc. The vehicle filler adheres to most materials, such as iron, aluminium and fibreglass. Contains filler and hardener, 40 g.DangerH315 Causes skin irritation.H319 Causes serious eye irritation.H361d Suspected of damaging the unborn childH372 Causes damage to organs through prolonged or repeated exposure .?.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0181_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2297, 'Halogen bulb Offroad Gold H7, 12 V, 100 W, 2-pack', 35, 99.9, 'Halogen bulb that gives the reflector a cool-looking, yellowish light. Not approved for road traffic and must only be used for off-road driving. Sold in pairs.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-5231_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1537, 'Fiberglass filler, long strand, 0.54 l', 34, 89.9, '2-component fibreglass-reinforced polyester filler with a high content of long-strand fibreglass (6 mm). For repairing holes/dents in vehicle bodywork, fibreglass hulls, plastic mudguards, etc. Produces a strong mend that will not crack. It is intended for most surfaces including iron, aluminium, zinc and fibreglass. The filler can be applied in a thick coat and can be sanded. Contains filler and hardener, 20 g.DangerH315 Causes skin irritation.H319 Causes serious eye irritation.H361d Suspected of damaging the unborn childH372 Causes damage to organs through prolonged or repeated exposure .?.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0189_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1538, 'Metal filler, 0.27 l', 27, 69.9, 'Special filler suitable for repairing light metals, galvanised sheet metal, and steel. The filler has a high aluminium powder content, which gives it a fine texture and makes it easy to use and easy to sand. This two-component polyester filler is resistant to petrol, coolant, oil, water, etc. Able to withstand high temperatures within 5 minutes of application and is fully hardened after 10-15 min. Contains filler and hardener, 10 g.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0185_xl_1.jpg');
