INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1577, 'Gasket silicone, hight temperature, 75 ml', 19, 69.9, 'Flexible and durable. Self-vulcanising silicone for making your own gaskets.  Resists water, engine and transmission oil, brake fluid, glycol, etc. Stays elastic without cracking. Vulcanises at room temperature. Easily removable for repair/disassembly. Withstands temperatures up to +300 °C.DangerH315 Causes skin irritation.H318 Causes serious eye damage.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1775_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1578, 'Bodywork sealants, black, 290 ml', 28, 74.9, '1-component MS polymer-based sealing compound for motor vehicle applications. Suitable as filler between steel sections, sealing bodywork seams, screwed mudflaps, headlight and rear light ramps, cable bushings, etc. Also suitable as filler/stabiliser for decorative strips and emblems. Excellent adhesion on untreated steel. The fully-cured sealing compound remains semi-elastic. Allows flexibility up to 25 %. Applied by putty gun. Can be over-painted.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4829_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1579, 'Butyl sealant', 23, 59.9, 'Sealant based on single-component polybutene that produces an effective and weatherproof seal in various indoor and outdoor applications.PropertiesHighly elastic: Allows joint movement up to 5%.Versatile: Good adhesion without primer on most construction materials.Semi-hardening: Forms a dry surface layer but remains elastic underneath.High dry matter content: Excellent gap filling properties without shrinkage.Weather-resistantUV-stableGood chemical resistanceApplicationsSealing roofing sheets, car panels, and concrete elements.Sealing timber against masonry, stone and concrete in e.g. roof applications.Sealing gaps and cracks in masonry and stone.Sealing around window and door frames against soft and hard timber, metal, as well as concrete and stone structures.InstructionsThe surfaces must be clean and dry. Free from release agents, existing weather seal, dust, loose mortar, cement skin, paint or other finishes. The sealant should be at room temperature when applied. Screw the applicator tip onto the cartridge and cut the tip to the desired joint width. Apply butyl sealant with regular putty gun and start filling the joint from the bottom up. Joints can be smoothed with a grout trowel or similar tool. A dry trowel is preferable, but a small amount of xylene can be used to lubricate the trowel.NOTE!Do not use in applications that will be exposed to water pressure or be constantly immersed in water.Do not use in applications with natural stoneAlways test on a smaller, concealed area first to ensure that the product works as intended.EUH210 Safety data sheet available on request.EUH211 Warning! Hazardous respirable droplets may be formed when sprayed. Do not breathe spray or mist.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0229_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1580, 'Sealant, 118 ml', 20, 79.9, 'Liquid gasket sealant that hardens slowly and remains elastic after hardening. Used for e.g. sealing gaskets, flanges, metal against metal, and for locking threads. The sealant withstands petrol, diesel, oil, and refrigerant. Ideal for use in all types of vehicles. Withstands pressures up to 345 bar.Instructions:Make sure the surfaces are clean and dry.Apply an even layer of sealant to all surfaces to be joined and around any bolt holes.Fit and tighten to the recommended torque.Leave to dry for 4 hours. Fully hardened after 24 hours.WarningH226 Flammable liquid and vapour.H317 May cause an allergic skin reaction.H319 Causes serious eye irritation.H336 May cause drowsiness or dizziness.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1776_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1581, 'Bodywork sealants, white, 290 ml', 28, 74.9, '1-component MS polymer-based sealing compound for motor vehicle applications. Suitable as filler between steel sections, sealing bodywork seams, screwed mudflaps, headlight and rear light ramps, cable bushings, etc. Also suitable as filler/stabiliser for decorative strips and emblems. Excellent adhesion on untreated steel. The fully-cured sealing compound remains semi-elastic. Allows flexibility up to 25 %. Applied by putty gun. Can be over-painted.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4829_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1582, 'Epoxy putty, aluminum, 50 g', 14, 74.9, 'Putty bar with encapsulated hardener. Can be kneaded and is malleable. Protective gloves must be used when handling the product. Neither shrinks nor rusts and needs no tools. Gives a strong and permanent fix. Does not contain solvents. Can be used both indoors and outdoors. The putty takes 24 hours to fully harden. After 60 minutes, the applied area can be machined, drilled, threaded, sanded, filed, and painted.WarningEUH205 Contains epoxy constituents. May produce an allergic reaction.H315 Causes skin irritation.H317 May cause an allergic skin reaction.H319 Causes serious eye irritation.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1303_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1583, 'Silicone, high temperature', 2, 84.9, 'Stays elastic without cracking. Resistant to ageing. Withstands temperatures from -50 °C to +250 °C, and for short periods up to +300 °C. Red. 310 ml For use in:Car:gaskets.Boat:gaskets.Houses:chimney grommets, etc.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4813_xl_1.jpg');
