INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1585, 'Gasket conditioner, 100 ml', 28, 159.0, 'Additive that seals oil leaks in all types of oil systems. Seals leaks in the engine, compressor, gearbox, rear axle, hub reduction, hydraulic system, and power steering. The products restores hard rubbers, such as gaskets and O-rings, and makes them flexible again. However, it cannot repair damaged rubber.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-005_xl_1.jpg');
