INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1588, 'Butyl sealing', 6, 29.9, 'Produces a very tight and elastic seal. For joints and penetrations in buildings, cars and boats (above the waterline). Seals in roofing, chimneys, gutters, drain spouts, and more. Also for expansion joints (with backer rods). For indoor and outdoor use. Grey. 300 ml.Features & FunctionsHigh elasticity: Allows joint movement up to 25%.Versatile:  Good adhesion without primer on most materials incl. bitumen. Even binds to wet, slippery surfaces.Can be overpainted with most paints and varnishes, including water-based.Weather-resistantUV stableMould resistantSilicone-free\NOTE! Does not contain solvents. Emits a strong odour when curingWarningRepeated exposure may cause skin dryness or cracking.Flammable liquid and vapour.May cause drowsiness or dizziness.Show safety phrases', '2023-05-15 15:12:27', 10, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-4836_xl_1.jpg');
