INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1595, 'Polishing cone for screwdriver, 3-pack', 27, 59.9, 'Cone-shaped polishing sponge used for polishing hard-to-reach spaces, such as car door handles, rims, etc. The cone attaches to a drill or powered screwdriver. Use polisher to polish off scratches and shine up the paintwork. Use the orange sponge for heavy-duty polishing, yellow for normal polishing and blue for finishing.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/10-814_xl_1.jpg');
