INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1598, 'Foam pad cleaning brush', 32, 59.9, 'During polishing, the polishing pad quickly becomes clogged with wax and polish. With this practical brush, the pad is easily cleaned during polishing, which means the same pad can be used for longer without needing to be washed. Suitable for foam rubber, wool and microfibre pads.Attach the polishing pad to the polishing machine and start at the lowest speed. Hold the brush lightly against the rotating pad. Start in the middle and move the brush out towards the edge. Repeat several times.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-604_xl_1.jpg');
