INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1602, 'Orbital polishing machine PO 125A', 30, 449.0, 'Care for your car, boat or caravan more easily with an orbital polisher.This orbital polisher is a practical and effective tool for freshening up the surface and paintwork on cars, boats, and caravans. The machine has a 9 mm ejection distance, which provides effective polishing and minimises the appearance of micro-scratches (holograms). The ergonomic design and low weight make it easy to use and produce good results. It has variable speed control and an ergonomic handle. Supplied with backing disc (diameter 125 mm), polishing sponge for waxing/sealing, 5-metre rubber cable, and 2 spare handles.9 mm ejection distance125 mm backing discPolishing sponge for waxing/sealing5 m rubber cable2 spare handles', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/17-835_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1603, 'Eccentric polishing machine PO 125A', 9, 449.0, 'Easy to use and effective. Ideal for cars, boats and caravans. The eccentric rotation prevents the formation of holograms. Equipped with stepless speed regulator and five metre rubber cable. Supplied with Ø 125 mm backing disc, polishing sponge for waxing/sealing, and two extra handles.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/17-514_xl_1.jpg');
