INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1610, 'Polishing Machine PM 75R', 24, 369.0, 'A polisher is a great tool for freshening up surfaces and paintwork on your car, boat or caravan. An orbital polisher is ideal for slightly heavier polishing, when you have slightly deeper scratches. The advantage of an orbital machine is that it is more efficient and vibration-free. It has variable speed control, ergonomic handle, and 5-metre rubber cable. Supplied with Ø 75 mm backing disc, polishing sponge for waxing/sealing, and two spare handles.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/17-787_xl_1.jpg');
