INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1613, 'Polish, medium cut , 500 ml', 10, 149.0, 'Silicone-free polish without filler. For use with eccentric polisher. The product removes small to medium scratches and leaves an excellent shine. Easy to wipe afterwards with a microfibre cloth. Finish with polish and quick wax.Repeated exposure may cause skin dryness or cracking.Safety data sheet available on request.Show safety phrases', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-804_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1614, 'Headlight polishing kit', 5, 119.0, 'Headlight polish with improved formula for restoring headlight glass and other clear plastics. Restores the clarity and effectively removes scratches and oxidisation in the plastic. Complete restoration kit.Contains the following:Polish 75 gSealant 125 mlMicrofibre clothWarningH317 May cause an allergic skin reaction.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-28_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1615, 'Heavy cut polish, 500 ml', 1, 149.0, 'Silicone-free polish with very good abrasion. For use with eccentric polisher. Easily removes bad scratches. Easy to wipe afterwards with a microfibre cloth. The product leaves a very shiny surface after polishing. Delicate paintwork must be polished with a medium cut polish. Finish with medium cut polish and quick wax.EUH066 Repeated exposure may cause skin dryness or cracking.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-802_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1616, 'Colour scratch remover, black, 150 g', 4, 94.9, 'Repairs surface scratches and discolouration. Produces a colour-matching finish. 150 g.Instructions:Use a gentle circular motion to rub in the scratch remover with until the scratch is gone.Wipe away any residue before it dries.NOTE!Use only on superficial scratches. The scratch is superficial if no resistance is felt when running a fingernail over it. Do not use on damaged paintwork. Does not contain solvents. To prevent the paint from coming off, do not rub too hard. Be careful around the edges. Do not use on newly-painted surfaces. Glossy surfaces may become matte. First test the product on a concealed area.WarningH317 May cause an allergic skin reaction.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-658_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1617, 'Polish with pigment, black, 500 ml', 13, 64.9, 'Cleans, re-coats and polishes in one treatment. Efficient against superficial scratches, oxidation, ingrained dirt and insects. Gives a protective and lasting finish.NOTE! Use only on superficial scratches. The scratch is superficial if no resistance is felt to drawing a fingernail over it. Do not use on damaged paint surfaces.Show safety phrases', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-644_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1618, 'Polishing wax, 500 ml', 38, 79.9, 'This is a carnauba polishing wax that polishes and gives paintwork a high-gloss finish. The product is effective against superficial scratches, washing scratches, and oxidation. Thanks to the content of natural carnauba wax, the product creates a high-gloss water-repellent surface and long-lasting protection against dirt.InstructionsWash and dry the car.Shake before use.Do not apply if paintwork is hot to the touch. Apply the wax using a clean, soft, dry cloth or soft sponge. Apply a thin coat to the paintwork in circular motions.Allow to dry for approx. 5 minutes.Polish the paintwork using a clean, dry microfibre cloth until shiny. If it is difficult to polish off the product, apply a new coat and polish immediately.NOTE: Do not use in sunlight or on hot paintwork. Do not use on matte paintwork.EUH208 Contains reaction mass of 5-chloro-2-methyl-2H-isothiazol-3-one and 2-methyl-2H-isothiazol-3-one (3:1). May produce an allergic reaction.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-1011_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1619, 'Polishing wax with paint, black, 500 ml', 34, 64.9, 'This is a carnauba polishing wax containing paint that fills superficial scratches and wash scratches, polishes, and gives paintwork a high-gloss finish. Thanks to the content of natural carnauba wax, the product creates a high-gloss water-repellent surface and long-lasting protection against dirt.InstructionsWash and dry the car.Shake before use.Do not apply if paintwork is hot to the touch. Apply the product using a clean, soft, dry cloth or soft sponge. Apply a thin coat to the paintwork in circular motions.Allow to dry for approx. 5 minutes.Polish the paintwork using a clean, dry microfibre cloth until shiny. If it is difficult to polish off the product, apply a new coat and polish immediately.NOTE: Do not use in sunlight or on hot paintwork. Do not use on matte paintwork.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-1008_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1620, 'Metal polish, 100 g', 40, 46.9, 'Polish that makes your car, motorbike or boat shine. After the treatment a sustainable, glossy surface is created, which withstands dirt and rust. Suitable on, for example, chrome, brass, tin, copper, silver, stainless steel and acrylic plastic.NOTE! Should not be used on chromed plastic, anodized aluminium or untreated metal alloy wheel rims.WarningH317 May cause an allergic skin reaction.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-47_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1621, 'Wax polish, 500 ml', 15, 59.9, 'Cleans and polishes at the same time. Leaves a high-gloss finish with lasting protection against wind and road dirt. Contains silicone.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-618_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1622, 'Chrome polish, 500 ml', 22, 79.9, 'Chrome polish restores the shine and lustre of most metals, such as a chrome, stainless steel, brass, nickel, copper, aluminium and alloys.Instructions:Shake the bottle well and apply the polish with a damp cloth.Polish in with a clean cloth.Store in a cool area.Guard against frost.EUH208 Contains .?. May produce an allergic reaction.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-628_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1623, 'Scratch remover, 150 g', 40, 94.9, 'Scratch remover with improved formula that helps to repair fine, superficial scratches and marks on most types of painted surfaces. No hard rubbing necessary. Comes in an easy-to-use tube.WarningH317 May cause an allergic skin reaction.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 11, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-645_xl_1.jpg');
