INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1639, 'AdBlue®, 10 liter', 11, 99.9, 'Dieseludstødningsvæske til brug for dieselmotorer med SCR-teknologi, og i overensstemmelse med anvisningerne i instruktionsbogen. Bruges til at overholde den europæiske emissionsnorm Euro 6. Brug den medfølgende hældetud til sikker påfyldning. AdBlue® er relativt harmløst for mennesker og dyr, det er hverken giftigt eller brandfarligt.AdBlue® opfylder kravene i ISO 22241-1.Ren 32,5% urea-formel, demineraliseret vand.AdBlue skal opbevares i kølige, tørre og godt ventilerede rum i temperaturområdet: -11,5 – +30 ºC. Ved temperaturer under -11,5 °C er der risiko for krystallisation. Udsæt ikke produktet for sollys. Manglende overholdelse af ovenstående regler kan medføre ændringer i produktets kvalitet.Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-5113_xl_1.jpg');
