INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1645, 'Petrol additive, 200 ml', 22, 69.9, 'For all petrol and ethanol engines. Cleans carburettors, injectors and fuel lines. Provides better fuel economy. Makes cold starting easier. Sufficient for around 70 litres of fuel.DangerRepeated exposure may cause skin dryness or cracking.Contains Etylendiamin.  May produce an allergic reaction.May be fatal if swallowed and enters airways.Very toxic to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-674_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1646, 'Diesel particulate filter cleaner, 200 ml', 21, 89.9, 'Affordable and effective cleaner for clogged diesel particulate filters. Optimal for frequent city driving. Can also be used preventively. The soot is burned off during driving by means of a fuel tank catalyst that lowers the ignition temperature of the soot. Regular use provides better combustion and prevents stoppage and engine alerts.PropertiesStarts cleaning at approx. 250 °C instead of at 400 °CExcellent stability under all driving conditionsTolerates fuels with high sulphur contentDoes not affect paraffin wax build-up in cold weatherEconomically advantageousCleans injectors to reduce future soot build-up in the filterThe filter''s indicator lamp turns off after successful cleaningInstructions:Add the contents of a 200 ml can to approx. 50 L of diesel fuel for instant cleaning. Use one can per full tank every 5,000 km for preventive treatment.DangerEUH066 Repeated exposure may cause skin dryness or cracking.EUH208 Contains Maleic anhydride. May produce an allergic reaction.H304 May be fatal if swallowed and enters airways.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-007_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1647, 'Diesel Additive, 500 ml', 35, 169.0, 'Effective additive that cleans the combustion system, injectors and valves, protects against oxidation and corrosion and eliminates condensation water and bacterial growth. In addition, it optimises the combustion value and atomises fuel molecules for optimal oxygenation and combustion. Engine performance increases and fuel consumption decreases. Can be used for all diesel engines with and without EGR, particulate filter (DPF), catalytic converter and selective catalytic reduction (SCR).Dosage: Normal use: 50 ml to 50 litres diesel. Emergency cleaning: 200 ml to 50 litres diesel.Areas of use: All diesel engines with and without EGR, particulate filter (DPF), catalytic converter and selective catalytic reduction (SCR).DangerEUH044 Risk of explosion if heated under confinement.EUH066 Repeated exposure may cause skin dryness or cracking.H304 May be fatal if swallowed and enters airways.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-009_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1648, 'Petrol/E85 additive, 500 ml', 26, 169.0, 'Effective additive that cleans injectors and valves, protects against oxidation and corrosion and eliminates condensation water. In addition, it optimises the combustion value and atomises fuel molecules for optimal oxygenation and combustion. Engine performance increases and fuel consumption decreases.Dosage: Normal use: 50 ml oil to 50 litres petrol/ethanol. Emergency cleaning: 200 ml to50 litres petrol/ethanol. Racing engines with ethanol: 75-100 ml to 50 litres of water.(no risk of overdosage)DangerH304 May be fatal if swallowed and enters airways.H315 Causes skin irritation.H336 May cause drowsiness or dizziness.H373 May cause damage to organs through prolonged or repeated exposureH411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-008_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1649, 'Lead cubstitute, 355 ml', 10, 54.9, 'Additive for cars requiring leaded petrol. Lubricates and protects, and reduces deposits on valve seats, intake valves, intake ducts, and injector nozzles. Sufficient for around 80 l petrol.DangerMay be fatal if swallowed and enters airways.Causes skin irritation.Causes serious eye damage.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-641_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1650, 'Fuel Stabiliser, 500 ml', 11, 169.0, 'Can be used for all types of fuels.Stabilises the fuel during storage.Prevents degradation and oxidation in the system during storage.Effectively cleans deposits, oxides and soot.Lubricates the entire fuel system.Excellent corrosion protection from moisture and ethanol fuels.Prevents deposit build-up.Eliminates condensation water which prevents icing.Reduces emissions and flue gases.Does not damage catalytic converters and particulate filters.Also an excellent lead substitute in gasoline.Dosage:Stabilisation during storage: 250 ml to 60 litres fuel.Emergency cleaning: 250 ml to 60 litres fuel.Maintenance cleaning: 125 ml to 60 litres fuel at every 4th top up prevents and eliminates malfunctions.Lead replacement: 50 ml to 50 litres fuel.DangerEUH066 Repeated exposure may cause skin dryness or cracking.H304 May be fatal if swallowed and enters airways.H336 May cause drowsiness or dizziness.H411 Toxic to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-010_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1651, 'Brake fluid DOT 4, 1 litre', 29, 59.9, 'Glycol based. For drum and disc brake systems that require non-petroleum brake fluid. Suitable for taxing conditions owing to high wet and dry boiling points (170/270° C). Good lubricating properties for rubber and metal.Specifications: SAE J 1703, SAE J 1704, FMVSS 116. Can be mixed with other brake fluid with the same specifications.WarningH319 Causes serious eye irritation.H361fd Suspected of damaging fertility. Suspected of damaging the unborn child', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-01_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1652, 'Brake fluid DOT 5.1, 1 litre', 22, 159.0, 'Racing brake fluid for cars/motorcycles meeting the following specifications: US FMVSS 116 DOT 5.1. Temperature stable with low viscosity at low temperatures. Brake Fluid DOT 5.1 is a glycol-based fluid with a high boiling point (not silicone-based). Takes up very little moisture. Gentle on rubber parts in brake systems and provides good corrosion-resistance. Also recommended for ABS systems. Can be mixed with other DOT 3, DOT 4 and DOT 5.1 approved fluids.Conforms to the following specifications:US FMVSS 116 DOT 5.1, DOT 4, DOT 3SAE J 1704ISO 4925 (Klass 3, 4 och 5.1)WarningH361fd Suspected of damaging fertility. Suspected of damaging the unborn child', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-03_xl_1.jpg');
