INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1658, 'Glycol, Long-life, concentrated, 3 kg', 32, 79.9, 'Longlife Glycol Antifreeze provides excellent protection against frost, corrosion, and overheating in all modern engines, especially in turbocharged aluminium engines. Effectively protects the entire cooling system and its critical components from corrosion and deposits.Protects against corrosion for up to 240,000 km or 5 years. Always follow the engine manufacturer''s recommendations when replacing coolant. Do not mix with propylene glycol. The product is red in colour.Specifications:Compliant with OEM standard: Audi / WV TL-774 D/F (G12/G12+), DAF 74002, Ford WSS-M97B44-D, General Motors GM 6277M, MAN 324 SNF, Mercedes-Benz MB 325.3, Renault 41-01-001, Renault Trucks, Volvo VCS.WarningH302 Harmful if swallowed.H373 May cause damage to organs through prolonged or repeated exposure', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0601_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1659, 'Glycol, concentrated, 12 kg', 17, 279.0, 'Ethylene-based glycol coolant designed for use with most petrol and diesel engines on the market. Provides excellent protection against frost and corrosion in cooling systems with a mixing ratio from 33-50% glycol in clean water (volume). 50 percent dilution provides frost protection to approx. -36 °C. Protects against corrosion for up to 140,000 km or 3 years. Note that higher ratios significantly impair the antifreeze properties. Always follow the engine manufacturer’s recommendations when replacing coolant. Must not be mixed with propylene glycol. The product is blue in colour.Specification:Comply with the following specifications: AFNOR NF R15-601, AS 2108, ASTM D3306, ASTM D4656, BS 6580: 2010, CUNA NC 956-16, SAE J 1034, UNE 26361-88.WarningH302 Harmful if swallowed.H373 May cause damage to organs through prolonged or repeated exposure', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0607_xl_1.jpg');
