INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1675, 'Glycol, 3 kg', 40, 119.0, 'High-quality non-toxic propylene glycol for frost protection in boat engines. The glycol is based on monopropylene glycol, corrosion inhibitors, and other performance enhancers. At higher concentrations, propylene glycol offers higher boiling points to achieve an optimal engine temperature and lower freezing points for applications with below-zero ambient temperatures. Recommended for all-year-round use. Must not be mixed with ethylene glycol.The product contains multi-metal corrosion inhibitors that provide the engine with excellent protection against rust and corrosionThe product is free from 2-ethylhexanoic acid and its saltsProtects against freezing, overheating, and cavitationExtends service lifeFree from MEG (monoethylene glycol)Boiling point: 188 °C (concentrated)Freezing point: -13 °C (concentrated)Colour: GreenWarningH302 Harmful if swallowed.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1696_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1676, 'Glycol, 12 kg', 26, 399.0, 'High-quality non-toxic propylene glycol for frost protection in boat engines. The glycol is based on monopropylene glycol, corrosion inhibitors, and other performance enhancers. At higher concentrations, propylene glycol offers higher boiling points to achieve an optimal engine temperature and lower freezing points for applications with below-zero ambient temperatures. Recommended for all-year-round use. Must not be mixed with ethylene glycol.The product contains multi-metal corrosion inhibitors that provide the engine with excellent protection against rust and corrosionThe product is free from 2-ethylhexanoic acid and its saltsProtects against freezing, overheating, and cavitationExtends service lifeFree from MEG (monoethylene glycol)Boiling point: 188 °C (concentrated)Freezing point: -13 °C (concentrated)Colour: GreenWarningH302 Harmful if swallowed.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1696_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1677, 'Glycol, ready-mixed, 1 kg', 5, 24.9, 'Ethylene-based coolant system glycol (ready-mixed) designed for use with most petrol and diesel engines on the market. Provides a very effective protection against frost and corrosion. Ready-mixed. Protects against frost down to -36 °C. Protects against corrosion for up to 140,000 km or 3 years.NOTE: May not be further diluted. Always follow the engine manufacturer’s recommendations when replacing coolant. Must not be mixed with propylene glycol. The product is blue in colour.Specification:Comply with the following specifications: AFNOR NF R15-601, AS 2108, ASTM D3306, ASTM D4656, BS 6580: 2010, CUNA NC 956-16, SAE J 1034, UNE 26361-88.WarningH302 Harmful if swallowed.H373 May cause damage to organs through prolonged or repeated exposure', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0608_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1678, 'Universal Antifreeze, pre-mixed, 3 kg', 25, 69.9, 'An ethylene-based antifreeze for top filling in petrol and diesel engines. Provides very effective protection against frost, corrosion and overheating. Protects against corrosion for up to 240,000 km or 5 years. Can be mixed with other ethylene glycol-based coolant fluids. Pre-mixed, -36 °C. Colour: transparent.Specifications:Compliant with OEM standard: Audi / WV TL-774 D/F (G12/G12+), DAF 74002, Ford WSS-M97B44-D, General Motors GM 6277M, MAN 324 SNF, Mercedes-Benz MB 325.3, Renault 41-01-001, Renault Trucks, Volvo VCS.WarningH302 Harmful if swallowed.H373 May cause damage to organs through prolonged or repeated exposure', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0617_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1679, 'Glycol, concentrated, 1 kg', 36, 36.9, 'Ethylene-based glycol coolant designed for use with most petrol and diesel engines on the market. Provides excellent protection against frost and corrosion in cooling systems with a mixing ratio from 33-50% glycol in clean water (volume). 50 percent dilution provides frost protection to approx. -36 °C. Protects against corrosion for up to 140,000 km or 3 years. Note that higher ratios significantly impair the antifreeze properties. Always follow the engine manufacturer’s recommendations when replacing coolant. Must not be mixed with propylene glycol. The product is blue in colour.Specification:Comply with the following specifications: AFNOR NF R15-601, AS 2108, ASTM D3306, ASTM D4656, BS 6580: 2010, CUNA NC 956-16, SAE J 1034, UNE 26361-88.WarningH302 Harmful if swallowed.H373 May cause damage to organs through prolonged or repeated exposure', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-0605_xl_1.jpg');
