INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1689, 'Carburettor protection, 500 ml', 25, 36.9, 'Petrol additive for year-round use. Prevents icing. Clears condensation. 500 ml is sufficient for around 50 litres of petrol.DangerH225 Highly flammable liquid and vapour.H319 Causes serious eye irritation.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1114_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1690, 'Ceramic oil additive, 300 ml', 35, 129.0, 'Ceramic motor treatment for petrol and diesel engines without wet clutch that reduces friction and improves wear protection. The oil additive can be used for all mineral and synthetic motor oils. Optimises lubrication, reduces engine noise, and optimises fuel consumption and exhaust emissions. 300 ml is enough for 4–6 l of motor oil.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-204_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1691, 'Engine stop leak, 300 ml', 5, 89.9, 'A highly effective additive that reduces engine oil leakage, improves operational reliability, increases engine performance and reduces wear. Keeps engine gaskets soft and maintains sealing function. Suitable for all mineral oils and synthetic motor oils.Instructions: Check motor oil level before pouring in the additive. We recommend cleaning the oil system with engine cleaner before using the product. Pour the additive into the motor oil. The additive is activated when the engine is running.Dosage: Enough for 5 litres of motor oil. For larger volumes, add 50 ml of the product per litre of motor oil.DangerEUH066 Repeated exposure may cause skin dryness or cracking.H304 May be fatal if swallowed and enters airways.', '2023-05-15 15:12:27', 12, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000045077/4');
