INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1763, 'Bicycle Rack for Tow Bars', 36, 2599.0, 'Stable, multi-angle bicycle rack with space for 3 bicycles. Can be easily mounted to a 50 mm tow ball and 13-pin connector. Bicycles are secured to the rack and the rack can be attached to the tow bar (lock included). Can be equipped with a temporary registration plate as per country-specific regulations. Conforms to standard DIN 75302. E-certified lighting.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-297_xl_1.jpg');
