INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1766, 'Bicycle Repair Stand', 19, 629.0, 'Steel. With strong rubberised lifting arm that attaches around the bicycle frame. The fixation point is easy to attach and the cycle sits steadily. The arm can be rotated 360°, which makes it easy to access for most types of service and repair jobs. The stand is collapsible for easy storage.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/27-276_xl_1.jpg');
