INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1767, 'Bicycle Rack Light Bar', 6, 159.0, 'Fully equipped light bar with lamps and reflectors for use when the vehicle’s number plate is obstructed by a bicycle/bicycle rack. The lamps and reflectors are E-marked. Supplied with a 1 m cable with 7-pole trailer connector and 2 ratchet straps for mounting. Bulbs included.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-269_xl_1.jpg');
