INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1769, 'Bicycle holder for roof rack', 40, 189.0, 'With double-sided bracket that connects to the bicycle frame. Made of epoxy-coated steel.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-233_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1770, 'Frame adapter cycle', 36, 99.9, 'ame adapter in steel profile, coated with PVC plastic. Mounted between the head lug and saddle post on ladies, BMX cycles and other types of cycles with non-standard frame constructions in order for them to be hung and transported on rear-mounted cycle holders of a scissor-type. Telescopic model, 62/81 cm. . For bicycles with a max. weight of 20 kg.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-259_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1771, 'Bicycle Rack, aluminium', 15, 399.0, 'Lightweight and practical aluminium bicycle rack for upright transport of various bicycle types and sizes. Easily attaches to car roof racks. The bicycle is secured with a lockable and rotatable bracket that clamps around the bicycle frame. Fits most frames.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-210_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1772, 'Bicycle Rack Bracket', 14, 159.0, 'Beam with fitted 50 mm tow ball. Attaches with two fasteners to e.g. a caravan tow hitch. Supplied complete with fittings.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-250_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1773, 'Electric hoist EH800, 400 kg', 12, 1699.0, 'Handy electric hoist for intermittent lifting in garages, workshops or warehouses. The hoist is equipped with upper and lower limit position, motor overheating protection, emergency stop button on the hanging control unit, and electromagnetic brake.A separate pulley is included which provides leverage and can be used to double the lifting capacity to 400 kg. The lifting speed and height are halved when the lifting pulley is used. The hoist must be mounted to a suitable crossbeam with the included brackets.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-359_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1774, 'Electric Winch, 12 V, 907 kg', 9, 699.0, 'Electric winch for mounting to ATVs, etc. Electric-powered winding up and out. Planetary gear and detachable wire drum. With heavy-duty hook and wire control with 4 rollers. Powered by a 12 V automotive battery. The winch must not be used for vertical lifting. Mounting fittings supplied.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-510_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1775, 'Electric Winch, 12 V, 5448 kg', 35, 3699.0, 'Electric winch for mounting to ATVs, etc. Electric-powered winding up and out. Planetary gear and detachable wire drum. With heavy-duty hook and wire control with 4 rollers. Powered by a 12 V automotive battery. The winch must not be used for vertical lifting. Mounting fittings supplied.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000042503/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1776, 'Electric hoist EH400, 200 kg', 14, 1099.0, 'Handy electric hoist for intermittent lifting in garages, workshops or warehouses. The hoist is equipped with upper and lower limit position, motor overheating protection, emergency stop button on the hanging control unit, and electromagnetic brake.A separate pulley is included which provides leverage and can be used to double the lifting capacity to 400 kg. The lifting speed and height are halved when the lifting pulley is used. The hoist must be mounted to a suitable crossbeam with the included brackets.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-359_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1777, 'Electric Winch, 12 V, 1135 kg', 7, 1299.0, 'Electric winch for mounting to ATVs, etc. Electric-powered winding up and out. Planetary gear and detachable wire drum. With heavy-duty hook and wire control with 4 rollers. Powered by a 12 V automotive battery. The winch must not be used for vertical lifting. Mounting fittings supplied.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-511_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1778, 'Portable Electric Winch', 38, 1699.0, 'Electric winch for permanent mounting to vehicles/trailers or temporary mounting to tow hooks. The winch has motor-powered winding up and out, planetary gear and detachable wire drum.  Powered by a 12 V automotive battery. Strong hook, remote control, and mounting fittings supplied.NOTE! The winch must not be used for vertical lifting.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-512_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1779, 'Synthetic Rope, 15 m', 6, 329.0, 'Long synthetic rope for winches. SaferWinch cable is safer than steel cable if broken and more flexible.With spliced eye for hook attachment.NOTE! The rope should be used with a winch stopper, which will prevent the cable guide from becoming damaged if the hook is reeled in too far. Make sure there is no damage to the winch cable guide before switching to synthetic rope.NOTE! Not designed for vertical lifting.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-388_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1780, 'Winch Hook, 5000 kg', 23, 44.9, 'Powerful winch hook in heat-treated carbon steel with zinc plating. Hook with 15 mm hook opening, 9 mm fork opening and pin with the diameter of 10 mm .NOTE! Not for vertical lifting.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-3577_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1781, 'Winch Stopper', 38, 24.9, 'Prevents the hook from being pulled into the winch. Can be opened for quick fitting on attached cable.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-389_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1782, 'Electrical Cable Set 7-pole', 40, 84.9, 'With 7-pole plug socket, 7-wire cables, rubber seals and fittings. Universal version that fits most car models.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-981_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1783, 'Cable set with electronics box', 25, 949.0, 'Universal electrical cable set with electronics box and 7-pin socket. Used when repairing or retrofitting a towbar.All power to the trailer is fed through the electronics modules. The car is not affected by the trailer and thereby no error messages are generated caused by faulty loads on the electrical system. In the event of a short-circuit on the trailer, the car is protected by a fuse to the electronics module.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-970_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1784, 'Roofrack for roof rails', 1, 229.0, 'Universal model. For vehicles with factory-fitted, high profile roof racks (max. width 1150 mm). Quick and easy mounting thanks to adjustable clamp fasteners. Plastic-coated square-profile tubing (30 x 20 x 1350 mm). Lockable, fully-covering plastic caps. Sold in pairs.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-236_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1785, 'Roof rack, universal', 14, 279.0, 'Universal roof rack for cars with no roof rails or drip channels. Placed on the roof and tightened between the door frames. Adjustable, for roof widths up to 1210 mm. Sturdy plastic feet and plastic-coated square-profile tubing (30 x 20 x 1210 mm). Only suitable for 4-door cars. Sold in pairs.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-227_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1786, 'Roofrack', 31, 219.0, 'For most cars fitted with a drip channel. Epoxy-painted feet and plastic-coated square-profile tubing (30 x 20 x 1210 mm). Adjustable, for roof widths up to 1300 mm Max load: 50 kg per pair. Reference dimensions: Volvo 740 is 1280 mm wide. Supplied in pairs.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-234_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1787, 'Kayak/Canoe Rack', 27, 419.0, 'For mounting to roof racks with a square profile. Fits most kayak/canoe types and shapes thanks to the adjustable cradle angle and width. Also perfect for transporting windsurfing boards. Max load: 45 kg. Including 4 complete supports (incl. rack fittings) and 2 lashing straps.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-229_xl_1.jpg');
