INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1806, 'Quick Tensioners, 2-pack', 23, 89.9, 'For safe lashing of loads. The tensioning straps are made from highly durable and UV-stable nylon straps with sturdy anchorage hooks and rubber-coated quick-lock.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-277_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1807, 'Ratchet Rope, 2-pack', 16, 84.9, 'Useful device for tying down, hanging or hoisting objects. Also suitable for securing e.g. tarps and tents. Two carabiners and a ratchet make it easy to tighten the rope.Automatic locking.Locks directly. No sliding or slacking.Easy to use with many areas of use, such as hanging up unwieldy objects.Withstands heat and cold.MaterialRope: braided polyesterCarabiner: rubber-coated steelRatchet mechanism: die-cast zinc with fibreglass-reinforced housing.Instructions:TIE DOWNAttach the free hook to a fixed device.Wrap the rope around the object. Attach the hook with the ratchet to a fixed device and tighten the rope.To loosen, push in the lever.HOISTAttach one hook to a fixed object or around e.g. a beam.Attach the other hook to the object to be hoisted.Tighten the rope with the ratchet.To loosen, push in the lever. First make sure that no persons are in the area underneath the object.NOTE!  Ascertain the weight of the object before lifting. Never exceed the maximum load.Always inspect the ratchet rope before each use. Do not place the ratchet rope close to sharp edges, prevent the rope from being pinched or abraded and avoid hot surfaces.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-214_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1808, 'Lashing Straps Kit, 10 parts', 38, 179.0, 'Practical case with two ratchet straps, two tension straps and six luggage straps of various lengths. 10 parts in all.Ratchet straps:25 mm x 5 m. Tensile strength 350 kg, lashing capacity 700 kg.Tension straps:25 mm x 3.5 m. Tensile strength 100 kg, lashing capacity 200 kg.Luggage straps:2 pcs. 40 cm, 2 pcs. 60 cm and 2 pcs. 80 cm elastic straps with hooks and eyelets on opposite ends. Tensile strength 30 kg, lashing capacity 60 kg.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/38-782_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1809, 'Elastic Ratchet Strap', 25, 129.0, 'For quick and safe tie-down of loads on roof racks, trailers, trucks, boat trailers, etc. The strap being elastic reduces the risk of the hooks jumping off due to vibrations. Two-part with polyester strap, heavy-duty J-hooks, D-rings, and ratchet.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-262_xl_1.jpg');
