INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1814, 'Roof Box, 320 l, black', 14, 1799.0, 'Opens from the right-hand side. Central locking with key (3 locking points). The aerodynamic design provides good stability and low drag. Made from impact-resistant and cold-resistant ABS/PMMA.City Crash-tested according to standard DIN 75302. Temperature range -35 °C to +70 °C. Fits most roof racks.NOTE! Items in the box must be tied down with lashing straps.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-309_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1815, 'Roof box, 400 l, gloss black', 20, 2499.0, 'The roof box opens from both sides. For increased safety, it is reinforced with metal rails on the underside and along the front. Central locking with key (2 locking points). The aerodynamic design provides good stability and low drag.  Made from impact-resistant and cold-resistant ABS/PMMA. Withstands temperatures between -35 °C and + 70 °C. Fits most roof racks.City Crash-tested according to standard DIN 75302.NOTE! Items in the box must be tied down with lashing straps.NOTE! The key can only be removed from the lock if the roof box is properly locked. Check all locking points on the roof box before travel.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-315_xl_1.jpg');
