INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1821, 'Trailer cable 13-13', 5, 219.0, 'Coiled cable for trailers with 13-pin connector at both ends. The cable only has 8 coated pins.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-999_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1822, 'Trailer adapter, 13-7', 35, 179.0, 'For electrical coupling on trailers with LED lights. With built-in power resistor for compatibility with cars with CANBUS light control. Connects vehicles with 13-pin connectors to 7-pin trailer connectors.The adapter is designed to fix issues that may arise in trailers with LED reverse, indicator, or brake lights.The adapter emulates the properties of a bulb, thereby eliminating any problems. Even if an LED light (which consumes little power and/or illuminates at low voltage) is installed on the trailer, it will act and be perceived by the car as an incandescent bulb.Problems that can be solved using the adapter: The LED light on the trailer shines/flashes because the car is transmitting control signals to the trailer. The car indicates erroneous functional problems on the trailer because the car does not detect the low current consumed by the LED light.NOTE! When using the adapter, the car’s control functions of the reverse, indicator, or brake lights are overridden. If any of these lights stop working, the car will still perceive them as functional.NOTE! Not suitable for vehicles with pulse-controlled power systems.', '2023-05-15 15:12:27', 13, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-998_xl_1.jpg');
