INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1838, 'Mineral oil SAE 50 for vintage vehicles, 1 litre', 12, 34.9, 'For classic motorbikes and certain veteran vehicles where a straight oil must be used. The oil is viscous when cold - warm up the engine with care. Copes with very high temperatures. Suitable for engines with a separate oil tank which is placed higher than the crank housing (motorbikes), where the oil, thanks to the thicker viscosity, cannot so easily run through the oil pump down into the crank housing when the engine is not running. Not suitable for use in very low temperatures ( -10 °C and lower). Meets the following specifications: ACEA A2/B2, API SJ.Important information when changing engine oilAlways check the amount of engine oil your engine should have. The information can be found in the vehicle’s owner’s manual.When changing the oil, the oil filter should also be changed.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-5009_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1839, 'Mineral oil SAE 50 for vintage vehicles, 5 litre', 39, 189.0, 'For classic motorbikes and certain veteran vehicles where a straight oil must be used. The oil is viscous when cold - warm up the engine with care. Copes with very high temperatures. Suitable for engines with a separate oil tank which is placed higher than the crank housing (motorbikes), where the oil, thanks to the thicker viscosity, cannot so easily run through the oil pump down into the crank housing when the engine is not running. Not suitable for use in very low temperatures ( -10 °C and lower). Meets the following specifications: ACEA A2/B2, API SJ.Important information when changing engine oilAlways check the amount of engine oil your engine should have. The information can be found in the vehicle’s owner’s manual.When changing the oil, the oil filter should also be changed.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9023_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1840, 'Mineral oil for vintage cars SAE 50, 1 litre', 25, 69.9, 'For classic motorbikes and certain vintage vehicles which require a straight oil. The oil is viscous when cold (warm up the engine with care) and withstands very high temperatures.. Suitable for engines with a separate oil tank located higher than the crankcase (motorbikes), where the high viscosity of the oil prevents it from running through the oil pump down into the crankcase when the engine is not running. Not suitable for use in very low temperatures ( -10 °C and lower).Conforms to the following specifications: API SJ/CF, JASO MA/MB.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://www.caspianpolicy.org/no-image.png');
