INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1851, 'Fuldsyntetisk motorolie 10W–60 Racing, ACEA A3/B4, A3/B3, 4 liter', 8, 199.0, 'Fuldsyntetisk højtydende motorolie udviklet til 4-taktsmotorer, der arbejder under ekstremt hårde væddeløbsforhold. Det giver optimal smøring selv ved de højeste motoromdrejninger og temperaturer, giver maksimal motoreffekt og beskytter mod slid. Forhindrer dannelse af sort slam og sikrer, at motoren forbliver ren.Opfylder følgende specifikationer:ACEA A3/B4, A3/B3API SNFiat 9.55535-H3Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-853_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1852, 'Helsyntetisk motorolie 10W–60, 4 liter', 30, 199.0, 'En avanceret olie til moderne motorer med høj ydelse og motorer, som udsættes for hård kørsel. Oliens store viskositetsområde gør, at den ikke alene giver effektive koldstarter men også beskytter motoren ved stor belastning. Kan anvendes i mange forskellige situationer ved forskellige udendørstemperaturer, hastigheder og kørselsforhold. Velegnet til hverdagskørsel såvel som til racing. Er med til at mindske olieforbruget.Opfylder følgende specifikationer: API SL, ACEA A3/B3, A3/B4.Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Forårsager alvorlig øjenirritation. Indeholder C14-16-18 ALKYL PHENOL. Kan udløse allergisk reaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Vask forurenet hud grundigt efter brug. Bær beskyttelseshandsker/beskyttelsestøj/øjenbeskyttelse/ansigtsbeskyttelse. VED KONTAKT MED ØJNENE: Skyl forsigtigt med vand i flere minutter. Fjern eventuelle kontaktlinser, hvis dette kan gøres let. Fortsæt skylning. Ved vedvarende øjenirritation: Søg lægehjælp. Indholdet/beholderen bortskaffes i overensstemmelse med nationale regler.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-6774_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1853, 'Fuldsyntetisk motorolie 10W–60 Racing, ACEA A3/B4, A3/B3, 1 liter', 39, 59.9, 'Fuldsyntetisk højtydende motorolie udviklet til 4-taktsmotorer, der arbejder under ekstremt hårde væddeløbsforhold. Det giver optimal smøring selv ved de højeste motoromdrejninger og temperaturer, giver maksimal motoreffekt og beskytter mod slid. Forhindrer dannelse af sort slam og sikrer, at motoren forbliver ren.Opfylder følgende specifikationer:ACEA A3/B4, A3/B3API SNFiat 9.55535-H3Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-852_xl_1.jpg');
