INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1868, 'Helsyntetisk motorolie 5W–40, 1 liter', 16, 59.9, 'Helsyntetisk motorolie af lavfriktionstype der reducerer brændstofforbruget. Anbefales til 4-taktsmotorer, benzin eller diesel, der bruges i såvel koldt som i varmt klima.Har særdeles gode lavtemperaturegenskaber, der sikrer smøringen ved koldstart i ekstrem kulde.Den syntetiske basisolie giver lang levetid og er derfor velegnet til køretøjer, der køres hårdt og med lange olieskiftsintervaller.Anbefales til nye og ældre personbiler og mindre varevogne med eller uden turbo.Kan blandes med andre motorolier.Opfylder følgende specifikationer: ACEA A3/B3,A3/B4, API SN, MB 229.3, VW 502.00,505,00.Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Indeholder MOLYBDENUM POLYSULPHIDE LONG CHAIN ALKYL DITHIOCARBAMIDE COMPLEX Kan udløse allergisk reaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Indholdet/beholderen bortskaffes i overensstemmelse med nationale regler.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-909_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1869, 'Fuldsyntetisk motorolie 5W-30, ACEA C2, C3, A3/B4, 4 liter', 29, 199.0, 'En fuldsyntetisk motorolie med egenskaber, der er optimeret til krævende skandinaviske kørselsforhold. Den er udviklet til at forlænge levetiden af krævende partikelfiltre og reducere udstødningsemissionerne. Olien giver effektiv rengøring af motoren også ved lange olieskiftintervaller, og syntetiske basisolier af høj kvalitet reducerer olieforbruget.Højtydende olie til moderne motorer.Fremragende egenskaber, der holder motoren ren, hvilket øger motorens ydeevne.Bidrager til at reducere emissionerne ved at forlænge partikelfilterets levetid.Afbalancerede viskositetsegenskaber forbedrer brændstoføkonomien.Stabil smørefilm beskytter motoren også ved høje temperaturer.Opfylder følgende specifikationer:ACEA C2, C3ACEA A3/B4API SNMB 229.31, 229.51VW 504.00, 507.00Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-863_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2308, 'Halogen bulb H1, 24 V, 70 W, 1-pack', 4, 44.9, 'Halogen bulb for fog, full or dipped beam truck lights at an affordable price. Conforms to ECE R37 and therefore approved for road traffic. 24 V. Sold individually.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-45_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (2309, 'H1 12V 55W STANDARD ECE R37', 2, 29.9, 'Standard bulbs for full, fog, or dipped beam vehicle lamps at an affordable price. The bulbs conform to ECE R37 and are therefore approved for road traffic. Sold individually.H1', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/35-01_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1870, 'Fuldsyntetisk motorolie 5W-30, ACEA A1/B1, A5/B5, 4 liter', 38, 199.0, 'En fuldsyntetisk motorolie med egenskaber, der er optimeret til krævende skandinaviske kørselsforhold. En brændstofeffektiv og energibesparende olie udviklet specielt til motorer fremstillet af Ford. Den er også velegnet til brug i motorer fra mange andre producenter, der kræver brug af ACEA A1 / B1 eller A5 / B5 type SAE 5W-30 motorolie.Effektiv beskyttelse mod motorslid.Holder motoren ren for slam og forurenende stoffer.Olien bevarer sin flydeevne selv under ekstreme vinterforhold.Friktionsreducerende funktioner bidrager til at reducere brændstofforbruget.Opfylder følgende specifikationer:ACEA A1/B1, A5/B5API SL/CFFord M2C913-A, M2C913-B, M2C913-C, M2C913-DRenault RN 0700Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-865_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1871, 'Fuldsyntetisk motorolie 5W-30, ACEA C2, C3, 4 liter', 20, 199.0, 'En fuldsyntetisk, højtydende motorolie, udviklet til moderne benzin- og dieselmotorer med partikelfilter. Mid-SAPS-Level-olie har lavt indhold af sulfateret aske, fosfor og svovl, hvilket giver lang holdbarhed for partikelfilteret.Fremragende koldtflydende egenskaber sikrer hurtig smøring af hele motoren og reducerer slid, især i opvarmningsfasen.Kan bruges i mange nyere personbiler, benzin- og dieselmotorer med DPF, især til BMW, Mercedes Benz, Opel. Anbefales til brug i motorer der drives med LPG (flaskegas), der kræver Mid-SAPS motorolier.Opfylder følgende specifikationer:ACEA C2, C3API SN/CFGM dexos2MB 226.5MB 229.31MB 229.51, 229.52Renault RN 0700, RN 0710BMW LL-04Fiat 9.55535-S3PSA B71 2290Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-884_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1872, 'Fuldsyntetisk motorolie 5W-30, ACEA C2, A1/B1, A5/B5, 4 liter', 5, 199.0, 'En højtydende fuldsyntetisk motorolie, specielt udviklet til moderne Peugeot, Citroën, Honda og Toyota benzin- og dieselmotorer med partikelfiltre. Mid SAPS Level beskytter og giver lang holdbarhed af partikelfilteret. Olien giver maksimal brændstoføkonomi. Den har fremragende egenskaber ved lave temperaturer og garanterer hurtig smøring af hele motoren, hvilket reducerer slid, især i opvarmningsfasen.Opfylder følgende specifikationer:ACEA C2ACEA A1/B1, A5/B5API SN/CFFiat 9.55535-S1Iveco 18-1811 SC1PSA B71 2290Renault RN 0700Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-859_xl_1.jpg');
