INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1874, 'Fuldsyntetisk motorolie 5W-30, ACEA C4, 4 liter', 4, 199.0, 'En fuldsyntetisk motorolie med egenskaber, der er optimeret til skandinaviske kørselsforhold. Olien er primært udviklet til Nissan, Mitsubishi, Renault og Dacia motorer. Den er også velegnet til Mercedes-Benz motorer og andre mærker, der kræver ACEA C4-klasse motorolie.Kompatibel med den nyeste generation af udstødningsrenseudstyr.Giver god smøring selv ved længere olieskifteintervaller.Effektiv beskyttelse af motoren under alle forhold.Opfylder følgende specifikationer:ACEA C4Renault RN 0720MB 226,51, 229,51Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains C14-16-18 Alkyl phenol. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-869_xl_1.jpg');
