INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1881, 'Fuldsyntetisk motorolie 5W-30, ACEA C2, C3, 1 liter', 2, 59.9, 'En fuldsyntetisk, højtydende motorolie, udviklet til moderne benzin- og dieselmotorer med partikelfilter. Mid-SAPS-Level-olie har lavt indhold af sulfateret aske, fosfor og svovl, hvilket giver lang holdbarhed for partikelfilteret.Fremragende koldtflydende egenskaber sikrer hurtig smøring af hele motoren og reducerer slid, især i opvarmningsfasen.Kan bruges i mange nyere personbiler, benzin- og dieselmotorer med DPF, især til BMW, Mercedes Benz, Opel. Anbefales til brug i motorer der drives med LPG (flaskegas), der kræver Mid-SAPS motorolier.Opfylder følgende specifikationer:ACEA C2, C3API SN/CFGM dexos2MB 226.5MB 229.31MB 229.51, 229.52Renault RN 0700, RN 0710BMW LL-04Fiat 9.55535-S3PSA B71 2290Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-883_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1882, 'Fuldsyntetisk motorolie 5W-30, ACEA A1/B1, A5/B5, 1 liter', 19, 59.9, 'En fuldsyntetisk motorolie med egenskaber, der er optimeret til krævende skandinaviske kørselsforhold. En brændstofeffektiv og energibesparende olie udviklet specielt til motorer fremstillet af Ford. Den er også velegnet til brug i motorer fra mange andre producenter, der kræver brug af ACEA A1 / B1 eller A5 / B5 type SAE 5W-30 motorolie.Effektiv beskyttelse mod motorslid.Holder motoren ren for slam og forurenende stoffer.Olien bevarer sin flydeevne selv under ekstreme vinterforhold.Friktionsreducerende funktioner bidrager til at reducere brændstofforbruget.Opfylder følgende specifikationer: API SL/CF, ACEA A1/B1, A5/B5, Ford M2C913-A, M2C913-B, M2C913-C, M2C913-D, Renault RN 0700.ACEA A1/B1, A5/B5API SL/CFFord M2C913-A,M2C913-B,M2C913-C,M2C913-DRenault RN 0700Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-864_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1883, 'Fuldsyntetisk motorolie 5W-30, ACEA C4, 1 liter', 13, 59.9, 'En fuldsyntetisk motorolie med egenskaber, der er optimeret til skandinaviske kørselsforhold. Olien er primært udviklet til Nissan, Mitsubishi, Renault og Dacia motorer. Den er også velegnet til Mercedes-Benz motorer og andre mærker, der kræver ACEA C4-klasse motorolie.Kompatibel med den nyeste generation af udstødningsrenseudstyr.Giver god smøring selv ved længere olieskifteintervaller.Effektiv beskyttelse af motoren under alle forhold.Opfylder følgende specifikationer:ACEA C4Renault RN 0720MB 226,51, 229,51Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains C14-16-18 Alkyl phenol. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-868_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1884, 'Helsyntetisk motorolie 5W-30', 24, 59.9, 'Helsyntetisk motorolie af typen Low SAPS/low Ash. Bidrager til god brændstoføkonomi. Først og fremmest beregnet til diesel- og benzinmotorer, som opfylder euro IV og V med dieselpartikelfilter eller katalysator. Egnet til store intervaller mellem olieskift. Anbefales bl.a. til nyere motorer fra Toyota, Honda, Peugeot og Citroën. Opfylder også følgende specifikationer: ACEA C2/C3, API SP, PSA B71 2290, RN 0700/710, RN17, MB 229.31/229.51/229.52/226.52.Forårsager alvorlig øjenirritation. Indeholder CALCIUM LONG CHAIN ALKARYL SULFONATE, ALKYL (C18-C28) TOLUENESULFONIC ACID, CALCIUM SALTS, BORATED. Kan udløse allergisk reaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Vask forurenet hud grundigt efter brug. Bær beskyttelseshandsker/beskyttelsestøj/øjenbeskyttelse/ansigtsbeskyttelse. VED KONTAKT MED ØJNENE: Skyl forsigtigt med vand i flere minutter. Fjern eventuelle kontaktlinser, hvis dette kan gøres let. Fortsæt skylning. Ved vedvarende øjenirritation: Søg lægehjælp. Indholdet/beholderen bortskaffes i overensstemmelse med nationale regler.Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9001_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1885, 'Helsyntetisk motorolie 5W-30', 6, 59.9, 'Helsyntetisk motorolie udviklet først og fremmest til anvendelse i seneste generation af Ford motorer, inklusive Ford Zetec motorer, både benzin og diesel, samt Duratorq dieselmotorer. God adhæsion og dermed god beskyttelse mod slitage, hvilket forlænger motorens levetid. Beskytter motoren ved såvel koldstart som ved høje arbejdstemperaturer, samt giver en forbedret brændstoføkonomi og mindre udstødningsudledning.Opfylder følgende specifikationer: ACEA A5/B5, RN0700, Ford WSS-M2C913-D, STJLR.03.5003.Forårsager alvorlig øjenirritation. Indeholder C14-16-18 ALKYL PHENOL. Kan udløse allergisk reaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Vask hænder/udsatte områder grundigt efter brug. Bær beskyttelseshandsker/beskyttelsestøj/øjenbeskyttelse/ansigtsbeskyttelse. VED KONTAKT MED ØJNENE: Skyl forsigtigt med vand i flere minutter. Fjern eventuelle kontaktlinser, hvis dette kan gøres let. Fortsæt skylning. Ved vedvarende øjenirritation: Søg lægehjælp. Indholdet/beholderen bortskaffes i overensstemmelse med nationale regler.Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-913_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1886, 'Fuldsyntetisk motorolie 5W-20, ACEA C5, 4 liter', 22, 199.0, 'Fuldsyntetisk motorolie optimeret til skandinaviske kørselsforhold. Energibesparende olie specielt udviklet til Ford EcoBoost-motorer, der kræver brug af olie med tilsvarende viskositet og Ford M2C948-B-B. Den er også velegnet til brug i motorer fra mange andre producenter, der kræver brug af ACEA C5 eller API SN-type SAE 5W-20 motorolie.• Effektiv beskyttelse mod motorslid.• Friktionsreducerende funktioner bidrager til at reducere brændstofforbruget.• Holder motoren ren, samtidig med at den hjælper med at forbedre motorens ydeevne.Opfylder følgende specifikationer:ACEA C5API SN, SM, SLILSAC GF-5Ford M2C948-BSTJLR.03.5004Fiat 9.55535-CR1Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-855_xl_1.jpg');
