INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1896, 'Helsyntetisk motorolie 0W–40', 17, 69.9, 'En avanceret, helsyntetisk olie med beskyttelse mod motorslitage og aflejringer til den nyeste generation af benzin- og dieselmotorer.  Anbefales til Audi, BMW, Ford, Hyundai, Kia, Mercedes-Benz, SAAB, Volvo og Porsche.Opfylder følgende specifikationer: ACEA A3/B3, ACEA A3/B4, API SN, VW502.00/505.00.Kan forårsage allergisk hudreaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Undgå indånding af damp/spray. Bær beskyttelseshandsker/beskyttelsestøj/øjenbeskyttelse/ansigtsbeskyttelse. VED KONTAKT MED HUDEN: Vask med rigeligt vand. Ved hudirritation eller udslet: Søg lægehjælp. Alt tilsmudset tøj tages af. Og vaskes inden genanvendelse. Indholdet/beholderen bortskaffes i overensstemmelse med nationale regler. Indeholder: C14-16-18 ALKYL PHENOLVigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.WarningMay cause an allergic skin reaction.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9007_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1897, 'Fuldsyntetisk motorolie 0W-30, ACEA C2, 4 liter', 19, 269.0, 'En fuldsyntetisk, højtydende motorolie, udviklet til moderne benzin- og dieselmotorer med partikelfilter. Mid-SAPS-Level-olie har lavt indhold af sulfateret aske, fosfor og svovl, hvilket giver lang holdbarhed for partikelfilteret.Fremragende koldtflydende egenskaber sikrer hurtig smøring af hele motoren og reducerer slid, især i opvarmningsfasen.Velegnet til nuværende Peugeot, Citroën, Honda og Toyota benzin- og dieselmotorer med partikelfiltre.Opfylder følgende specifikationer:ACEA C2PSA B71 2312Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-849_xl_1.jpg');
