INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1903, 'Fuldsyntetisk motorolie 0W-20, ACEA C5, 4 liter', 20, 179.0, 'Fuldsyntetisk  olie med egenskaber optimeret til skandinaviske kørselsforhold og udviklet til motorer, der kræver olie med lav viskositet. Typiske anvendelser er benzin- og dieselmotorer fremstillet af Volvo siden 2014 samt nogle Toyota-modeller.Udviklet til Volvos benzin- og dieselmotorer fremstillet efter 2014.Også velegnet til motorer konstrueret til olie med viskositet 0W-20, såsom nogle Toyota modeller og hybridbiler.Reducerer motorens interne tab, bidrager til at forbedre brændstoføkonomien og reducere CO-emissionerne.Effektiv beskyttelse mod motorslid.Opfylder følgende specifikationer:ACEA C5API SN, SLILSAC GF-5Volvo VCC RBS0-2AEVigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-841_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1904, 'Fuldsyntetisk motorolie 0W-20, ACEA C5, 4 liter', 25, 279.0, 'En avanceret, fuldsyntetisk low-ash motorolie specielt udviklet til de nyeste generationer af benzin- og dieselmotorer. Den innovative additivpakke i kombination med udvalgte syntetiske olier sikrer den bedste kvalitet og ydeevne i hele serviceintervallet. Anbefales til brug i benzinmotorer både med og uden turbolader i personbiler og lette lastbiler.Egenskaber:Viskositetsklassen SAE 0W-20 garanterer optimal brændstofbesparelse.Forlænger motorens levetid og reducerer friktionen af de bevægelige dele.Forebygger effektivt LSPI (lavhastigheds tændingsbanken).Fremragende lavtemperaturegenskaber og det længst mulige skifteinterval ifølge producenten.Ekstremt lav fordampningstendens indebærer lavt olieforbrug og reduceret miljøforurening.Olien er ideel til moderne biler og lette lastbiler med turboladede benzin- og dieselmotorer med høj ydeevne. Den størst mulige driftssikkerhed og tilstrækkelige effektreserver er altid garanteret, selv under ugunstige driftsforhold.Olien er specielt udviklet til:De seneste producentspecifikationer fra Mercedes, BMW, Opel & JaguarMange asiatiske køretøjer som Honda, Hyundai, Kia, Mazda, Mitsubishi, Nissan, Subaru, Suzuki og ToyotaMange andre køretøjer, hvor der kræves en motorolie i henhold til ACEA C5 eller API SN/SN-RCi kombination med viskositetsklasse SAE 0W-20Opfylder følgende specifikationer:ACEA C5API SP-RC, SP, SN PLUS-RC, SN-PLUS, SN-RC, SNBMW LL-17FE+, LL-14FE+Chrysler MS-12145Fiat 9.55535-GSXFord WSS M2C947-B1, M2C962-A1ILSAC GF-6A, GF-5JAGUAR LAND ROVER STJLR.03.5006MB 229.72, 229.71Opel OV0401547 (GM dexos D)Volvo VCC-RBS0-2AEVigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-8601_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1905, 'Fuldsyntetisk motorolie 0W-20, ACEA C5, 1 liter', 18, 49.9, 'Fuldsyntetisk olie med egenskaber optimeret til skandinaviske kørselsforhold og udviklet til motorer, der kræver olie med lav viskositet. Typiske anvendelser er benzin- og dieselmotorer fremstillet af Volvo siden 2014 samt nogle Toyota-modeller.Udviklet til Volvos benzin- og dieselmotorer fremstillet efter 2014.Også velegnet til motorer konstrueret til olie med viskositet 0W-20, såsom nogle Toyota modeller og hybridbiler.Reducerer motorens interne tab, bidrager til at forbedre brændstoføkonomien og reducere CO-emissionerne.Effektiv beskyttelse mod motorslid.Opfylder følgende specifikationer:ACEA C5API SN, SLILSAC GF-5Volvo VCC RBS0-2AEVigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-840_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1906, 'Fuldsyntetisk motorolie 0W-20, ACEA A1/B1/C5, 4 liter', 25, 299.0, 'Dette er en avanceret motorolie, der er udviklet til de nyeste generationer af højtydende motorer fra VW-koncernen.Olien er en grøn, fuldsyntetisk, low-ash, lavviskøs olie, der er ideel til benzin- og dieselbiler med direkte indsprøjtning (TSI og TDI) i kombination med turboladere samt de mest moderne systemer til efterbehandling af udstødningsgassen (DPF, GPF og SCR). Den avancerede additivteknologi i kombination med polyalphaolefin (PAO) som baseolie sikrer den bedst mulige ydeevne i hele serviceintervallet.EgenskaberViskositetsklassen SAE 0W-20 garanterer optimal brændstofbesparelse samt reducerede CO2-emissionerOpfylder eller overstiger alle krav til forlængede serviceintervaller (WIV) LongLife IVPå grund af den grønne farve undgår man i videst muligt omfang at forveksle den med andre motorolierDen nyeste additivteknologi giver mulighed for lang levetid for alle motorkomponenter som følge af optimal slidbeskyttelse og den bedst mulige renholdelse af motoren.Fremragende pålidelighed selv på korte ture, stop-and-go trafik og selv under ekstreme klimatiske forholdOlien er ideel til moderne biler og lette lastbiler med turboladede benzin- og dieselmotorer med høj ydeevne. Den størst mulige driftssikkerhed og tilstrækkelige effektreserver er altid garanteret, selv under ugunstige driftsforhold.Olien er specielt udviklet til:Køretøjer fra VW-koncernen Audi/ Seat/ Skoda/ VW/ Cupra, som kræver smøremidler i henhold til specifikationen VW 508 00/509 00.Porsche benzin- og dieselmotorer, hvor der kræves et smøremiddel i henhold til fabriksstandarden Porsche C20.Mange andre køretøjer, hvor der kræves en motorolie i henhold til ACEA C5 i kombination med viskositetsklasse SAE 0W-20.Opfylder følgende specifikationer:ACEA A1/B1/C5Porsche C20VW 508 00/509 00Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-8603_xl_1.jpg');
