lieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Indeholder C14-16-18 Alkyl phenol. Kan udløse allergisk reaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-8602_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1909, 'Helsyntetisk motorolie 0W–20', 1, 89.9, 'Udviklet til de nyeste benzinmotorer i japanske biler, hvor kravene til ydelse og smøreegenskaber er meget høje. Fremmer god brændstoføkonomi samt reduceret fiktion og slitage. Glimrende koldstartegenskaber.Opfylder følgende specifikationer: ILSAC GF-6A, API SP.Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9501_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1910, 'Helsyntetisk motorolie 0W–20', 31, 49.9, 'Helsyntetisk motorolie der er udviklet til brug i de nyeste versioner af Volvos diesel- og benzinmotorer. De der er kompatible med Euro 6, hvilket kræver smøring med lav viskositet. Olien forbedrer brændstoføkonomien, reducerer friktionen og forbedrer beskyttelsen fra koldstart til kørsel ved høj temperatur.Opfylder følgende specifikationer: ACEA C5, API SN, Volvo VCC RBS0-2AE.Indeholder C14-16-18 ALKYL PHENOL Kan udløse allergisk reaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Indholdet/beholderen bortskaffes i overensstemmelse med nationale regler.Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9013_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1911, 'Hydraulikolie VG 15, 1 liter', 8, 89.9, 'Hydraulikolie der er velegnet til hydrauliske systemer, der arbejder under varierende temperaturer. Typiske anvendelser er forskellige løftesystemer, donkrafter, lastbilhydraulik-systemer og pumper. Vælg viskositet efter driftstemperatur og pumpe i henhold til fabrikantens instruktioner.Fremragende koldtflydende egenskaber gør olien ideel til lave temperaturer og krævende brug.Giver effektiv beskyttelse mod slid og korrosion af systemerne.Har gode egenskaber til at modstå nedbrydning af viskositetOpfylder følgende specifikationer:DIN 51524 part 3 (HVLP)Eaton I-286-S, M-2950-SDangerH304 May be fatal if swallowed and enters airways.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9119_xl_1.jpg');
