INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1913, 'Hydraulic Oil ISO 46, 20 litre', 10, 549.0, 'Industrial oil for indoor and outdoor hydraulics. Typical applications include lubrication and circulation systems in industrial high-pressure systems, lightly loaded gears and roller bearings.The oil is based on high-quality base oils and advanced additives that protect against wear, oxidation and corrosion. In addition, the oil has excellent hydrolytic stability and filterability.Conforms to the following specifications: DIN 51524 Part 2 (HLP), Eaton Vickers I-286-S, M-2950-S, Denison HF-0, HF-1, HF-2, Cincinnati Machine P-70 (Hydraulic ISO 46).', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9125_xl_1.jpg');
