INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1922, 'Single Grade SAE 50', 29, 34.9, 'For classic motorbikes and certain veteran vehicles where a straight oil must be used. The oil is viscous when cold - warm up the engine with care. Copes with very high temperatures. Suitable for engines with a separate oil tank which is placed higher than the crank housing (motorbikes), where the oil, thanks to the thicker viscosity, cannot so easily run through the oil pump down into the crank housing when the engine is not running. Not suitable for use in very low temperatures ( -10 °C and lower). Meets the following specifications: ACEA A2/B2, API SJ. 1 l.1 LHarmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-929_xl_1.jpg');
