INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1932, 'Semisyntetisk motorolie 10W–40', 31, 49.9, 'Delsyntetisk multigradeolie til 4-takts benzin- og dieselmotorer, med eller uden turbo. Lavfriktionsolie der giver et bidrag til lavere brændstofforbrug. Oliens høje kvalitet holder motoren ren og sikrer god smøring ved koldstart og hård kørsel med høje temperaturer. Anbefales til såvel nye personbiler som mindre erhvervskøretøjer. Virker også godt til lidt ældre køretøjer. Kan blandes med andre motorolier. Kan anvendes hele året.Opfylder følgende specifikationer: ACEA A3/B3, A3/B4, API SL/CF, MB 229.1.Forårsager alvorlig øjenirritation. Skadelig for vandlevende organismer, med langvarige virkninger. Indeholder CALCIUM LONG CHAIN ALKARYL SULFONATE. Kan udløse allergisk reaktion. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Vask hænderne grundigt efter brug. Undgå udledning til miljøet. Bær beskyttelseshandsker/beskyttelsestøj/øjenbeskyttelse/ansigtsbeskyttelse. VED KONTAKT MED ØJNENE: Skyl forsigtigt med vand i flere minutter. Fjern eventuelle kontaktlinser, hvis dette kan gøres let. Fortsæt skylning. Ved vedvarende øjenirritation: Søg lægehjælp. Indholdet/beholderen bortskaffes i overensstemmelse med nationale regler.Vigtig information ved skift af motorolieKontroller altid, hvor meget motorolie din motor skal have. Oplysningerne findes i bilens instruktionsbog.Når du skifter olie, bør oliefilteret også skiftes.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/Image/product/xlarge/2000022956/4');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1933, 'Cleaning Oil', 37, 229.0, 'For internal engine cleaning. Dissolves old deposits and dirt. Effective against oil sludge. Particularly useful for removing deposits that can build up in e.g. valve tappets or oil ducts. Can be used in e.g. old engines that have not had an oil change in a long time. For use during oil changing and results in a clean, well-functioning engine. Can be used in both petrol and diesel engines. Also suitable for flushing hydraulic systems.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-42_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1934, 'Engine oil stabiliser, 250 ml', 30, 79.9, 'Oil additive for all types of engines. Increases and stabilises viscosity, oil pressure and engine density. The oil additive reduces friction wear, transmission noise and oil consumption in high mileage car engines.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-003_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1935, 'Universal oil 10W-30, 20 litre', 40, 749.0, 'Universal transmission oil (UTTO) for hydraulic and transmission systems for tractors and other machinery in agriculture and construction equipped with wet brakes. It is suitable for use in applications that use the same oil in transmissions, axles and hydraulics. With a focus on good wear resistance and smooth, silent use of wet brakes.Conforms to the following specifications: SAE 80; API GL-4; Allison C4; CAT TO-2; Case NH CNH MAT 3505, 3509, 3525; Case MS B6, 1206, 1207; Ford ESN-M2C 86B/C, 134D, FNHA-2-C-200.00; John Deere J20C; Kubota UDT Fluid; MF CMS M 1100, 1127A/B, 1141, 1143, 1145; VCE WB 101; ZF TE-ML 05F, 06K, 17E.EUH208 Contains .?. May produce an allergic reaction.EUH210 Safety data sheet available on request.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9126_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1936, 'Universal oil 10W-30, 20 l', 24, 699.0, 'High-quality universal oil (UTTO) for agricultural and construction machinery. Designed for use in diesel and petrol engines with our without turbochargers, transmissions, hydraulics, rear axles, and wet brakes. Suitable for year-round use.Conforms to the following specifications: API GL-4, Allison C-4, Case MS 1206, CAT TO-2, Ford ESN-M2C134-D, JDM J20C, MF M-1135, MF M-1143, NH 410B, Ford M2C86C, CNH MAT 3525, Ford M2C134-A.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9050_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1937, 'Universal oil 10W-30, 10 l', 31, 399.0, 'High-quality universal oil (STOU) for agricultural and construction machinery. Designed for use in diesel and petrol engines with our without turbochargers, transmissions, hydraulics, rear axles, and wet brakes. Suitable for year-round use.Conforms to the following specifications: ACEA E3, Allis Chalmers, Allison C-4, API CG-4/SF, API GL-4, CASE-IH 1207, Cat TO-2, Caterpillar Series III, CCMC D4, Ford M2C86C, Ford M2C134D, Ford M2C159B/C, FNH Material Spec 82008201/2/3, John Deere J20C, John Deere J27, MB 227.1, MF 1135/1143, MF 1139/M1144/1145, MIL-L-2104B, MIL-L2104D, MIL-L46152A, Volvo B20, ZF TE ML 06, 07, 12.WarningCauses serious eye irritation.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-994_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1938, 'Transmissionsolie ATF DX III, 4 liter', 27, 219.0, 'Halvsyntetisk gearkasseolie. Til automatgearkasser, der hvor der foreskrives en ATF-olie af type Dexron® III, Dexron® II. Også til bestemte hydrauliske transmissioner, servostyretøjer m.m.Olien opfylder følgende specifikationer:GM Dexron IIIHFord MerconAllison C4, TES-389MB 236.1, -2, -5MAN 339 Type Z1, V1Volvo 97341 (AT 101)Voith 55.6335: CAT TO-2ZF TE-ML 02F, 03D, 04D, 05L, 09, 11A/B, 14A, 17C, 21L.Skadelig for vandlevende organismer, med langvarige virkninger. Opbevares utilgængeligt for børn. Hvis der er brug for lægehjælp, medbring da beholderen eller etiketten. Undgå udledning til miljøet. Indholdet/beholderen bortskaffes i den lokale genbrugsstation/miljøstation.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-019_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1939, 'Transmissionsolie ATF DX III, 1 liter', 23, 79.9, 'Halvsyntetisk gearkasseolie. Til automatgearkasser, der hvor der foreskrives en ATF-olie af type Dexron® III, Dexron® II. Også til bestemte hydrauliske transmissioner, servostyretøjer m.m.Olien opfylder følgende specifikationer:GM Dexron IIIHFord MerconAllison C4, TES-389MB 236.1, -2, -5MAN 339 Type Z1, V1Volvo 97341 (AT 101)Voith 55.6335: CAT TO-2ZF TE-ML 02F, 03D, 04D, 05L, 09, 11A/B, 14A, 17C, 21L.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-018_xl_1.jpg');
