INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1942, 'Steering servo oil CHF, 1 L', 7, 139.0, 'Fully-synthetic CHF 11S steering servo oil, based on green hydraulic fluid.  Suitable for use in certain steering servos, suspension systems, traction control systems, electrically-operated soft-tops and central locking systems. Recommended for, among others, VW, Audi, Seat and Skoda, as well as steering servos and hydraulic suspension systems on certain Citroen models. The oil has a high ageing stability, optimal viscosity, excellent fluidity at low temperatures and provides excellent sealing and corrosion protection.Meets the following specifications:CHF 11CHF 11SCHF 202DangerH304 May be fatal if swallowed and enters airways.H332 Harmful if inhaled.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-027_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1943, 'Transmission Oil, Type G', 10, 84.9, 'Recommended for automatic transmissions/gearboxes requiring Type G oil (Ford M2C33-F and G). Can also be used for manual gearboxes (Volvo) for which ATF oil Type G is recommended. The oil is also suitable for power steering, and a number of hydraulic transmissions and hydraulic systems, etc.The transmission oil has a long shelf life, and it is gentle on seals and gaskets, which minimises the risk of leaks. It has good oxidation stability, and contains additives that counter wear, foaming and corrosion. The high viscosity index and low minimum temperature ensure good year-round performance. Conforms to the following specifications:Ford M2C33-F and G, Borg Warner. 1 l.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-985_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1944, 'Dual-clutch oil, 1 litre', 32, 109.0, 'High-performance transmission oil for dual-clutch transmissions. Suitable for most dual-clutch transmissions for wet clutches on the market. Excellent protection even under high pressure. Protection against leakage. Pumpable at exceptionally low temperatures. Lubricates joints, gears, axles, bearings and synchronising rings. Protects the transmission from wear and corrosion.Conforms to the following specifications:MB 236.21 (001 989 85 03)Ford M2C936APSA 9734.S2BMW 83 22 2 147 477BMW 83 22 2 148 578BMW 83 22 2 148 579VW/Skoda/Seat TL 052 529/052 182Volvo 116 1838, 116 1839EUH208 Contains 2-ethylhexyl methacrylate; 2-tetradecyloxirane, reaction products with boric acid. May produce an allergic reaction.H412 Harmful to aquatic life with long lasting effects.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/34-028_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1945, 'Dubbelkopplingsolja', 20, 109.0, 'Högpresterande transmissionsolja för dubbelkopplingslåda. Passar de flesta av marknadens dubbelkopplingslådor av våt typ. Utmärkt skydd även under högt tryck. Skydd mot läckage. Pumpbar vid exceptionellt låga temperaturer. Smörjer kopplingar, växlar, axlar, kullager och synkroniseringsringar. Skyddar transmissionen mot slitage och korrosion. 1 l.Specifikationer:VW TL 052182/529, BMW 83 22 2 148 578/579, BMW 83 22 2 147 477, BMW 83 22 0 440 214, Peugeot/Citroen 9734.S2, Ford M2C936A, MB236.21 (001 989 85 03), MZ320065 Dia-Queen SSTF-1, Porsche Oil No. 999.917.080.00, Volvo 116 1838, 116 1839.Harmful to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9890_xl_1.jpg');
