INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1947, 'Transmissionsolie Limited Slip', 14, 129.0, 'Mineraloliebaseret gearkasseolie specielt udviklet og godkendt til personbiler og tunge køretøjer (entreprenørmaskiner, landbrugsmaskiner) udstyret med Limited Slip (differentialebremse). Specifikationer: API GL-5, ZF TE-ML 05C, ZF TE-ML 12C, ZF TE-ML 16E, ZF TE-ML 21C. 1 l.Contains REACTION PRODUCTS OF BIS(4-METHYLPENTAN-2-YL)DITHIOPHOSPHORIC ACID WITH PHOSPHORUS OXIDE, PROPYLENE OXIDE AND AMINES, C12-14 ALKYL (BRANCHED). May produce an allergic reaction.Toxic to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9750_xl_1.jpg');
