INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1952, 'CVT-U Gearkasseolie 1L', 1, 109.0, 'En helsyntetisk, high performance gearolie fremstillet til at beskytte mod slitage i trinløst variable gearkasser. Biltema CVT-U yder god anti-slitage, optimale lavtemperaturegenskaber og metal-mod-metal friktionsegenskaber. Passer til: Audi/VW TL 52180; G052 180, Honda HMMF, Nissan NS-2, Subaru NS-2/ Lineartronic CVTF, Hyundai/ Kia SP-III, Dodge/Jeep NS-2/CVTF +4, Ford CVT23, Ford CVT30/ Mercon C, Toyota TC, Mitsubishi CVTF-J1/SP-III, Mini Cooper EZL 799, Suzuki TC/NS-2/CVT Green 1, GM/Saturn DEX-CVT, MB 236.20.Fordele* Bestandig og forskydningsstabil viskositet * Gode og holdbare friktionsegenskaber * Beskytter mod korrosion * God smøreevne med kraftig slitagebeskyttelseShow safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-9101_xl_1.jpg');
