INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1955, 'Gearolie, helsyntetisk 75W-90', 11, 89.9, 'Til manuelle gearkasser, bagaksler, differentialer, slutgear, m.m. Ikke aggressiv mod såkaldte gule metaller. Opfylder følgende specifikationer: API GL-5, MIL-L-2105D, MAN 342-M1, ZF TE-ML 07A, ZF TE-ML 08. 1 l.Contains REACTION PRODUCTS OF BIS(4-METHYLPENTAN-2-YL)DITHIOPHOSPHORIC ACID WITH PHOSPHORUS OXIDE, PROPYLENE OXIDE AND AMINES, C12-14 ALKYL (BRANCHED). May produce an allergic reaction.Toxic to aquatic life with long lasting effects.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-997_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1956, 'Catalytic converter, petrol, universal', 35, 769.0, 'A universal catalytic converter for use in petrol cars with cylinder volumes up to 2.5 L. Optional flow direction. Fits exhaust pipes with external diameters of: 57.2 mm. With joiner pipes for welding to catalytic converters with external diameters of: 53.5 mm and 51 mm. Socket for lambda sensor. E-certified for cars manufactured 31/12/1997 or earlier.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/79-800_xl_1.jpg');
