INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1958, 'Racing catalytic converter, universal', 34, 1899.0, '100-cell universal racing catalytic converter. SBF and FIA approved, SBF 08-022. For petrol engines with up to 4 L cylinder volumes. In stainless steel. 100 cpsi (cell per square inch) full-flow monolithic catalyst support that increases exhaust flow considerably and withstands extreme temperatures (max. 1300 °C). The metal core is brazed to the outer housing for a long service life. Conical ends for maximum exhaust flow. Optional flow direction. Lambda sensor socket: M18 x 1.5 mm. Only approved for competition use.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/79-804_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (1959, 'Sports catalytic converter, universal', 30, 1499.0, '200-cell universal sports catalytic converter. For petrol engines with up to 4 l displacement. In stainless steel. 200 cpsi (cell per square inch) metallic monolith core that increases exhaust flow considerably and withstands extreme temperatures (max. 1,300°C). The metal core is brazed to the outer housing for a long lifespan. Conical ends for maximum exhaust flow. Optional flow direction. Heat shield. Lambda sensor socket: M18 x 1.5 mm.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/79-805_xl_1.jpg');
