INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3478, 'Radiator sealant, 443 ml', 13, 39.9, 'Stems and seals all leaks in cooling systems without clogging cooling cells or damaging fragile parts. Can be used together with glycol. The freezing point of the product is 0 °C. The efficacy of the product is not affected by freezing and can be used normally once thawed. The bottle must be shaken well before use.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1825_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3479, 'Optical glycol and fluid tester', 35, 279.0, 'Optical meter with adjustable optics. Measures the antifreeze level in coolant and windscreen washer fluid, including AdBlue. Measures both ethylene glycol (G11/G12/G13) and propylene glycol. Also measures battery acid to determine the battery’s condition. Made of metal with rubberised grip. Supplied with a pipette for drawing up liquid, a screwdriver for calibration, and a plastic storage box with padded compartments.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/37-609_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3480, 'Radiator Cleaner, 443 ml', 10, 44.9, 'Effectively removes rust and other contaminants in radiators without damaging the cell system, hoses or other fragile components. Restores radiators to their original condition. Can be used together with glycol.DangerCauses serious eye damage.Show safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1829_xl_1.jpg');
