INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3482, 'Anti-Freeze Tester', 6, 32.9, 'Easy-to-read model with clear indicators for boiling point and frost protection. Measures frost protection and boiling point of ethylene glycol.Freezing point range: -43 °C – -12 °C.Boiling point range: 124 °C – 131 °C.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/15-1409_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3483, 'Antifreeze, universal, concentrate, 1 kg', 4, 19.9, 'High-quality antifreeze with extra-long life based on an inhibitor package with organic acid. Provides very effective protection against frost, corrosion and overheating. Can be mixed with other ethylene glycol-based coolant fluids. Dilute with water. The antifreeze is colourless and does not change the original colour when filling.WarningHarmful if swallowed.Causes serious eye irritation.May cause damage to organs through prolonged or repeated exposure <or state all organs affected, if knownShow safety phrases', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/36-1798_xl_1.jpg');
