INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3685, 'Lambda sensor with 4 cables', 39, 299.0, 'Most modern engines are equipped with a lambda sensor (oxygen sensor), which is usually located in the front exhaust pipe (straight underneath the manifold) or in the catalytic converter, and measures the concentration of non-combusted oxygen in the exhaust gases. Data on the oxygen concentration is transmitted to the car’s control unit, which then calculates the correct amount of fuel to supply the engine. If the incorrect amount is supplied to the engine, this is immediately rectified by the control unit based on the information from the lambda sensor.Always make sure the fault in the exhaust purifier is due to the lambda sensor before replacing it. The new lambda sensor can be damaged by other faults in the exhaust purifier. A used lambda sensor cannot be returned for refund.Biltema’s universal lambda sensors are suitable for most cars that have original lambda sensors with four connection cables. The sensors are, however, not suitable for cars equipped with Titanium lambda sensors (5 V). A Titanium lambda sensor is recognisable since one of the cables is red.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/52-951_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3686, 'Lambda sensor thread repair kit', 24, 135.0, 'For repairing damaged threads when installing lambda sensors.Contains the following screw taps: 12 mm x 1.25 and 18 mm x 1.5.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/19-1291_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3687, 'Lambda sensor', 5, 749.0, 'Not with REGINA injection system.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/52-955_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3688, 'Lambda sensor with 3 cables', 5, 439.0, 'Most modern engines are equipped with a lambda sensor (oxygen sensor), which is usually located in the front exhaust pipe (straight underneath the manifold) or in the catalytic converter, and measures the concentration of non-combusted oxygen in the exhaust gases. Data on the oxygen concentration is transmitted to the car’s control unit, which then calculates the correct amount of fuel to supply the engine. If the incorrect amount is supplied to the engine, this is immediately rectified by the control unit based on the information from the lambda sensor.Always make sure the fault in the exhaust purifier is due to the lambda sensor before replacing it. The new lambda sensor can be damaged by other faults in the exhaust purifier. A used lambda sensor cannot be returned for refund.Biltema’s universal lambda sensors are suitable for most cars that have original lambda sensors with three connection cables. The sensors are, however, not suitable for cars equipped with Titanium lambda sensors (5 V). A Titanium lambda sensor is recognisable since one of the cables is red.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/52-952_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3689, 'OXYGEN SENSOR', 37, 269.0, 'Most modern engines are equipped with a lambda sensor (oxygen sensor), which is usually located in the front exhaust pipe (straight underneath the manifold) or in the catalytic converter, and measures the concentration of non-combusted oxygen in the exhaust gases. Data on the oxygen concentration is transmitted to the car''s control unit, which then calculates the correct amount of fuel to supply the engine. If the incorrect amount is supplied to the engine, this immediately rectified by the control unit based on the information from the lambda sensor.Always make sure the fault in the exhaust purifier is due to the lambda sensor before replacing it. The new lambda sensor can be damaged by other faults in the exhaust purifier. A used lambda sensor cannot be returned for refund.Biltema''s universal lambda sensors are suitable for most cars that have lambda sensors with one, two, three or four connection cables. The sensors are, however, not suitable for cars equipped with Titanium lambda sensors (5 V). A Titanium lambda sensor is recognisable since one of the cables is red.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/52-950_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3690, 'OXYGEN SENSOR', 19, 339.0, 'Most modern engines are equipped with a lambda sensor (oxygen sensor), which is usually located in the front exhaust pipe (straight underneath the manifold) or in the catalytic converter, and measures the concentration of non-combusted oxygen in the exhaust gases. Data on the oxygen concentration is transmitted to the car''s control unit, which then calculates the correct amount of fuel to supply the engine. If the incorrect amount is supplied to the engine, this immediately rectified by the control unit based on the information from the lambda sensor.Always make sure the fault in the exhaust purifier is due to the lambda sensor before replacing it. The new lambda sensor can be damaged by other faults in the exhaust purifier. A used lambda sensor cannot be returned for refund.Biltema''s universal lambda sensors are suitable for most cars that have lambda sensors with one, two, three or four connection cables. The sensors are, however, not suitable for cars equipped with Titanium lambda sensors (5 V). A Titanium lambda sensor is recognisable since one of the cables is red.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/52-954_xl_1.jpg');
INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3691, 'Titanium lambda sensor', 9, 599.0, 'A lambda sensor measures oxygen concentration in car exhaust gases. Faults are often detected through higher fuel consumption, uneven engine output, and/or a warning light shining on the dashboard.4-wire titanium lambda sensor with universal design. The sensor provides 1–5 V between the signal cable and chassis/earth in the vehicle. A clear indicator is the lambda sensor''s read and yellow cables.Red cable– Preheating +Yellow cable– Preheating -Black cable– Signal +Yellow cable– Signal -', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/52-980_xl_1.jpg');
