INSERT INTO shop.product (id, name, brand_id, price, description, create_timestamp, category_id, img_url) VALUES (3736, 'Wiper blade, 400 mm (16)', 6, 29.9, 'Wiper blade that provides an additional protective membrane for improved friction, noise level and water repellency. Equipped with proven technology at a very attractive price.The wiper blades have good wiping capacity and a long service life, and the stable spring design produces the correct pressure against the windscreen.Fits wipers with hook brackets. Adapter for pin fitting supplied.Select wiper blades with the correct fitting and correct length.Keep in mind that modern cars often have different lengths for the driver and passenger side, so always measure the blade lengths.Fits wiper brackets: A, B, K, LNOTE! The wiper blade is a wearing part that should be replaced every 12 months, but the recommendation is to replace the wiper blades every 6 months, e.g. at the same time seasonal tyres are changed.', '2023-05-15 15:12:27', 14, 'https://productimages.biltema.com/v1/image/imagebyfilename/58-437_xl_1.jpg');
