CREATE TYPE shop.product_quantity_pair AS (
    p_id INT,
    p_quantity INT
);

-- decrease product count function
CREATE OR REPLACE FUNCTION shop.decrease_product_availability(
	pairs shop.product_quantity_pair[])
    RETURNS text
    LANGUAGE 'plpgsql'
    COST 100
    VOLATILE PARALLEL UNSAFE
AS $BODY$
DECLARE
    current_count INT;
    pair shop.product_quantity_pair;
    return_message TEXT := 'OK';
BEGIN
    -- Loop through each product and check availability
    FOREACH pair IN ARRAY pairs LOOP
        -- Lock the row for update to prevent concurrent modifications
        SELECT pa.quantity INTO current_count
        FROM shop.product_availability pa
        WHERE pa.product_id = pair.p_id
        FOR UPDATE;

        -- Check if there is enough stock
        IF current_count < pair.p_quantity THEN
            return_message := 'Insufficient stock for product ' || pair.p_id || ': requested ' || pair.p_quantity || ', available ' || current_count;
            RETURN return_message;
        END IF;
    END LOOP;

    -- If all products have sufficient stock, proceed to update quantities
    FOREACH pair IN ARRAY pairs LOOP
        -- Decrease the availability count
        UPDATE shop.product_availability
        SET quantity = quantity - pair.p_quantity
        WHERE product_id = pair.p_id;
    END LOOP;

    RETURN return_message;
EXCEPTION
    WHEN OTHERS THEN
        return_message := 'An error occurred: ' || SQLERRM;
        RETURN return_message;
END;
$BODY$;

ALTER FUNCTION shop.decrease_product_availability(shop.product_quantity_pair[])
    OWNER TO masteruser;


--- update availability --

CREATE OR REPLACE FUNCTION shop.update_product_availability(
	p_id integer,
	p_quantity integer)
    RETURNS integer
    LANGUAGE 'plpgsql'
    COST 100
    VOLATILE PARALLEL UNSAFE
AS $BODY$
DECLARE
    current_count INT;
    new_count INT;
BEGIN
    SELECT pa.quantity INTO current_count
    FROM shop.product_availability pa
    WHERE pa.product_id = p_id
    FOR UPDATE;

    UPDATE shop.product_availability
    SET quantity = p_quantity
    WHERE product_id = p_id
    RETURNING quantity INTO new_count;

    RETURN new_count;

EXCEPTION
    WHEN OTHERS THEN
        RAISE;
END;
$BODY$;

ALTER FUNCTION shop.update_product_availability(integer, integer)
    OWNER TO masteruser;


